/*Table structure for table `tblauthinfo` */

DROP TABLE IF EXISTS `tblauthinfo`;

CREATE TABLE `tblauthinfo` (
  `ID` int(11) NOT NULL AUTO_INCREMENT,
  `UserName` varchar(128) NOT NULL,
  `PassWord` varchar(128) NOT NULL,
  `Disabled` tinyint(1) DEFAULT '0',
  `StartTime` datetime DEFAULT NULL,
  `EndTime` datetime DEFAULT NULL,
  `MaxUserNum` int(11) DEFAULT '0',
  `MaxConnNum` int(11) DEFAULT '0',
  `MaxDomainNum` int(11) DEFAULT '0',
  `Remarks` varchar(128) NOT NULL,
  `Removed` tinyint(1) DEFAULT '0',
  `MachineCode` int(11) DEFAULT NULL,
  `Sf_Last_Sync_TimeStamp` datetime DEFAULT NULL,
  PRIMARY KEY (`ID`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8;

/*Data for the table `tblauthinfo` */

