insert  into `tbldbfuncinfo`(`ID`,`Name`,`Alias`,`szSql`,`szDesc`,`Type`,`CreateTime`,`LastChangeTime`,`PlanType`,`PlanTime`,`intervaltm`,`wParam`,`lParam`,`CalcStartTime`,`inexistence`,`CreateSql`) values (1,'SK_PRO_1','01、删除绩效奖金单及明细','CREATE PROCEDURE proc_deleteJiXiaoJiangJinDanJiMingXi(IN JiXiaoJiangJin_ID varchar(255))\r\nBEGIN\r\n	DECLARE t_error int DEFAULT 0;\r\n	DECLARE CONTINUE HANDLER FOR SQLEXCEPTION SET t_error=1;\r\n	START TRANSACTION;\r\n\r\n	-- 删除绩效奖金主表\r\n	DELETE FROM SKT16 WHERE SKT16.SKF416 = JiXiaoJiangJin_ID;-- 绩效奖金单号\r\n\r\n	-- 删除绩效奖金子表\r\n	DELETE FROM SKT17 WHERE SKT17.SKF428 = JiXiaoJiangJin_ID;-- 绩效奖金单号\r\n\r\n	IF t_error = 1 THEN  \r\n			ROLLBACK;  \r\n	ELSE  \r\n			COMMIT;  \r\n	END IF; \r\n \r\nEND;','',2,'2018-11-28 15:23:51',NULL,0,'1970-01-01 00:00:00',0,0,0,NULL,0,NULL),(2,'SK_PRO_2','02、删除中夜班补贴申请单及其子表','CREATE PROCEDURE proc_zhongyebanbutieshenqdanjiqizibiao(IN ShenQingDanHao VARCHAR(255))\r\nBEGIN\r\n DECLARE t_error INT DEFAULT 0;\r\n DECLARE CONTINUE HANDLER FOR SQLEXCEPTION SET t_error=1;\r\n START TRANSACTION;\r\n\r\n-- 删除中夜班补贴申请单号\r\nDELETE FROM skt27 WHERE skt27.SKF556=ShenQingDanHao;-- 中夜班补贴单号\r\n\r\n-- 删除中夜班补贴申请子表单号\r\nDELETE FROM skt28 WHERE skt28.SKF571=ShenQingDanHao;-- 中夜班补贴申请子表单号\r\n\r\n IF t_error = 1 THEN  \r\n   ROLLBACK;  \r\n ELSE  \r\n   COMMIT;  \r\n END IF; \r\n \r\nEND;\r\n','',2,'2018-11-28 15:23:51',NULL,0,'1970-01-01 00:00:00',0,0,0,NULL,0,NULL),(8,'SK_PRO_8','03、当天默认上下班时间','CREATE PROCEDURE proc_updateSheDingDangTianYingShangXiaBanShiJian(IN KaoQin_id varchar(255)/*, IN KaoQin_date date*/)\r\nBEGIN\r\n	-- DECLARE SKF159_GongHao varchar(255);-- SKF159\r\n\r\n	DECLARE not_found INT DEFAULT 0;\r\n	DECLARE t_error int DEFAULT 0;\r\n	DECLARE CONTINUE HANDLER FOR SQLEXCEPTION SET t_error=1;\r\n	START TRANSACTION;\r\n\r\n	-- 更新 SKT6\r\n	update SKT6,-- SKT6\r\n	SKT21-- SKT21\r\n	set SKT6.SKF166 = SKT21.SKF586,-- SKT6.应上班时间 = 排班明细.应上班时间\r\n	SKT6.SKF167 = SKT21.SKF587-- SKT6.应下班时间 = 排班明细.应下班时间\r\n	where SKT6.SKF159 = SKT21.SKF495-- SKT6.SKF159 = 排班明细.工号\r\n	and SKT6.SKF153 = KaoQin_id-- SKT6.考勤编号\r\n	and SKT6.SKF170 = SKT21.SKF831;-- SKT6.SKF170 = 排班明细.考勤日期\r\n/*\r\n	begin\r\n	DECLARE cur_1 CURSOR FOR SELECT SKF159-- SKF495\r\n	FROM SKT6-- SKT6\r\n	where SKF153 = KaoQin_id;-- 考勤编号\r\n	DECLARE CONTINUE HANDLER FOR NOT FOUND SET not_found=1;\r\n\r\n	OPEN cur_1;\r\n		WHILE not_found = 0 DO \r\n			FETCH cur_1 INTO SKF159_GongHao;\r\n\r\n			if not_found=0 then\r\n\r\n				-- 更新 SKT6\r\n				update (select SKF586-- 应上班时间\r\n					FROM SKT21\r\n					WHERE SKF495 = SKF159_GongHao-- SKF159\r\n					and DATE_FORMAT(SKF586, \'%Y-%m-%d\') = KaoQin_date-- 应上班时间\r\n					GROUP BY SKF586\r\n				) AS t1, SKT6 set SKT6.SKF166 = t1.SKF586-- SKF166\r\n				where SKT6.SKF153 = KaoQin_id-- 考勤编号\r\n				and SKT6.SKF159 = SKF159_GongHao;-- SKF159\r\n\r\n				update (select SKF587-- 应下班时间\r\n					FROM SKT21\r\n					WHERE SKF495 = SKF159_GongHao-- SKF159\r\n					and DATE_FORMAT(SKF586, \'%Y-%m-%d\') = KaoQin_date-- 应上班时间\r\n					GROUP BY SKF587\r\n				) AS t1, SKT6 set SKT6.SKF167 = t1.SKF587-- SKF167\r\n				where SKT6.SKF153 = KaoQin_id-- 考勤编号\r\n				and SKT6.SKF159 = SKF159_GongHao;-- SKF159\r\n\r\n			end if;\r\n		END WHILE;\r\n	CLOSE cur_1;\r\n	end;\r\n*/\r\n	IF t_error = 1 THEN\r\n			ROLLBACK;\r\n	ELSE\r\n			COMMIT;\r\n	END IF;\r\n\r\nEND;','',2,'2018-11-28 15:23:51',NULL,0,'1970-01-01 00:00:00',0,0,0,NULL,0,NULL),(9,'SK_PRO_9','04、删除每日考勤主表及明细','CREATE PROCEDURE proc_deleteMeiRiKaoQinZhuBiaoJiMingXi(IN KaoQin_id varchar(255))\r\nBEGIN\r\n	DECLARE t_error int DEFAULT 0;\r\n	DECLARE CONTINUE HANDLER FOR SQLEXCEPTION SET t_error=1;\r\n	START TRANSACTION;\r\n\r\n	-- 删除每日考勤主表\r\n	DELETE FROM SKT5 WHERE SKT5.SKF145 = KaoQin_id;-- 考勤编号\r\n\r\n	-- 删除每日考勤子表\r\n	DELETE FROM SKT6 WHERE SKT6.SKF153 = KaoQin_id;-- 考勤编号\r\n\r\n	IF t_error = 1 THEN\r\n			ROLLBACK;\r\n	ELSE\r\n			COMMIT;\r\n	END IF;\r\n\r\nEND;\r\n','',2,'2018-11-28 15:23:51',NULL,0,'1970-01-01 00:00:00',0,0,0,NULL,0,NULL),(11,'SK_PRO_11','05、删除生产加班主表及其子表（加班申请单表）','CREATE PROCEDURE proc_shengchanjiabanzhubiaojiqizibiao(IN ShenQingDanHao VARCHAR(255))\r\nBEGIN\r\n DECLARE t_error INT DEFAULT 0;\r\n DECLARE CONTINUE HANDLER FOR SQLEXCEPTION SET t_error=1;\r\n START TRANSACTION;\r\n\r\n-- 删除生产加班主表单号及其内容\r\nDELETE FROM skt10 WHERE skt10.SKF247=ShenQingDanHao;-- 生产加班主表单号\r\n\r\n-- 删除生产加班子表（SKT11）单号的内容\r\nDELETE FROM skt11 WHERE skt11.SKF263=ShenQingDanHao;-- 加班申请单号\r\n\r\n IF t_error = 1 THEN  \r\n   ROLLBACK;  \r\n ELSE  \r\n   COMMIT;  \r\n END IF; \r\n \r\nEND;','',2,'2018-11-28 15:23:51',NULL,0,'1970-01-01 00:00:00',0,0,0,NULL,0,NULL),(12,'SK_PRO_12','06、删除请假单','CREATE PROCEDURE proc_deleteQingJiaDan(IN QingJia_id varchar(255))\r\nBEGIN\r\n	DECLARE t_error int DEFAULT 0;\r\n	DECLARE CONTINUE HANDLER FOR SQLEXCEPTION SET t_error=1;\r\n	START TRANSACTION;\r\n\r\n	-- 删除请假单表\r\n	DELETE FROM SKT7 WHERE SKT7.SKF200 = QingJia_id;-- 请假单号\r\n\r\n	-- 删除请假单明细表\r\n	DELETE FROM SKT55 WHERE SKT55.SKF833 = QingJia_id;-- 请假单号\r\n\r\n	IF t_error = 1 THEN\r\n			ROLLBACK;\r\n	ELSE\r\n			COMMIT;\r\n	END IF;\r\n\r\nEND;\r\n','',2,'2018-11-28 15:23:51',NULL,0,'1970-01-01 00:00:00',0,0,0,NULL,0,NULL),(13,'SK_PRO_13','07、删除排班计划','CREATE PROCEDURE proc_deletePaiBanJiHua(IN PaiBan_id varchar(255))\r\nBEGIN\r\n	DECLARE t_error int DEFAULT 0;\r\n	DECLARE CONTINUE HANDLER FOR SQLEXCEPTION SET t_error=1;\r\n	START TRANSACTION;\r\n\r\n	-- 删除排班主表\r\n	DELETE FROM SKT20 WHERE SKT20.SKF480 = PaiBan_id;-- 考勤编号\r\n\r\n	-- 删除排班子表\r\n	DELETE FROM SKT21 WHERE SKT21.SKF494 = PaiBan_id;-- 考勤编号\r\n\r\n	IF t_error = 1 THEN\r\n			ROLLBACK;\r\n	ELSE\r\n			COMMIT;\r\n	END IF;\r\n\r\nEND;\r\n','',2,'2018-11-28 15:23:51',NULL,0,'1970-01-01 00:00:00',0,0,0,NULL,0,NULL),(14,'SK_PRO_14','08、生成日常排班计划明细（废止）','CREATE PROCEDURE proc_insertShengChengRiChangPaiBanJiHuaMingXi(IN PaiBan_id varchar(255), IN BuMen varchar(255), IN BanZu varchar(255), IN ChuQinKaiShiRiQi date, IN ChuQinJieShuRiQi date, IN ShangBanShiJian time, IN XiaBanShiJian time, IN GongShiZhi varchar(255))\r\nBEGIN\r\n	DECLARE not_found INT DEFAULT 0;\r\n	DECLARE count_TianShu INT;-- 天数变量\r\n	DECLARE JianGeTianShu INT;-- 间隔天数\r\n	DECLARE DangTianRiQiShiJian datetime;-- 间隔天数\r\n	DECLARE SKF1_GongHao varchar(255);-- SKF495\r\n	DECLARE SKF3_XingMing varchar(255);-- SKF501\r\n	DECLARE SKF31_BuMen varchar(255);-- SKF496\r\n	DECLARE SKF32_BanZu varchar(255);-- SKF497\r\n	DECLARE SKF33_GangWei varchar(255);-- SKF498\r\n	DECLARE SKF34_JiBie varchar(255);-- SKF499\r\n\r\n	DECLARE t_error int DEFAULT 0;\r\n	DECLARE CONTINUE HANDLER FOR SQLEXCEPTION SET t_error=1;\r\n	START TRANSACTION;\r\n\r\n	-- SKT21\r\n	delete from skt21 where SKF494 = PaiBan_id;\r\n\r\n	-- 间隔天数 = 结束日期 - 开始日期 + 1\r\n	set JianGeTianShu = datediff(ChuQinJieShuRiQi, ChuQinKaiShiRiQi) + 1;\r\n\r\n	begin\r\n	DECLARE cur_1 CURSOR FOR SELECT SKF1,-- SKF495\r\n	SKF3,-- SKF501\r\n	SKF31,-- SKF496\r\n	SKF32,-- SKF497\r\n	SKF33,-- SKF498\r\n	SKF34-- SKF499\r\n	FROM skt1-- SKT1\r\n	where SKF31 = BuMen-- SKF31\r\n	and SKF32 = BanZu-- SKF32\r\n	and SKF715 = GongShiZhi-- SKF715\r\n	and SKF29 = \'是\';-- SKF29\r\n	DECLARE CONTINUE HANDLER FOR NOT FOUND SET not_found=1;\r\n\r\n	OPEN cur_1;\r\n		WHILE not_found = 0 DO \r\n			FETCH cur_1 INTO SKF1_GongHao, SKF3_XingMing, SKF31_BuMen, SKF32_BanZu, SKF33_GangWei, SKF34_JiBie;\r\n\r\n			if not_found=0 then\r\n\r\n				set count_TianShu = 0;\r\n				while JianGeTianShu > count_TianShu do\r\n\r\n				-- 生成排班明细\r\n				INSERT INTO `skt21` (-- SKT21\r\n				--  `SKF493`,-- SKF493\r\n				  `SKF494`,-- SKF494\r\n				  `SKF495`,-- SKF495\r\n				  `SKF496`,-- SKF496\r\n				  `SKF497`,-- SKF497\r\n				  `SKF498`,-- SKF498\r\n				  `SKF499`,-- SKF499\r\n				  `SKF501`,-- SKF501\r\n				--  `SF_CREATE_USER`,-- \r\n				--  `SF_LAST_CHANGE_USER`,-- \r\n				--  `SF_CREATE_TIME`,-- \r\n				--  `SF_LAST_CHANGE_TIME`,-- \r\n				--  `MachineCode`,-- \r\n				--  `Sf_Last_Sync_TimeStamp`,-- \r\n				  `SKF586`,-- SKF586\r\n				  `SKF587`,-- SKF587\r\n				  `SKF646`,-- SKF646\r\n				  `SKF831`-- SKF831\r\n				) \r\n				VALUES\r\n				  (\r\n				--    \'SKF493\',-- SKF493\r\n				    PaiBan_id,-- SKF494\r\n				    SKF1_GongHao,-- SKF495\r\n				    SKF31_BuMen,-- SKF496\r\n				    SKF32_BanZu,-- SKF497\r\n				    SKF33_GangWei,-- SKF498\r\n				    SKF34_JiBie,-- SKF499\r\n				    SKF3_XingMing,-- SKF501\r\n				--    \'SF_CREATE_USER\',-- \r\n				--    \'SF_LAST_CHANGE_USER\',-- \r\n				--    \'SF_CREATE_TIME\',-- \r\n				--    \'SF_LAST_CHANGE_TIME\',-- \r\n				--    \'MachineCode\',-- \r\n				--    \'Sf_Last_Sync_TimeStamp\',-- \r\n				    CONCAT(date_add(ChuQinKaiShiRiQi, interval count_TianShu day), \' \', ShangBanShiJian),-- SKF586\r\n				    CONCAT(date_add(ChuQinKaiShiRiQi, interval count_TianShu day), \' \', XiaBanShiJian),-- SKF587\r\n				    GongShiZhi,-- SKF646\r\n				    date_add(ChuQinKaiShiRiQi, interval count_TianShu day)-- SKF586\r\n				  ) ;\r\n\r\n				set count_TianShu = count_TianShu + 1;\r\n				end while;\r\n\r\n			end if;\r\n		END WHILE;\r\n	CLOSE cur_1;\r\n	end;\r\n\r\n\r\n	IF t_error = 1 THEN\r\n			ROLLBACK;\r\n	ELSE\r\n			COMMIT;\r\n	END IF;\r\n\r\nEND;','',2,'2018-11-28 15:23:51',NULL,0,'1970-01-01 00:00:00',0,0,0,NULL,0,NULL),(15,'SK_PRO_15','09、生成综合排班计划明细（废止）','CREATE PROCEDURE proc_insertShengChengZongHePaiBanJiHuaMingXi(IN PaiBan_id varchar(255), IN BuMen varchar(255), IN BanZu varchar(255), IN ChuQinKaiShiRiQi date, IN ChuQinJieShuRiQi date, IN ShangBanShiJian time, IN XiaBanShiJian time, IN GongShiZhi varchar(255), IN PingRiJiaBanXiaoShi INT, IN PingRiYongCanXiaoShi INT, IN ShuangXiuRiJiaBanXiaoShi INT, IN ShuangXiuRiYongCanXiaoShi INT, IN GuoDingJiaJiaBanXiaoShi INT, IN GuoDingJiaYongCanXiaoShi INT)\r\nBEGIN\r\n	DECLARE not_found INT DEFAULT 0;\r\n	DECLARE count_TianShu INT;-- 天数变量\r\n	DECLARE JianGeTianShu INT;-- 间隔天数\r\n	DECLARE DangTianRiQiShiJian datetime;-- 间隔天数\r\n	DECLARE SKF1_GongHao varchar(255);-- SKF495\r\n	DECLARE SKF3_XingMing varchar(255);-- SKF501\r\n	DECLARE SKF31_BuMen varchar(255);-- SKF496\r\n	DECLARE SKF32_BanZu varchar(255);-- SKF497\r\n	DECLARE SKF33_GangWei varchar(255);-- SKF498\r\n	DECLARE SKF34_JiBie varchar(255);-- SKF499\r\n\r\n	DECLARE t_error int DEFAULT 0;\r\n	DECLARE CONTINUE HANDLER FOR SQLEXCEPTION SET t_error=1;\r\n	START TRANSACTION;\r\n\r\n	-- SKT21\r\n	delete from skt21 where SKF494 = PaiBan_id;\r\n\r\n	-- 间隔天数 = 结束日期 - 开始日期 + 1\r\n	set JianGeTianShu = datediff(ChuQinJieShuRiQi, ChuQinKaiShiRiQi) + 1;\r\n\r\n	begin\r\n	DECLARE cur_1 CURSOR FOR SELECT SKF1,-- SKF495\r\n	SKF3,-- SKF501\r\n	SKF31,-- SKF496\r\n	SKF32,-- SKF497\r\n	SKF33,-- SKF498\r\n	SKF34-- SKF499\r\n	FROM skt1-- SKT1\r\n	where SKF31 = BuMen-- SKF31\r\n	and SKF32 = BanZu-- SKF32\r\n	and SKF715 = GongShiZhi-- SKF715\r\n	and SKF29 = \'是\';-- SKF29\r\n	DECLARE CONTINUE HANDLER FOR NOT FOUND SET not_found=1;\r\n\r\n	OPEN cur_1;\r\n		WHILE not_found = 0 DO \r\n			FETCH cur_1 INTO SKF1_GongHao, SKF3_XingMing, SKF31_BuMen, SKF32_BanZu, SKF33_GangWei, SKF34_JiBie;\r\n\r\n			if not_found=0 then\r\n\r\n				set count_TianShu = 0;\r\n				while JianGeTianShu > count_TianShu do\r\n\r\n				-- 生成排班明细\r\n				INSERT INTO `skt21` (-- SKT21\r\n				--  `SKF493`,-- SKF493\r\n				  `SKF494`,-- SKF494\r\n				  `SKF495`,-- SKF495\r\n				  `SKF496`,-- SKF496\r\n				  `SKF497`,-- SKF497\r\n				  `SKF498`,-- SKF498\r\n				  `SKF499`,-- SKF499\r\n				  `SKF501`,-- SKF501\r\n				--  `SF_CREATE_USER`,-- \r\n				--  `SF_LAST_CHANGE_USER`,-- \r\n				--  `SF_CREATE_TIME`,-- \r\n				--  `SF_LAST_CHANGE_TIME`,-- \r\n				--  `MachineCode`,-- \r\n				--  `Sf_Last_Sync_TimeStamp`,-- \r\n				  `SKF586`,-- SKF586\r\n				  `SKF587`,-- SKF587\r\n				  `SKF646`,-- SKF646\r\n				  `SKF807`,-- SKF807\r\n				  `SKF808`,-- SKF808\r\n				  `SKF809`,-- SKF809\r\n				  `SKF810`,-- SKF810\r\n				  `SKF811`,-- SKF811\r\n				  `SKF812`,-- SKF812\r\n				  `SKF831`-- SKF831\r\n				) \r\n				VALUES\r\n				  (\r\n				--    \'SKF493\',-- SKF493\r\n				    PaiBan_id,-- SKF494\r\n				    SKF1_GongHao,-- SKF495\r\n				    SKF31_BuMen,-- SKF496\r\n				    SKF32_BanZu,-- SKF497\r\n				    SKF33_GangWei,-- SKF498\r\n				    SKF34_JiBie,-- SKF499\r\n				    SKF3_XingMing,-- SKF501\r\n				--    \'SF_CREATE_USER\',-- \r\n				--    \'SF_LAST_CHANGE_USER\',-- \r\n				--    \'SF_CREATE_TIME\',-- \r\n				--    \'SF_LAST_CHANGE_TIME\',-- \r\n				--    \'MachineCode\',-- \r\n				--    \'Sf_Last_Sync_TimeStamp\',-- \r\n				    CONCAT(date_add(ChuQinKaiShiRiQi, interval count_TianShu day), \' \', ShangBanShiJian),-- 当日上班时间\r\n				    CONCAT(date_add(ChuQinKaiShiRiQi, interval count_TianShu + 1 day), \' \', XiaBanShiJian),-- 次日下班时间\r\n				    GongShiZhi,-- SKF646\r\n				    PingRiJiaBanXiaoShi,-- SKF807\r\n				    PingRiYongCanXiaoShi,-- SKF808\r\n				    ShuangXiuRiJiaBanXiaoShi,-- SKF809\r\n				    ShuangXiuRiYongCanXiaoShi,-- SKF810\r\n				    GuoDingJiaJiaBanXiaoShi,-- SKF811\r\n				    GuoDingJiaYongCanXiaoShi,-- SKF812\r\n				    date_add(ChuQinKaiShiRiQi, interval count_TianShu day)-- SKF586\r\n				  ) ;\r\n\r\n				set count_TianShu = count_TianShu + 1;\r\n				end while;\r\n\r\n			end if;\r\n		END WHILE;\r\n	CLOSE cur_1;\r\n	end;\r\n\r\n	IF t_error = 1 THEN\r\n			ROLLBACK;\r\n	ELSE\r\n			COMMIT;\r\n	END IF;\r\n\r\nEND;','',2,'2018-11-28 15:23:51',NULL,0,'1970-01-01 00:00:00',0,0,0,NULL,0,NULL),(16,'SK_PRO_16','10、新增员工接口表','CREATE PROCEDURE proc_insertYuanGongJieKouBiao(IN GongHao_id varchar(255), IN ZhongWenXingMing varchar(255), IN YingWenXingMing varchar(255), IN RuZhiRiQi date, IN BU_ChenBenZhongXin varchar(255),IN YGLX VARCHAR(255))\r\nBEGIN\r\n	DECLARE t_error int DEFAULT 0;\r\n	DECLARE CONTINUE HANDLER FOR SQLEXCEPTION SET t_error=1;\r\n	START TRANSACTION;\r\n\r\n			-- 新增员工接口表\r\n				INSERT INTO skt86 (\r\n				--  `SKF734`,-- id\r\n				  SKF2443,-- 工号\r\n				  SKF2444,-- 姓名\r\n				  SKF2445,-- 入职日期\r\n				--  `SKF738`,-- 离职日期\r\n				  SKF2447,-- 部门变更日期\r\n				  SKF2448,-- BU成本中心\r\n				--  `SF_CREATE_USER`,-- \r\n				--  `SF_LAST_CHANGE_USER`,-- \r\n				--  `SF_CREATE_TIME`,-- \r\n				--  `SF_LAST_CHANGE_TIME`,-- \r\n				--  `MachineCode`,-- \r\n				--  `Sf_Last_Sync_TimeStamp`,-- \r\n				  SKF2449, -- 是否已变更\r\n				  SKF2450, -- 入职日期文字\r\n				  SKF2452, -- 部门变更日期文字\r\n				  SKF2451,\r\n				  SKF2457\r\n\r\n				) \r\n				VALUES\r\n				  (\r\n				    GongHao_id,-- 工号\r\n				    concat(ZhongWenXingMing, \'-\', YingWenXingMing),-- 姓名\r\n				    RuZhiRiQi,-- 入职日期\r\n				--    \'SKF738\',-- 离职日期\r\n				    RuZhiRiQi,-- 部门变更日期\r\n				    BU_ChenBenZhongXin,-- BU成本中心\r\n				    0, -- 是否已变更\r\n				    DATE_FORMAT(RuZhiRiQi,\'%Y%m%d\'),\r\n				     DATE_FORMAT(RuZhiRiQi,\'%Y%m%d\'),\r\n				     0,\r\n				     YGLX\r\n				  ) ;\r\n	IF t_error = 1 THEN\r\n			ROLLBACK;\r\n	ELSE\r\n			COMMIT;\r\n	END IF;\r\n\r\nEND;\r\n','',2,'2018-11-28 15:23:51','2018-11-30 17:59:06',0,'1970-01-01 00:00:00',0,0,0,'1970-01-01 08:00:00',0,NULL),(23,'SK_PRO_23','12、生成考勤记录接口表（废弃--12、和17、合并为71）','CREATE PROCEDURE proc_insertyuangongjiekoubiao()\r\nBEGIN\r\nDECLARE not_found INT DEFAULT 0;\r\nDECLARE SKF159_GongHao VARCHAR(255);\r\nDECLARE SKF170_DaKaRiQi DATETIME;-- 打卡日期\r\nDECLARE ShangBanDaKa DATETIME;-- 上班打卡\r\nDECLARE XiaBanDaKa DATETIME;-- 下班打卡\r\nDECLARE SKF166_YingShangBanRiQi DATETIME;-- SKF166\r\nDECLARE SKF167_YingXiaBanRiQi DATETIME;-- SKF167\r\n\r\n\r\nDECLARE t_error INT DEFAULT 0;\r\nDECLARE CONTINUE HANDLER FOR SQLEXCEPTION SET t_error=1;\r\nSTART TRANSACTION;\r\n\r\n\r\nBEGIN\r\n\r\nDECLARE cur_1 CURSOR FOR SELECT SKF159,-- SKF159\r\n                SKF170,-- 打卡日期\r\n                SKF162,-- SKF162\r\n                SKF163,-- SKF163\r\n                SKF166,-- SKF166\r\n                skf167-- SKF167\r\n     FROM SKT6 \r\nWHERE SKF170  >DATE_SUB(CURDATE(),INTERVAL 7 DAY);\r\nDECLARE CONTINUE HANDLER FOR NOT FOUND SET not_found=1;\r\n\r\n     OPEN cur_1;\r\n\r\n            \r\n            WHILE not_found=0 DO\r\n                FETCH cur_1 INTO SKF159_GongHao,SKF170_DaKaRiQi,ShangBanDaKa,XiaBanDaKa,SKF166_YingShangBanRiQi,SKF167_YingXiaBanRiQi;\r\n                   IF not_found=0 THEN        \r\n              \r\n                                \r\n              -- 生成考勤接口原始表\r\n          \r\n                  INSERT INTO SKT47(SKF746,-- SKF746\r\n                                    SKF747,-- SKF747\r\n                                    SKF748,-- 上班卡E\r\n                                    SKF749,-- 上班打卡原始时间\r\n                                    SKF750, -- 上班打卡时间\r\n                                    SKF751,-- SKF751\r\n                                    SKF752,\r\n				    SKF2396) \r\n                                    \r\n                               VALUES(SKF159_GongHao,-- SKF746\r\n                                      SKF170_DaKaRiQi,-- SKF747\r\n                                     \'E\',-- 上班卡E\r\n                                      ShangBanDaKa,-- 上班打卡\r\n                                       date_format(ShangBanDaKa,\'%H:%i\'),\r\n                                      0,-- SKF751\r\n                                      \'ORD\',-- SKF752\r\n					 date_format(ShangBanDaKa,\'%Y-%m-%d\')\r\n                                       );\r\n                  -- 更新正常上班打卡时间\r\n                              IF ShangBanDaKa<SKF166_YingShangBanRiQi THEN -- 上班打卡时间早于应上班打卡时间\r\n                            UPDATE SKT47 SET SKF750=DATE_FORMAT(SKF166_YingShangBanRiQi ,\'%H:%i\')\r\n                            WHERE SKF746=SKF159_GongHao AND-- SKF746\r\n                                    SKF747=SKF170_DaKaRiQi AND\r\n                                    SKF748=\'E\' ;\r\n				    select \'test1\';\r\n\r\n                             END IF;             \r\n                                   \r\n         \r\n                  INSERT INTO SKT47(SKF746,-- SKF746\r\n                                    SKF747,-- SKF747\r\n                                    SKF748,-- 下班卡U\r\n                                    SKF749, -- 下班打卡原始时间\r\n                                    SKF750,  -- 下班打卡的时间\r\n                                    SKF751,-- SKF751\r\n                                    SKF752,\r\n				    SKF2396) -- SKF752\r\n                                    VALUES(SKF159_GongHao,-- SKF746\r\n                                           SKF170_DaKaRiQi,-- SKF747\r\n                                           \'U\',-- 下班卡U\r\n                                           XiaBanDaKa,-- 下班打卡\r\n                                           date_format(XiaBanDaKa,\'%H:%i\'),\r\n                                           0,-- SKF751\r\n                                           \'ORD\',-- 工作类型\r\n					date_format(ShangBanDaKa,\'%Y-%m-%d\')\r\n                                           );\r\n                        -- 更新正常下班打卡时间\r\n                         IF XiaBanDaKa>SKF167_YingXiaBanRiQi THEN-- 下班打卡时间晚于应下班打卡时间\r\n                       UPDATE SKT47 SET SKF750=date_format(SKF167_YingXiaBanRiQi ,\'%H:%i\')\r\n                       WHERE SKF746=SKF159_GongHao AND\r\n                             SKF747=SKF170_DaKaRiQi AND\r\n                             SKF748=\'U\';\r\n			     select \'test2\';\r\n                         END IF;\r\n            \r\n                   END IF; \r\n              \r\n            END WHILE;       \r\n     CLOSE cur_1;\r\n\r\nEND;	\r\n\r\n	IF t_error = 1 THEN\r\n			ROLLBACK;\r\n	ELSE\r\n			COMMIT;\r\n	END IF;\r\n    END;\r\n','',2,'2018-11-28 15:23:51',NULL,0,'1970-01-01 00:00:00',0,0,0,NULL,0,NULL),(24,'SK_PRO_24','13、成本中心变更新增员工接口表','CREATE PROCEDURE proc_insertChengBenZhongXinBianGengXinZengYuanGongJieKouBiao(IN GongHao_id varchar(255), IN ZhongWenXingMing varchar(255), IN YingWenXingMing varchar(255), IN RuZhiRiQi date, IN BuMenBianGengRiQi date, IN BU_ChenBenZhongXin varchar(255),IN YGLX VARCHAR(255))\r\nBEGIN\r\n	DECLARE t_error int DEFAULT 0;\r\n	DECLARE CONTINUE HANDLER FOR SQLEXCEPTION SET t_error=1;\r\n	START TRANSACTION;\r\n\r\n	-- 更新员工接口表\r\n	update \r\n	  skt86\r\n	set\r\n	  SKF2449 = 1 -- 是否已变更\r\n	where SKF2443 = GongHao_id ;-- 工号\r\n\r\n	-- 新增员工接口表\r\n	INSERT INTO skt86 (\r\n	--  `SKF734`,-- id\r\n	  SKF2443,-- 工号\r\n	  SKF2444,-- 姓名\r\n	  SKF2445,-- 入职日期\r\n	--  `SKF738`,-- 离职日期\r\n	  SKF2447,-- 部门变更日期\r\n	  SKF2448,-- BU成本中心\r\n	--  `SF_CREATE_USER`,-- \r\n	--  `SF_LAST_CHANGE_USER`,-- \r\n	--  `SF_CREATE_TIME`,-- \r\n	--  `SF_LAST_CHANGE_TIME`,-- \r\n	--  `MachineCode`,-- \r\n	--  `Sf_Last_Sync_TimeStamp`,-- \r\n	  SKF2449, -- 是否已变更\r\n	  SKF2450, -- 入职日期文字\r\n	  SKF2452, -- 部门变更日期文字\r\n	  SKF2451,\r\n	  SKF2457\r\n	) \r\n	VALUES\r\n	  (\r\n	--    \'SKF734\',-- id\r\n	    GongHao_id,-- 工号\r\n	    concat(ZhongWenXingMing, \'-\', YingWenXingMing),-- 姓名\r\n	    RuZhiRiQi,-- 入职日期\r\n	--    \'SKF738\',-- 离职日期\r\n	    BuMenBianGengRiQi,-- 部门变更日期\r\n	    BU_ChenBenZhongXin,-- BU成本中心\r\n	--    \'SF_CREATE_USER\',-- \r\n	--    \'SF_LAST_CHANGE_USER\',-- \r\n	--    \'SF_CREATE_TIME\',-- \r\n	--    \'SF_LAST_CHANGE_TIME\',-- \r\n	--    \'MachineCode\',-- \r\n	--    \'Sf_Last_Sync_TimeStamp\',-- \r\n	    0, -- 是否已变更\r\n	    date_format(RuZhiRiQi,\'%Y%m%d\'),\r\n	    date_format(BuMenBianGengRiQi,\'%Y%m%d\'),\r\n	    0,\r\n	    YGLX\r\n	  ) ;\r\n\r\n\r\n	IF t_error = 1 THEN\r\n		ROLLBACK;\r\n	ELSE\r\n		COMMIT;\r\n	END IF;\r\n\r\nEND;','',2,'2018-11-28 15:23:51','2018-11-30 19:27:52',0,'1970-01-01 00:00:00',0,0,0,'1970-01-01 08:00:00',0,NULL),(25,'SK_PRO_25','14、员工离职更新员工接口表','CREATE PROCEDURE proc_updateYuanGongLiZhiGengXinYuanGongJieKouBiao(IN GongHao_id varchar(255), IN LiZhiRiQi date)\r\nBEGIN\r\n	DECLARE t_error int DEFAULT 0;\r\n	DECLARE CONTINUE HANDLER FOR SQLEXCEPTION SET t_error=1;\r\n	START TRANSACTION;\r\n\r\n	-- 更新员工接口表\r\n	update \r\n	  skt86\r\n	set\r\n	  SKF2446 = LiZhiRiQi, -- 离职日期\r\n	  SKF2451 = DATE_FORMAT(LiZhiRiQi,\'%Y%m%d\') \r\n	where SKF2443 = GongHao_id -- 工号\r\n	and SKF2449 = 0 ; -- 是否已变更\r\n\r\n	IF t_error = 1 THEN\r\n		ROLLBACK;\r\n	ELSE\r\n		COMMIT;\r\n	END IF;\r\n\r\nEND;','',2,'2018-11-28 15:23:51','2018-11-30 14:06:23',0,'1970-01-01 00:00:00',0,0,0,'1970-01-01 08:00:00',0,NULL),(26,'SK_PRO_26','15、当日是否请假','CREATE PROCEDURE proc_updateDangTianShiFouQingJia(IN KaoQin_id varchar(255), IN KaoQin_date date)\r\nBEGIN\r\n	DECLARE SKF152_XuHao INT;-- SKF152\r\n	DECLARE SKF159_GongHao varchar(255);-- SKF159\r\n	DECLARE count_QingJia INT ; \r\n	DECLARE count_WaiChu INT ; \r\n	DECLARE count_ChuChai INT ; \r\n\r\n	DECLARE not_found INT DEFAULT 0;\r\n	DECLARE t_error int DEFAULT 0;\r\n	DECLARE CONTINUE HANDLER FOR SQLEXCEPTION SET t_error=1;\r\n	START TRANSACTION;\r\n\r\n	begin\r\n	DECLARE cur_1 CURSOR FOR SELECT SKF152,-- SKF152\r\n	SKF159-- SKF159\r\n	FROM SKT6-- SKT6\r\n	where SKF153 = KaoQin_id;-- 考勤编号\r\n	DECLARE CONTINUE HANDLER FOR NOT FOUND SET not_found=1;\r\n\r\n	OPEN cur_1;\r\n		WHILE not_found = 0 DO \r\n			FETCH cur_1 INTO SKF152_XuHao, SKF159_GongHao;\r\n\r\n			-- 获取 请假单 记录数\r\n			select count(*) into count_QingJia from SKT55-- SKT55\r\n			where SKF834 = SKF159_GongHao-- SKF834\r\n			and SKF836 = KaoQin_date-- SKF836 = 考勤日期\r\n			-- and SKF837 <= str_to_date(CONCAT(KaoQin_date,\' 12:00:00\'), \'%Y-%m-%d %H:%i:%s\')-- 请假开始时间不得晚于考勤当日的12:00\r\n			and SKF890 = 1;-- SKF890\r\n\r\n			-- 获取 因公外出 记录数\r\n			select count(*) into count_WaiChu from SKT56-- SKT56\r\n			where SKF847 = SKF159_GongHao-- SKF847\r\n			and SKF849 = KaoQin_date-- SKF849\r\n			-- and SKF850 <= str_to_date(CONCAT(KaoQin_date,\' 12:00:00\'), \'%Y-%m-%d %H:%i:%s\')-- 外出开始时间不得晚于考勤当日的12:00\r\n			and SKF891 = 1;-- SKF891\r\n\r\n			-- 获取 出差培训 记录数\r\n			select count(*) into count_ChuChai from SKT58-- SKT58\r\n			where SKF873 = SKF159_GongHao-- SKF873\r\n			and SKF875 = KaoQin_date-- SKF875\r\n			-- and SKF876 <= str_to_date(CONCAT(KaoQin_date,\' 12:00:00\'), \'%Y-%m-%d %H:%i:%s\')-- 出差开始时间不得晚于考勤当日的12:00\r\n			and SKF892 = 1;-- SKF892\r\n\r\n			-- 更新 SKT6\r\n			if count_QingJia > 0 or count_WaiChu > 0 or count_ChuChai > 0 then\r\n				update SKT6 set SKF171 = \'1\'-- SKF171\r\n				where SKF152 = SKF152_XuHao;-- SKF152\r\n			else\r\n				update SKT6 set SKF171 = \'0\'-- SKF171\r\n				where SKF152 = SKF152_XuHao;-- SKF152\r\n			end if;\r\n\r\n		END WHILE;\r\n	CLOSE cur_1;\r\n	end;\r\n\r\n	IF t_error = 1 THEN\r\n			ROLLBACK;\r\n	ELSE\r\n			COMMIT;\r\n	END IF;\r\n\r\nEND;','',2,'2018-11-28 15:23:51',NULL,0,'1970-01-01 00:00:00',0,0,0,NULL,0,NULL),(27,'SK_PRO_27','16、重新计算上班时间1_请假','CREATE PROCEDURE proc_updateChongXinJiSuanShangBanShiJian_QingJia(IN KaoQin_id varchar(255), IN KaoQin_date date)\r\nBEGIN\r\n	DECLARE SKF152_XuHao INT;-- SKF152\r\n	DECLARE SKF159_GongHao varchar(255);-- SKF159\r\n	DECLARE count_QingJia INT ; \r\n	DECLARE QingJiaHouYingShangBanShiJian datetime;\r\n\r\n	DECLARE not_found INT DEFAULT 0;\r\n	DECLARE t_error int DEFAULT 0;\r\n	DECLARE CONTINUE HANDLER FOR SQLEXCEPTION SET t_error=1;\r\n	START TRANSACTION;\r\n\r\n	begin\r\n	DECLARE cur_1 CURSOR FOR SELECT SKF152,-- SKF152\r\n	SKF159-- SKF159\r\n	FROM SKT6-- SKT6\r\n	where SKF153 = KaoQin_id-- 考勤编号\r\n	and SKF171 = \'1\';-- SKF171\r\n	DECLARE CONTINUE HANDLER FOR NOT FOUND SET not_found=1;\r\n\r\n	OPEN cur_1;\r\n		WHILE not_found = 0 DO \r\n			FETCH cur_1 INTO SKF152_XuHao, SKF159_GongHao;\r\n/*\r\nselect count(编号) into qjsl from 请假单 where 人员=gh and DATE_FORMAT(请假时间,\'%Y-%m-%d\')=dt and 请假时间<=str_to_date(CONCAT(dt,\' 12:00:00\'), \'%Y-%m-%d %H:%i:%s\') and 审批状态=\'审批通过\';\r\nif qjsl>0 then\r\nselect SKF207 into sbsj1 from 请假单 where 人员=gh and DATE_FORMAT(请假时间,\'%Y-%m-%d\')=dt and 请假时间<=str_to_date(CONCAT(dt,\' 12:00:00\'), \'%Y-%m-%d %H:%i:%s\') and 审批状态=\'审批通过\' order by 请假时间 ASC limit 1;\r\nupdate 每日考勤明细 set SKF184=sbsj1 where SKF152=xh;\r\nend if;\r\n*/\r\n			-- 获取 请假单 记录数\r\n/*			select count(*) into count_QingJia from SKT7-- SKT7\r\n			where SKF201 = SKF159_GongHao-- SKF201\r\n			and DATE_FORMAT(SKF206, \'%Y-%m-%d\') <= KaoQin_date-- SKF837\r\n			and DATE_FORMAT(SKF207, \'%Y-%m-%d\') >= KaoQin_date-- SKF838\r\n			and SKF206 <= str_to_date(CONCAT(KaoQin_date,\' 12:00:00\'), \'%Y-%m-%d %H:%i:%s\')\r\n			and SKF784 = 1;-- 是否确认*/\r\n\r\n			-- 获取 请假单 记录数\r\n			select count(*) into count_QingJia from SKT55-- SKT55\r\n			where SKF834 = SKF159_GongHao-- SKF834\r\n			and SKF836 = KaoQin_date-- SKF836 = SKF170\r\n			and SKF838 <= str_to_date(CONCAT(KaoQin_date,\' 12:00:00\'), \'%Y-%m-%d %H:%i:%s\')-- 请假结束时间不得早于考勤当日的12:00\r\n			and SKF890 = 1;-- SKF890\r\n\r\n			-- 更新 SKT6\r\n			if count_QingJia > 0 then\r\n				select SKF838 into QingJiaHouYingShangBanShiJian-- SKF838 -> SKF184\r\n				from SKT55-- SKT55\r\n				where SKF834 = SKF159_GongHao-- SKF834\r\n				and SKF836 = KaoQin_date-- SKF836 = 考勤日期\r\n				and SKF838 <= str_to_date(CONCAT(KaoQin_date,\' 12:00:00\'), \'%Y-%m-%d %H:%i:%s\')-- 请假结束时间不得早于考勤当日的12:00\r\n				and SKF890 = 1-- SKF890\r\n				order by SKF838 ASC limit 1;\r\n\r\n				update SKT6 set SKF184 = QingJiaHouYingShangBanShiJian-- 请假后应上班时间\r\n				where SKF152 = SKF152_XuHao;-- SKF832\r\n			end if;\r\n\r\n		END WHILE;\r\n	CLOSE cur_1;\r\n	end;\r\n\r\n	IF t_error = 1 THEN\r\n			ROLLBACK;\r\n	ELSE\r\n			COMMIT;\r\n	END IF;\r\n\r\nEND;\r\n','',2,'2018-11-28 15:23:51',NULL,0,'1970-01-01 00:00:00',0,0,0,NULL,0,NULL),(28,'SK_PRO_28','17、生成考勤导出接口表（废弃--12、和17、合并为71）','CREATE PROCEDURE proc_insertyuangongjiekoubiao3()\r\nBEGIN\r\n	-- 考勤接口导出表skt52\r\n	DECLARE not_found INT DEFAULT 0;\r\n	DECLARE SKF787GH VARCHAR(255); -- dc工号 \r\n	DECLARE SKF788DKRQ DATE; -- dc打卡日期\r\n	DECLARE SKF789EU VARCHAR(32);-- dcEU打卡\r\n	DECLARE SKF790DKYSSJ DATETIME; -- dc上下班打卡原始时间\r\n	DECLARE SKF791SXBDK TIME; -- dc上下班打卡时间\r\n	DECLARE SKF790GZSJ INT; -- dc工作时间\r\n	DECLARE SKF793BCLX VARCHAR(64); -- dc班次类型\r\n\r\n	DECLARE t_error INT DEFAULT 0;\r\n	DECLARE CONTINUE HANDLER FOR SQLEXCEPTION SET t_error=1;\r\n	START TRANSACTION;\r\n\r\n		\r\n			\r\n	BEGIN	\r\n\r\n		DECLARE cur CURSOR FOR SELECT SKF746, -- dc工号\r\n						SKF747, -- dc打卡日期\r\n						SKF748, -- dcEU上下班打卡\r\n						SKF749, -- dc上下班打卡原始时间\r\n						SKF750, -- dc上下班打卡时间\r\n						SKF751, --  dc工作时间\r\n						SKF752 --  dc班次类型\r\n					from SKT47\r\n					where SKF2396 >DATE_SUB(CURDATE(),INTERVAL 50 DAY);\r\n		\r\n		 DECLARE CONTINUE HANDLER FOR NOT FOUND SET not_found=1;\r\n		 -- set not_found=0;\r\n		open cur;\r\n			truncate skt52;\r\n			\r\n			WHILE not_found=0 DO\r\n				FETCH cur into SKF787GH,SKF788DKRQ,SKF789EU,SKF790DKYSSJ,SKF791SXBDK,SKF790GZSJ,SKF793BCLX;\r\n					-- TRUNCATE SKT52;\r\n				 IF  not_found=0 THEN  \r\n\r\n				-- 生成考勤导出表\r\n					insert into SKT52(SKF787, -- DC工号\r\n							  SKF788, -- dc打卡日期\r\n							  SKF789, -- EU上下打卡\r\n							  SKF790, -- dc打卡原始时间\r\n							  SKF791, -- dc上下班打卡时间\r\n							  SKF792, -- dc工作时间\r\n							  SKF793,  -- dc班次类型\r\n							  SKF829,-- dc打卡日期txt\r\n							  SKF830  -- dc打卡时间txt\r\n							)\r\n						VALUES(SKF787GH,  -- DC工号\r\n							SKF788DKRQ, -- dc打卡日期\r\n							SKF789EU,  -- EU上下打卡\r\n							SKF790DKYSSJ, -- dc打卡原始时间\r\n							SKF791SXBDK, -- dc上下班打卡时间\r\n							SKF790GZSJ,-- dc工作时间\r\n							SKF793BCLX, -- dc班次类型\r\n							CONCAT(SUBSTRING(SKF788DKRQ,1,4),SUBSTRING(SKF788DKRQ,6,2), SUBSTRING(SKF788DKRQ,9,2)), -- dc打卡日期txt\r\n							CONCAT(SUBSTRING(SKF791SXBDK,1,2),SUBSTRING(SKF791SXBDK,4,2))   -- dc打卡时间txt\r\n							);\r\n				  END IF;\r\n			\r\n			 END WHILE;\r\n		CLOSE cur;\r\n	END;	\r\nIF t_error = 1 THEN\r\n			ROLLBACK;\r\n	ELSE\r\n			COMMIT;\r\n	END IF;\r\n\r\nEND;','',2,'2018-11-28 15:23:51',NULL,0,'1970-01-01 00:00:00',0,0,0,NULL,0,NULL),(41,'SK_PRO_41','18、请假单明细最终确认','CREATE PROCEDURE proc_updateQingJiaDanMingXiZuiZhongQueRen(IN QingJia_id varchar(255), IN GongHao varchar(255), IN QingJiaLeiBie varchar(255))\r\nBEGIN\r\n	DECLARE t_error int DEFAULT 0;\r\n	DECLARE CONTINUE HANDLER FOR SQLEXCEPTION SET t_error=1;\r\n	START TRANSACTION;\r\n\r\n	-- 更新请假单明细表\r\n	update \r\n	  SKT55\r\n	set\r\n	  SKF834 = GongHao,-- 工号\r\n	  SKF835 = QingJiaLeiBie,-- 请假类别\r\n	  SKF890 = 1,-- 是否确认\r\n	  SKF837 = concat(SKF836, \' \', SKF884),-- 请假开始时间 = 请假日期 + 请假开始时分\r\n	  SKF838 = concat(SKF836, \' \', SKF885)-- 请假结束时间 = 请假日期 + 请假结束时分\r\n	where SKF833 = QingJia_id ; -- 请假单号\r\n\r\n	IF t_error = 1 THEN\r\n			ROLLBACK;\r\n	ELSE\r\n			COMMIT;\r\n	END IF;\r\n\r\nEND;','',2,'2018-11-28 15:23:51',NULL,0,'1970-01-01 00:00:00',0,0,0,NULL,0,NULL),(42,'SK_PRO_42','19、删除因公外出单，及其子表外出登记明细','CREATE PROCEDURE proc_yingongwaichudanjiqizibiaowaichudengjimingx(IN ShenQingDanHao VARCHAR(255))\r\nBEGIN\r\n	 DECLARE t_error INT DEFAULT 0;\r\n	 DECLARE CONTINUE HANDLER FOR SQLEXCEPTION SET t_error=1;\r\n	 START TRANSACTION;\r\n\r\n	-- 删除因公外出申请单号\r\n	DELETE FROM skt8 WHERE SKF216=ShenQingDanHao;-- 因公外出单号\r\n\r\n	-- 删除中夜班补贴申请子表单号\r\n	DELETE FROM skt56 WHERE SKF846=ShenQingDanHao;-- 因公外出登记明细单号\r\n\r\n	 IF t_error = 1 THEN  \r\n	 ROLLBACK;  \r\n	ELSE  \r\n	 COMMIT;  \r\n	 END IF; \r\n \r\nEND;\r\n','',2,'2018-11-28 15:23:51',NULL,0,'1970-01-01 00:00:00',0,0,0,NULL,0,NULL),(46,'SK_PRO_46','20、删除出差培训单，及其子表出差培训登记明细','CREATE PROCEDURE proc_yingongwaichudanjiqizibiaowaichudengjimingx(IN ShenQingDanHao VARCHAR(255))\r\nBEGIN\r\n  DECLARE t_error INT DEFAULT 0;\r\n  DECLARE CONTINUE HANDLER FOR SQLEXCEPTION SET t_error=1;\r\n  START TRANSACTION;\r\n\r\n -- 删除出差培训单申请单号\r\n DELETE FROM skt41 WHERE skt41.SKF671=ShenQingDanHao;-- 出差培训单单号\r\n\r\n -- 删除出差培训单登记明细表单号\r\n DELETE FROM skt58 WHERE skt58.SKF872=ShenQingDanHao;-- 出差培训单登记明细单号\r\n\r\n  IF t_error = 1 THEN  \r\n  ROLLBACK;  \r\n ELSE  \r\n  COMMIT;  \r\n  END IF; \r\n\r\nEND;','',2,'2018-11-28 15:23:51',NULL,0,'1970-01-01 00:00:00',0,0,0,NULL,0,NULL),(47,'SK_PRO_47','21、外出登记单明细终审通过','CREATE PROCEDURE proc_updateWaiChuDengJiDanMingXiZhongShenTongGuo(IN WaiChu_id varchar(255))\r\nBEGIN\r\n	DECLARE t_error int DEFAULT 0;\r\n	DECLARE CONTINUE HANDLER FOR SQLEXCEPTION SET t_error=1;\r\n	START TRANSACTION;\r\n\r\n	-- 更新外出登记明细表\r\n	update \r\n	  SKT56\r\n	set\r\n	  SKF891 = 1,-- 审批状态\r\n	  SKF850 = concat(SKF849, \' \', SKF886),-- 外出开始时间 = 外出日期 + 外出开始时分\r\n	  SKF851 = concat(SKF849, \' \', SKF887)-- 外出结束时间 = 外出日期 + 外出结束时分\r\n	where SKF846 = WaiChu_id ; -- 外出单号\r\n\r\n	IF t_error = 1 THEN\r\n			ROLLBACK;\r\n	ELSE\r\n			COMMIT;\r\n	END IF;\r\n\r\nEND;','',2,'2018-11-28 15:23:51',NULL,0,'1970-01-01 00:00:00',0,0,0,NULL,0,NULL),(48,'SK_PRO_48','22、出差登记单明细终审通过','CREATE PROCEDURE proc_updateChuChaiDengJiDanMingXiZhongShenTongGuo(IN ChuChai_id varchar(255))\r\nBEGIN\r\n	DECLARE t_error int DEFAULT 0;\r\n	DECLARE CONTINUE HANDLER FOR SQLEXCEPTION SET t_error=1;\r\n	START TRANSACTION;\r\n\r\n	-- 更新出差登记明细表\r\n	update \r\n	  SKT58\r\n	set\r\n	  SKF892 = 1,-- 审批状态\r\n	  SKF876 = concat(SKF875, \' \', SKF888),-- 出差开始时间 = 出差日期 + 出差开始时分\r\n	  SKF877 = concat(SKF875, \' \', SKF889)-- 出差结束时间 = 出差日期 + 出差结束时分\r\n	where SKF872 = ChuChai_id ; -- 出差单号\r\n\r\n	IF t_error = 1 THEN\r\n			ROLLBACK;\r\n	ELSE\r\n			COMMIT;\r\n	END IF;\r\n\r\nEND;','',2,'2018-11-28 15:23:51',NULL,0,'1970-01-01 00:00:00',0,0,0,NULL,0,NULL),(49,'SK_PRO_49','23、删除办公室加班单号，及其子表加班登记明细','CREATE PROCEDURE proc_shanchubangongshijiabdanjizibiaojiabandengjimingx(IN ShenQingDanHao VARCHAR(255))\r\nBEGIN\r\n	 DECLARE t_error INT DEFAULT 0;\r\n	 DECLARE CONTINUE HANDLER FOR SQLEXCEPTION SET t_error=1;\r\n	 START TRANSACTION;\r\n\r\n	-- 删除办公室加班申请单号\r\n	DELETE FROM skt11 WHERE skt11.SKF263=ShenQingDanHao;-- 出差公室加班单号\r\n\r\n	-- 删除加班登记明细明细表单号\r\n	DELETE FROM skt59 WHERE skt59.SKF894=ShenQingDanHao;-- 加班登记明细细单号\r\n\r\n	 IF t_error = 1 THEN  \r\n	 ROLLBACK;  \r\n	ELSE  \r\n	 COMMIT;  \r\n	 END IF; \r\n \r\nEND;','',2,'2018-11-28 15:23:51',NULL,0,'1970-01-01 00:00:00',0,0,0,NULL,0,NULL),(50,'SK_PRO_50','24、办公室加班登记明细终审通过','CREATE PROCEDURE proc_updateBanGongshiJianbanMingXiZhongShenTongGuo(IN JiaBan_id varchar(255))\r\nBEGIN\r\n	DECLARE t_error int DEFAULT 0;\r\n	DECLARE CONTINUE HANDLER FOR SQLEXCEPTION SET t_error=1;\r\n	START TRANSACTION;\r\n\r\n	-- 更新出差登记明细表\r\n	update \r\n	  SKT59\r\n	set\r\n	  SKF908 = 1,-- 审批状态\r\n	  SKF898 = concat(SKF897, \' \', SKF906),-- 出差开始时间 = 出差日期 + 出差开始时分\r\n	  SKF899 = concat(SKF897, \' \', SKF907)-- 出差结束时间 = 出差日期 + 出差结束时分\r\n	where SKF894 = iaBan_id ; -- 出差单号\r\n\r\n	IF t_error = 1 THEN\r\n			ROLLBACK;\r\n	ELSE\r\n			COMMIT;\r\n	END IF;\r\n\r\nEND;','',2,'2018-11-28 15:23:51',NULL,0,'1970-01-01 00:00:00',0,0,0,NULL,0,NULL),(51,'SK_PRO_51','25、重新计算上班时间2_外出','CREATE PROCEDURE proc_updateChongXinJiSuanShangBanShiJian_WaiChu(IN KaoQin_id varchar(255), IN KaoQin_date date)\r\nBEGIN\r\n	DECLARE SKF152_XuHao INT;-- SKF152\r\n	DECLARE SKF159_GongHao varchar(255);-- SKF159\r\n	DECLARE count_WaiChu INT ; \r\n	DECLARE WaiChuHouYingShangBanShiJian datetime;\r\n\r\n	DECLARE not_found INT DEFAULT 0;\r\n	DECLARE t_error int DEFAULT 0;\r\n	DECLARE CONTINUE HANDLER FOR SQLEXCEPTION SET t_error=1;\r\n	START TRANSACTION;\r\n\r\n	begin\r\n	DECLARE cur_1 CURSOR FOR SELECT SKF152,-- SKF152\r\n	SKF159-- SKF159\r\n	FROM SKT6-- SKT6\r\n	where SKF153 = KaoQin_id-- 考勤编号\r\n	and SKF171 = \'1\';-- SKF171\r\n	DECLARE CONTINUE HANDLER FOR NOT FOUND SET not_found=1;\r\n\r\n	OPEN cur_1;\r\n		WHILE not_found = 0 DO \r\n			FETCH cur_1 INTO SKF152_XuHao, SKF159_GongHao;\r\n\r\n			-- 获取 因公外出 记录数\r\n			select count(*) into count_WaiChu from SKT56-- SKT56\r\n			where SKF847 = SKF159_GongHao-- SKF847\r\n			and SKF849 = KaoQin_date-- SKF849\r\n			and SKF851 <= str_to_date(CONCAT(KaoQin_date,\' 12:00:00\'), \'%Y-%m-%d %H:%i:%s\')-- 外出结束时间不得早于考勤当日的12:00\r\n			and SKF891 = 1;-- SKF891\r\n\r\n			-- 更新 SKT6\r\n			if count_WaiChu > 0 then\r\n				select SKF851 into WaiChuHouYingShangBanShiJian-- SKF851 -> SKF185\r\n				from SKT56-- SKT56\r\n				where SKF847 = SKF159_GongHao-- SKF847\r\n				and SKF849 = KaoQin_date-- SKF849\r\n				and SKF851 <= str_to_date(CONCAT(KaoQin_date,\' 12:00:00\'), \'%Y-%m-%d %H:%i:%s\')-- 外出结束时间不得早于考勤当日的12:00\r\n				and SKF891 = 1-- SKF891\r\n				order by SKF851 ASC limit 1;\r\n\r\n				update SKT6 set SKF185 = WaiChuHouYingShangBanShiJian-- 外出后应上班时间\r\n				where SKF152 = SKF152_XuHao;-- SKF845\r\n			end if;\r\n\r\n		END WHILE;\r\n	CLOSE cur_1;\r\n	end;\r\n\r\n	IF t_error = 1 THEN\r\n			ROLLBACK;\r\n	ELSE\r\n			COMMIT;\r\n	END IF;\r\n\r\nEND;\r\n','',2,'2018-11-28 15:23:51',NULL,0,'1970-01-01 00:00:00',0,0,0,NULL,0,NULL),(52,'SK_PRO_52','26、重新计算上班时间3_出差','CREATE PROCEDURE proc_updateChongXinJiSuanShangBanShiJian_ChuChai(IN KaoQin_id varchar(255), IN KaoQin_date date)\r\nBEGIN\r\n	DECLARE SKF152_XuHao INT;-- SKF152\r\n	DECLARE SKF159_GongHao varchar(255);-- SKF159\r\n	DECLARE count_ChuChai INT ; \r\n	DECLARE ChuChaiHouYingShangBanShiJian datetime;\r\n\r\n	DECLARE not_found INT DEFAULT 0;\r\n	DECLARE t_error int DEFAULT 0;\r\n	DECLARE CONTINUE HANDLER FOR SQLEXCEPTION SET t_error=1;\r\n	START TRANSACTION;\r\n\r\n	begin\r\n	DECLARE cur_1 CURSOR FOR SELECT SKF152,-- SKF152\r\n	SKF159-- SKF159\r\n	FROM SKT6-- SKT6\r\n	where SKF153 = KaoQin_id-- 考勤编号\r\n	and SKF171 = \'1\';-- SKF171\r\n	DECLARE CONTINUE HANDLER FOR NOT FOUND SET not_found=1;\r\n\r\n	OPEN cur_1;\r\n		WHILE not_found = 0 DO \r\n			FETCH cur_1 INTO SKF152_XuHao, SKF159_GongHao;\r\n\r\n			-- 获取 出差培训 记录数\r\n			select count(*) into count_ChuChai from SKT58-- SKT58\r\n			where SKF873 = SKF159_GongHao-- SKF873\r\n			and SKF875 = KaoQin_date-- SKF875\r\n			and SKF877 <= str_to_date(CONCAT(KaoQin_date,\' 12:00:00\'), \'%Y-%m-%d %H:%i:%s\')-- 出差结束时间不得早于考勤当日的12:00\r\n			and SKF892 = 1;-- SKF892\r\n\r\n			-- 更新 SKT6\r\n			if count_ChuChai > 0 then\r\n				select SKF877 into ChuChaiHouYingShangBanShiJian-- SKF877 -> SKF909\r\n				from SKT58-- SKT58\r\n				where SKF873 = SKF159_GongHao-- SKF873\r\n				and SKF875 = KaoQin_date-- SKF875\r\n				and SKF877 <= str_to_date(CONCAT(KaoQin_date,\' 12:00:00\'), \'%Y-%m-%d %H:%i:%s\')-- 出差结束时间不得早于考勤当日的12:00\r\n				and SKF892 = 1-- SKF892\r\n				order by SKF877 ASC limit 1;\r\n\r\n				update SKT6 set SKF909 = ChuChaiHouYingShangBanShiJian-- 出差后应上班时间\r\n				where SKF152 = SKF152_XuHao;-- SKF871\r\n			end if;\r\n\r\n		END WHILE;\r\n	CLOSE cur_1;\r\n	end;\r\n\r\n	IF t_error = 1 THEN\r\n			ROLLBACK;\r\n	ELSE\r\n			COMMIT;\r\n	END IF;\r\n\r\nEND;\r\n','',2,'2018-11-28 15:23:51',NULL,0,'1970-01-01 00:00:00',0,0,0,NULL,0,NULL),(53,'SK_PRO_53','27、重新计算下班时间1_请假','CREATE PROCEDURE proc_updateChongXinJiSuanXiaBanShiJian_QingJia(IN KaoQin_id varchar(255), IN KaoQin_date date)\r\nBEGIN\r\n	DECLARE SKF152_XuHao INT;-- SKF152\r\n	DECLARE SKF159_GongHao varchar(255);-- SKF159\r\n	DECLARE count_QingJia INT ; \r\n	DECLARE QingJiaHouYingXiaBanShiJian datetime;\r\n\r\n	DECLARE not_found INT DEFAULT 0;\r\n	DECLARE t_error int DEFAULT 0;\r\n	DECLARE CONTINUE HANDLER FOR SQLEXCEPTION SET t_error=1;\r\n	START TRANSACTION;\r\n\r\n	begin\r\n	DECLARE cur_1 CURSOR FOR SELECT SKF152,-- SKF152\r\n	SKF159-- SKF159\r\n	FROM SKT6-- SKT6\r\n	where SKF153 = KaoQin_id-- 考勤编号\r\n	and SKF171 = \'1\';-- SKF171\r\n	DECLARE CONTINUE HANDLER FOR NOT FOUND SET not_found=1;\r\n\r\n	OPEN cur_1;\r\n		WHILE not_found = 0 DO \r\n			FETCH cur_1 INTO SKF152_XuHao, SKF159_GongHao;\r\n\r\n			-- 获取 请假单 记录数\r\n			select count(*) into count_QingJia from SKT55-- SKT55\r\n			where SKF834 = SKF159_GongHao-- SKF834\r\n			and SKF836 = KaoQin_date-- SKF836 = SKF170\r\n			and SKF837 >= str_to_date(CONCAT(KaoQin_date,\' 12:00:00\'), \'%Y-%m-%d %H:%i:%s\')-- 请假开始时间不得晚于考勤当日的12:00\r\n			and SKF890 = 1;-- SKF890\r\n\r\n			-- 更新 SKT6\r\n			if count_QingJia > 0 then\r\n				select SKF837 into QingJiaHouYingXiaBanShiJian-- SKF837 -> SKF186\r\n				from SKT55-- SKT55\r\n				where SKF834 = SKF159_GongHao-- SKF834\r\n				and SKF836 = KaoQin_date-- SKF836 = 考勤日期\r\n				and SKF837 >= str_to_date(CONCAT(KaoQin_date,\' 12:00:00\'), \'%Y-%m-%d %H:%i:%s\')-- 请假开始时间不得晚于考勤当日的12:00\r\n				and SKF890 = 1-- SKF890\r\n				order by SKF837 DESC limit 1;\r\n\r\n				update SKT6 set SKF186 = QingJiaHouYingXiaBanShiJian-- 请假后应下班时间\r\n				where SKF152 = SKF152_XuHao;-- SKF832\r\n			end if;\r\n\r\n		END WHILE;\r\n	CLOSE cur_1;\r\n	end;\r\n\r\n	IF t_error = 1 THEN\r\n			ROLLBACK;\r\n	ELSE\r\n			COMMIT;\r\n	END IF;\r\n\r\nEND;','',2,'2018-11-28 15:23:51',NULL,0,'1970-01-01 00:00:00',0,0,0,NULL,0,NULL),(54,'SK_PRO_54','28、重新计算下班时间2_外出','CREATE PROCEDURE proc_updateChongXinJiSuanShangBanShiJian_WaiChu(IN KaoQin_id varchar(255), IN KaoQin_date date)\r\nBEGIN\r\n	DECLARE SKF152_XuHao INT;-- SKF152\r\n	DECLARE SKF159_GongHao varchar(255);-- SKF159\r\n	DECLARE count_WaiChu INT ; \r\n	DECLARE WaiChuHouYingXiaBanShiJian datetime;\r\n\r\n	DECLARE not_found INT DEFAULT 0;\r\n	DECLARE t_error int DEFAULT 0;\r\n	DECLARE CONTINUE HANDLER FOR SQLEXCEPTION SET t_error=1;\r\n	START TRANSACTION;\r\n\r\n	begin\r\n	DECLARE cur_1 CURSOR FOR SELECT SKF152,-- SKF152\r\n	SKF159-- SKF159\r\n	FROM SKT6-- SKT6\r\n	where SKF153 = KaoQin_id-- 考勤编号\r\n	and SKF171 = \'1\';-- SKF171\r\n	DECLARE CONTINUE HANDLER FOR NOT FOUND SET not_found=1;\r\n\r\n	OPEN cur_1;\r\n		WHILE not_found = 0 DO \r\n			FETCH cur_1 INTO SKF152_XuHao, SKF159_GongHao;\r\n\r\n			-- 获取 因公外出 记录数\r\n			select count(*) into count_WaiChu from SKT56-- SKT56\r\n			where SKF847 = SKF159_GongHao-- SKF847\r\n			and SKF849 = KaoQin_date-- SKF849\r\n			and SKF850 >= str_to_date(CONCAT(KaoQin_date,\' 12:00:00\'), \'%Y-%m-%d %H:%i:%s\')-- 外出开始时间不得晚于考勤当日的12:00\r\n			and SKF891 = 1;-- SKF891\r\n\r\n			-- 更新 SKT6\r\n			if count_WaiChu > 0 then\r\n				select SKF850 into WaiChuHouYingXiaBanShiJian-- SKF850 -> SKF187\r\n				from SKT56-- SKT56\r\n				where SKF847 = SKF159_GongHao-- SKF847\r\n				and SKF849 = KaoQin_date-- SKF849\r\n				and SKF850 >= str_to_date(CONCAT(KaoQin_date,\' 12:00:00\'), \'%Y-%m-%d %H:%i:%s\')-- 外出开始时间不得晚于考勤当日的12:00\r\n				and SKF891 = 1-- SKF891\r\n				order by SKF850 DESC limit 1;\r\n\r\n				update SKT6 set SKF187 = WaiChuHouYingXiaBanShiJian-- 外出后应下班时间\r\n				where SKF152 = SKF152_XuHao;-- SKF845\r\n			end if;\r\n\r\n		END WHILE;\r\n	CLOSE cur_1;\r\n	end;\r\n\r\n	IF t_error = 1 THEN\r\n			ROLLBACK;\r\n	ELSE\r\n			COMMIT;\r\n	END IF;\r\n\r\nEND;','',2,'2018-11-28 15:23:52',NULL,0,'1970-01-01 00:00:00',0,0,0,NULL,0,NULL),(55,'SK_PRO_55','29、重新计算下班时间3_出差','CREATE PROCEDURE proc_updateChongXinJiSuanXiaBanShiJian_ChuChai(IN KaoQin_id varchar(255), IN KaoQin_date date)\r\nBEGIN\r\n	DECLARE SKF152_XuHao INT;-- SKF152\r\n	DECLARE SKF159_GongHao varchar(255);-- SKF159\r\n	DECLARE count_ChuChai INT ; \r\n	DECLARE ChuChaiHouYingXiaBanShiJian datetime;\r\n\r\n	DECLARE not_found INT DEFAULT 0;\r\n	DECLARE t_error int DEFAULT 0;\r\n	DECLARE CONTINUE HANDLER FOR SQLEXCEPTION SET t_error=1;\r\n	START TRANSACTION;\r\n\r\n	begin\r\n	DECLARE cur_1 CURSOR FOR SELECT SKF152,-- SKF152\r\n	SKF159-- SKF159\r\n	FROM SKT6-- SKT6\r\n	where SKF153 = KaoQin_id-- 考勤编号\r\n	and SKF171 = \'1\';-- SKF171\r\n	DECLARE CONTINUE HANDLER FOR NOT FOUND SET not_found=1;\r\n\r\n	OPEN cur_1;\r\n		WHILE not_found = 0 DO \r\n			FETCH cur_1 INTO SKF152_XuHao, SKF159_GongHao;\r\n\r\n			-- 获取 出差培训 记录数\r\n			select count(*) into count_ChuChai from SKT58-- SKT58\r\n			where SKF873 = SKF159_GongHao-- SKF873\r\n			and SKF875 = KaoQin_date-- SKF875\r\n			and SKF876 >= str_to_date(CONCAT(KaoQin_date,\' 12:00:00\'), \'%Y-%m-%d %H:%i:%s\')-- 出差开始时间不得晚于考勤当日的12:00\r\n			and SKF892 = 1;-- SKF892\r\n\r\n			-- 更新 SKT6\r\n			if count_ChuChai > 0 then\r\n				select SKF876 into ChuChaiHouYingXiaBanShiJian-- SKF876 -> SKF910\r\n				from SKT58-- SKT58\r\n				where SKF873 = SKF159_GongHao-- SKF873\r\n				and SKF875 = KaoQin_date-- SKF875\r\n				and SKF876 >= str_to_date(CONCAT(KaoQin_date,\' 12:00:00\'), \'%Y-%m-%d %H:%i:%s\')-- 出差开始时间不得晚于考勤当日的12:00\r\n				and SKF892 = 1-- SKF892\r\n				order by SKF876 ASC limit 1;\r\n\r\n				update SKT6 set SKF910 = ChuChaiHouYingXiaBanShiJian-- 出差后应下班时间\r\n				where SKF152 = SKF152_XuHao;-- SKF871\r\n			end if;\r\n\r\n		END WHILE;\r\n	CLOSE cur_1;\r\n	end;\r\n\r\n	IF t_error = 1 THEN\r\n			ROLLBACK;\r\n	ELSE\r\n			COMMIT;\r\n	END IF;\r\n\r\nEND;','',2,'2018-11-28 15:23:52',NULL,0,'1970-01-01 00:00:00',0,0,0,NULL,0,NULL),(56,'SK_PRO_56','30、再次计算上下班时间','CREATE PROCEDURE proc_updateZaiCiJiSuanShangXiaBanShiJian(IN KaoQin_id varchar(255))\r\nBEGIN\r\n	DECLARE not_found INT DEFAULT 0;\r\n	DECLARE t_error int DEFAULT 0;\r\n	DECLARE CONTINUE HANDLER FOR SQLEXCEPTION SET t_error=1;\r\n	START TRANSACTION;\r\n/*\r\nupdate 每日考勤明细 set SKF166=SKF184 where SKF153=bh and SKF184 is not null and SKF185 is null and SKF171=1;\r\nupdate 每日考勤明细 set SKF166=SKF185 where SKF153=bh and SKF184 is null and SKF185 is not null and SKF171=1;\r\nupdate 每日考勤明细 set SKF167=SKF186 where SKF153=bh and SKF186 is not null and SKF187 is null and SKF171=1;\r\nupdate 每日考勤明细 set SKF167=SKF187 where SKF153=bh and SKF186 is null and SKF187 is not null and SKF171=1;\r\n*/\r\n	-- 更新 SKT6\r\n	update SKT6-- SKT6\r\n	set SKF166 = SKF184-- 应上班时间 = SKF184\r\n	where SKF153 = KaoQin_id-- SKF153\r\n	and SKF184 is not null-- SKF184\r\n	and SKF185 is null-- SKF185\r\n	and SKF909 is null-- SKF909\r\n	and SKF171 = 1;-- SKF171\r\n\r\n	update SKT6-- SKT6\r\n	set SKF166 = SKF185-- 应上班时间 = SKF185\r\n	where SKF153 = KaoQin_id-- SKF153\r\n	and SKF184 is null-- SKF184\r\n	and SKF185 is not null-- SKF185\r\n	and SKF909 is null-- SKF909\r\n	and SKF171 = 1;-- SKF171\r\n\r\n	update SKT6-- SKT6\r\n	set SKF166 = SKF909-- 应上班时间 = SKF909\r\n	where SKF153 = KaoQin_id-- SKF153\r\n	and SKF184 is null-- SKF184\r\n	and SKF185 is null-- SKF185\r\n	and SKF909 is not null-- SKF909\r\n	and SKF171 = 1;-- SKF171\r\n\r\n\r\n	update SKT6-- SKT6\r\n	set SKF167 = SKF186-- 应下班时间 = SKF186\r\n	where SKF153 = KaoQin_id-- SKF153\r\n	and SKF186 is not null-- SKF186\r\n	and SKF187 is null-- SKF187\r\n	and SKF910 is null-- SKF910\r\n	and SKF171 = 1;-- SKF171\r\n\r\n	update SKT6-- SKT6\r\n	set SKF167 = SKF187-- 应下班时间 = SKF187\r\n	where SKF153 = KaoQin_id-- SKF153\r\n	and SKF186 is null-- SKF186\r\n	and SKF187 is not null-- SKF187\r\n	and SKF910 is null-- SKF910\r\n	and SKF171 = 1;-- SKF171\r\n\r\n	update SKT6-- SKT6\r\n	set SKF167 = SKF910-- 应下班时间 = SKF910\r\n	where SKF153 = KaoQin_id-- SKF153\r\n	and SKF186 is null-- SKF186\r\n	and SKF187 is null-- SKF187\r\n	and SKF910 is not null-- SKF910\r\n	and SKF171 = 1;-- SKF171\r\n\r\n	IF t_error = 1 THEN\r\n			ROLLBACK;\r\n	ELSE\r\n			COMMIT;\r\n	END IF;\r\n\r\nEND;','',2,'2018-11-28 15:23:52',NULL,0,'1970-01-01 00:00:00',0,0,0,NULL,0,NULL),(57,'SK_PRO_57','31、当日考勤1','CREATE PROCEDURE proc_updateDangRiKaoQin1(IN KaoQin_id varchar(255), IN KaoQin_date date)\r\nBEGIN\r\n	DECLARE SKF152_XuHao INT;-- SKF152\r\n	DECLARE SKF154_KaHao varchar(255);-- SKF154\r\n	-- DECLARE count_QingJia INT ; \r\n	-- DECLARE count_WaiChu INT ; \r\n	-- DECLARE count_ChuChai INT ; \r\n	DECLARE sl INT ; \r\n	DECLARE rq  datetime ;  \r\n	DECLARE rq1  datetime ;\r\n	DECLARE rq2  datetime ; \r\n	DECLARE rq3  datetime ; \r\n	DECLARE rq4  datetime ; \r\n\r\n	DECLARE not_found INT DEFAULT 0;\r\n	DECLARE t_error int DEFAULT 0;\r\n	DECLARE CONTINUE HANDLER FOR SQLEXCEPTION SET t_error=1;\r\n	START TRANSACTION;\r\n\r\n	begin\r\n	DECLARE cur_1 CURSOR FOR SELECT SKF152,-- SKF152\r\n	SKF154-- SKF154\r\n	FROM SKT6-- SKT6\r\n	where SKF153 = KaoQin_id;-- 考勤编号\r\n	DECLARE CONTINUE HANDLER FOR NOT FOUND SET not_found=1;\r\n\r\n	OPEN cur_1;\r\n		WHILE not_found = 0 DO \r\n			FETCH cur_1 INTO SKF152_XuHao, SKF154_KaHao;\r\n\r\n			select count(*) into sl-- 数量\r\n			from tblattendancerecord-- tblattendancerecord\r\n			where EnrollID/*(EnrollID mod 1000000)*/ = SKF154_KaHao-- 考勤机人员编号\r\n			and DATE_FORMAT(RecordDatetime,\'%Y-%m-%d\')=KaoQin_date;-- 考勤日期\r\n\r\n			set rq2=str_to_date(CONCAT(KaoQin_date,\' 00:00:00\'), \'%Y-%m-%d %H:%i:%s\') ;\r\n			set rq3=str_to_date(CONCAT(KaoQin_date,\' 14:00:00\'), \'%Y-%m-%d %H:%i:%s\') ;\r\n			set rq4=str_to_date(CONCAT(KaoQin_date,\' 23:59:59\'), \'%Y-%m-%d %H:%i:%s\') ;\r\n\r\n			if sl>0 then\r\n				select RecordDatetime into rq from tblattendancerecord/*考勤记录表*/ where EnrollID/*(EnrollID mod 1000000)*/=SKF154_KaHao and DATE_FORMAT(RecordDatetime,\'%Y-%m-%d\')=KaoQin_date order by RecordDatetime ASC limit  1;\r\n				select RecordDatetime into rq1 from tblattendancerecord/*考勤记录表*/ where EnrollID/*(EnrollID mod 1000000)*/=SKF154_KaHao and DATE_FORMAT(RecordDatetime,\'%Y-%m-%d\')=KaoQin_date and RecordDatetime>=rq2 order by RecordDatetime desc limit  1;\r\n				update SKT6 set SKF156/*上班时分*/=DATE_FORMAT(rq,\'%H:%i:%s\') where SKF152=SKF152_XuHao;\r\n				update SKT6 set SKF157/*下班时分*/=DATE_FORMAT(rq1,\'%H:%i:%s\')  where SKF152=SKF152_XuHao;\r\n				update SKT6 set SKF162/*上班时间*/=rq where SKF152=SKF152_XuHao;\r\n				update SKT6 set SKF163/*下班时间*/=rq1 where SKF152=SKF152_XuHao;\r\n				update SKT6 set SKF164/*上班状态*/=\'正常\' where SKF152=SKF152_XuHao and SKF162/*上班时间*/<=SKF166/*应上班日期*/;\r\n				update SKT6 set SKF165/*下班状态*/=\'正常\' where SKF152=SKF152_XuHao and SKF163/*下班时间*/>=SKF167/*应下班日期*/;\r\n\r\n				update SKT6 set SKF157/*下班时分*/=null, SKF163/*下班时间*/=null where SKF152=SKF152_XuHao and SKF162/*上班时间*/=SKF163/*下班时间*/ and SKF165/*下班状态*/!=\'正常\';\r\n				update SKT6 set SKF156/*上班时分*/=null, SKF162/*上班时间*/=null where SKF152=SKF152_XuHao and SKF162/*上班时间*/=SKF163/*下班时间*/ and SKF164/*上班状态*/!=\'正常\';\r\n\r\n				update SKT6 set SKF164/*上班状态*/=\'未打卡\' where SKF162/*上班时间*/ is null and SKF152=SKF152_XuHao;\r\n				update SKT6 set SKF165/*下班状态*/=\'未打卡\' where SKF163/*下班时间*/ is null and SKF152=SKF152_XuHao;\r\n				update SKT6 set SKF165/*下班状态*/=\'未打卡\' where SKF152=SKF152_XuHao and SKF162/*上班时间*/=SKF163/*下班时间*/ and SKF162/*上班时间*/>=rq2 and SKF162/*上班时间*/<=rq3;\r\n				update SKT6 set SKF164/*上班状态*/=\'未打卡\' where SKF152=SKF152_XuHao and SKF162/*上班时间*/=SKF163/*下班时间*/ and SKF163/*下班时间*/>=rq3 and SKF163/*下班时间*/<=rq4;\r\n				update SKT6 set SKF168/*迟到分钟*/=TIMESTAMPDIFF(MINUTE,SKF166/*应上班日期*/,SKF162/*上班时间*/) where SKF152=SKF152_XuHao and SKF162/*上班时间*/>SKF166/*应上班日期*/;\r\n				update SKT6 set SKF169/*早退分钟*/=TIMESTAMPDIFF(MINUTE,SKF163/*下班时间*/,SKF167/*应下班日期*/) where SKF152=SKF152_XuHao and SKF163/*下班时间*/<SKF167/*应下班日期*/;\r\n				update SKT6 set SKF164/*上班状态*/=\'迟到\' where SKF152=SKF152_XuHao and SKF162/*上班时间*/>SKF166/*应上班日期*/ and SKF168/*迟到分钟*/>10;\r\n				update SKT6 set SKF165/*下班状态*/=\'早退\' where SKF152=SKF152_XuHao and SKF163/*下班时间*/<SKF167/*应下班日期*/ and SKF169/*早退分钟*/>10;\r\n				update SKT6 set SKF164/*上班状态*/=\'正常\' where SKF152=SKF152_XuHao and SKF162/*上班时间*/>SKF166/*应上班日期*/ and SKF168/*迟到分钟*/<=10;\r\n				update SKT6 set SKF165/*下班状态*/=\'正常\' where SKF152=SKF152_XuHao and SKF163/*下班时间*/<SKF167/*应下班日期*/ and SKF169/*早退分钟*/<=10;\r\n				update SKT6 set SKF168/*迟到分钟*/=0 where SKF152=SKF152_XuHao and SKF162/*上班时间*/>SKF166/*应上班日期*/ and SKF168/*迟到分钟*/<=10;\r\n				update SKT6 set SKF169/*早退分钟*/=0 where SKF152=SKF152_XuHao and SKF163/*下班时间*/<SKF167/*应下班日期*/ and SKF169/*早退分钟*/<=10;\r\n				update SKT6 set SKF168/*迟到分钟*/=0 where SKF152=SKF152_XuHao and SKF162/*上班时间*/<=SKF166/*应上班日期*/;\r\n				update SKT6 set SKF169/*早退分钟*/=0 where SKF152=SKF152_XuHao and SKF163/*下班时间*/>=SKF167/*应下班日期*/;\r\n				update SKT6 set SKF164/*上班状态*/=\'正常\' where SKF152=SKF152_XuHao and SKF168/*迟到分钟*/=0 and SKF164/*上班状态*/!=\'未打卡\';\r\n				update SKT6 set SKF165/*下班状态*/=\'正常\' where SKF152=SKF152_XuHao and SKF169/*早退分钟*/=0 and SKF165/*下班状态*/!=\'未打卡\';\r\n				update SKT6 set SKF164/*上班状态*/=\'未打卡\',SKF156/*上班时分*/=\'\' where SKF152=SKF152_XuHao and SKF168/*迟到分钟*/>=500;\r\n				update SKT6 set SKF165/*下班状态*/=\'未打卡\',SKF157/*下班时分*/=\'\' where SKF152=SKF152_XuHao and SKF169/*早退分钟*/>=500;\r\n				update SKT6 set SKF169/*早退分钟*/=0 where SKF152=SKF152_XuHao and SKF169/*早退分钟*/>=500;\r\n				update SKT6 set SKF168/*迟到分钟*/=null where SKF152=SKF152_XuHao and SKF164/*上班状态*/=\'未打卡\';\r\n				update SKT6 set SKF169/*早退分钟*/=null where SKF152=SKF152_XuHao and SKF165/*下班状态*/=\'未打卡\';\r\n				update SKT6 set SKF156/*上班时分*/=\'\' where SKF152=SKF152_XuHao and SKF164/*上班状态*/=\'未打卡\';\r\n				update SKT6 set SKF157/*下班时分*/=\'\' where SKF152=SKF152_XuHao and SKF165/*下班状态*/=\'未打卡\';\r\n			end if;\r\n\r\n		END WHILE;\r\n	CLOSE cur_1;\r\n	end;\r\n\r\n	IF t_error = 1 THEN\r\n			ROLLBACK;\r\n	ELSE\r\n			COMMIT;\r\n	END IF;\r\n\r\nEND;','',2,'2018-11-28 15:23:52','2018-12-02 16:56:27',0,'1970-01-01 00:00:00',0,0,0,'1970-01-01 08:00:00',0,NULL),(58,'SK_PRO_58','32、当日考勤统计','CREATE PROCEDURE proc_updateDangRiKaoQinTongJi(IN KaoQin_id varchar(255), IN dt date)\r\nBEGIN\r\n	-- DECLARE SKF152_XuHao INT;-- SKF152\r\n	-- DECLARE SKF159_GongHao varchar(255);-- SKF159\r\n	-- DECLARE SKF154_KaHao varchar(255);-- SKF154\r\n	-- DECLARE count_QingJia INT ; \r\n	-- DECLARE count_WaiChu INT ; \r\n	-- DECLARE count_ChuChai INT ; \r\n	DECLARE xh INT ; \r\n	DECLARE sl INT ; \r\n	DECLARE wc INT ; \r\n	DECLARE gh varchar(255) ; \r\n	DECLARE rq datetime ;  \r\n	DECLARE rq1 datetime ;\r\n	DECLARE rq2 datetime ; \r\n	DECLARE rq3 datetime ; \r\n	DECLARE rq4 datetime ;\r\n	DECLARE date1 datetime ;\r\n	DECLARE date2 datetime ;\r\n	-- DECLARE xm varchar(255) ;  \r\n	DECLARE sj DECIMAL(12,2);\r\n	DECLARE bj DECIMAL(12,2);\r\n	DECLARE gs DECIMAL(12,2);\r\n	DECLARE nx DECIMAL(12,2);\r\n	DECLARE gx DECIMAL(12,2);\r\n	DECLARE hj DECIMAL(12,2);\r\n	DECLARE cj DECIMAL(12,2);\r\n	DECLARE sanj DECIMAL(12,2);\r\n	DECLARE br DECIMAL(12,2);\r\n	DECLARE pc DECIMAL(12,2);\r\n	DECLARE wxj DECIMAL(12,2);\r\n	DECLARE bgswc DECIMAL(12,2);\r\n	DECLARE bgscc DECIMAL(12,2);\r\n\r\n	DECLARE not_found INT DEFAULT 0;\r\n	DECLARE t_error int DEFAULT 0;\r\n	DECLARE CONTINUE HANDLER FOR SQLEXCEPTION SET t_error=1;\r\n	START TRANSACTION;\r\n\r\n	begin\r\n	DECLARE cur_1 CURSOR FOR SELECT SKF152,-- SKF152\r\n	SKF159-- SKF159\r\n	FROM SKT6-- SKT6\r\n	where SKF153 = KaoQin_id;-- 考勤编号\r\n	DECLARE CONTINUE HANDLER FOR NOT FOUND SET not_found=1;\r\n\r\n	OPEN cur_1;\r\n		WHILE not_found = 0 DO \r\n			FETCH cur_1 INTO xh, gh;\r\n			\r\n			select sum(SKF839)/*请假天数*/ into sj from SKT55/*请假单明细表*/ where SKF836/*请假日期*/=dt and SKF835/*请假类别*/=\'事假\' and SKF834/*工号*/=gh and SKF890/*是否确认*/=1;\r\n			select sum(SKF839)/*请假天数*/ into bj from SKT55/*请假单明细表*/ where SKF836/*请假日期*/=dt and SKF835/*请假类别*/=\'病假\' and SKF834/*工号*/=gh and SKF890/*是否确认*/=1;\r\n			select sum(SKF839)/*请假天数*/ into gs from SKT55/*请假单明细表*/ where SKF836/*请假日期*/=dt and SKF835/*请假类别*/=\'工伤假\' and SKF834/*工号*/=gh and SKF890/*是否确认*/=1;\r\n			select sum(SKF839)/*请假天数*/ into nx from SKT55/*请假单明细表*/ where SKF836/*请假日期*/=dt and SKF835/*请假类别*/=\'年假\' and SKF834/*工号*/=gh and SKF890/*是否确认*/=1;\r\n			select sum(SKF839)/*请假天数*/ into gx from SKT55/*请假单明细表*/ where SKF836/*请假日期*/=dt and SKF835/*请假类别*/=\'其他假\' and SKF834/*工号*/=gh and SKF890/*是否确认*/=1;\r\n			select sum(SKF839)/*请假天数*/ into hj from SKT55/*请假单明细表*/ where SKF836/*请假日期*/=dt and SKF835/*请假类别*/=\'婚假\' and SKF834/*工号*/=gh and SKF890/*是否确认*/=1;\r\n			select sum(SKF839)/*请假天数*/ into cj from SKT55/*请假单明细表*/ where SKF836/*请假日期*/=dt and SKF835/*请假类别*/=\'产假\' and SKF834/*工号*/=gh and SKF890/*是否确认*/=1;\r\n			select sum(SKF839)/*请假天数*/ into sanj from SKT55/*请假单明细表*/ where  SKF836/*请假日期*/=dt and SKF835/*请假类别*/=\'丧假\' and SKF834/*工号*/=gh and SKF890/*是否确认*/=1;\r\n			select sum(SKF839)/*请假天数*/ into br from SKT55/*请假单明细表*/ where SKF836/*请假日期*/=dt and SKF835/*请假类别*/=\'哺乳假\' and SKF834/*工号*/=gh and SKF890/*是否确认*/=1;\r\n			select sum(SKF839)/*请假天数*/ into pc from SKT55/*请假单明细表*/ where SKF836/*请假日期*/=dt and SKF835/*请假类别*/=\'陪产假\' and SKF834/*工号*/=gh and SKF890/*是否确认*/=1;\r\n			select sum(SKF839)/*请假天数*/ into wxj from SKT55/*请假单明细表*/ where SKF836/*请假日期*/=dt and SKF835/*请假类别*/=\'调休\' and SKF834/*工号*/=gh and SKF890/*是否确认*/=1;\r\n			select sum(SKF852)/*外出天数*/ into bgswc from SKT56/*外出登记明细表*/ where SKF847/*工号*/=gh and SKF849/*外出日期*/=dt and SKF891/*审批状态*/=1;\r\n			select sum(SKF878)/*出差天数*/ into bgscc from SKT58/*出差登记明细表*/ where SKF873/*工号*/=gh and SKF875/*出差日期*/=dt and SKF892/*审批状态*/=1;\r\n\r\n			update SKT6/*每日考勤明细表*/ set SKF172/*年假*/=nx,SKF173/*调休*/=wxj,SKF174/*事假*/=sj,SKF175/*病假*/=bj,SKF176/*工伤*/=gs,SKF177/*产假*/=cj,SKF178/*婚假*/=hj,SKF179/*丧假*/=sanj,SKF180/*其他*/=gx,SKF198/*哺乳假*/=br,SKF199/*陪产假*/=pc,SKF181/*外出*/=bgswc,SKF911/*出差*/=bgscc where SKF152/*序号*/=xh;\r\n\r\n		END WHILE;\r\n	CLOSE cur_1;\r\n	end;\r\n\r\n	IF t_error = 1 THEN\r\n			ROLLBACK;\r\n	ELSE\r\n			COMMIT;\r\n	END IF;\r\n\r\nEND;\r\n','',2,'2018-11-28 15:23:52',NULL,0,'1970-01-01 00:00:00',0,0,0,NULL,0,NULL),(59,'SK_PRO_59','33、当日请假合计','CREATE PROCEDURE proc_updateDangRiQingJiaHeJi(IN bh varchar(255))\r\nBEGIN\r\n\r\n	DECLARE not_found INT DEFAULT 0;\r\n	DECLARE t_error int DEFAULT 0;\r\n	DECLARE CONTINUE HANDLER FOR SQLEXCEPTION SET t_error=1;\r\n	START TRANSACTION;\r\n	-- 更新SKT6/*每日考勤明细表*/\r\n	update SKT6 set SKF172/*年假*/=0 where SKF153=bh and SKF172/*年假*/ is null;\r\n	update SKT6 set SKF173/*调休*/=0 where SKF153=bh and SKF173/*调休*/ is null;\r\n	update SKT6 set SKF174/*事假*/=0 where SKF153=bh and SKF174/*事假*/ is null;\r\n	update SKT6 set SKF175/*病假*/=0 where SKF153=bh and SKF175/*病假*/ is null;\r\n	update SKT6 set SKF176/*工伤*/=0 where SKF153=bh and SKF176/*工伤*/ is null;\r\n	update SKT6 set SKF177/*产假*/=0 where SKF153=bh and SKF177/*产假*/ is null;\r\n	update SKT6 set SKF178/*婚假*/=0 where SKF153=bh and SKF178/*婚假*/ is null;\r\n	update SKT6 set SKF179/*丧假*/=0 where SKF153=bh and SKF179/*丧假*/ is null;\r\n	update SKT6 set SKF198/*哺乳假*/=0 where SKF153=bh and SKF198/*哺乳假*/ is null;\r\n	update SKT6 set SKF199/*陪产假*/=0 where SKF153=bh and SKF199/*陪产假*/ is null;\r\n	update SKT6 set SKF180/*其他*/=0 where SKF153=bh and SKF180/*其他*/ is null;\r\n	update SKT6 set SKF181/*外出*/=0 where SKF153=bh and SKF181/*外出*/ is null;\r\n	update SKT6 set SKF911/*出差*/=0 where SKF153=bh and SKF911/*出差*/ is null;\r\n	update SKT6 set SKF190/*请假合计*/=SKF172/*年假*/+SKF173/*调休*/+SKF174/*事假*/+SKF175/*病假*/+SKF176/*工伤*/+SKF177/*产假*/+SKF178/*婚假*/+SKF179/*丧假*/+SKF198/*哺乳假*/+SKF199/*陪产假*/+SKF180/*其他*/+SKF181/*外出*/+SKF911/*出差*/ where SKF153=bh;\r\n	update SKT6 set SKF164/*上班状态*/=\'异常\' where SKF153=bh and SKF190/*请假合计*/>0 and SKF190/*请假合计*/<8 and SKF162/*上班时间*/ is null and SKF163/*下班时间*/ is null;\r\n	update SKT6 set SKF165/*下班状态*/=\'异常\' where SKF153=bh and SKF190/*请假合计*/>0 and SKF190/*请假合计*/<8 and SKF162/*上班时间*/ is null and SKF163/*下班时间*/ is null;\r\n	update SKT6 set SKF164/*上班状态*/=\'异常\' where SKF153=bh and SKF162/*上班时间*/ is not null and SKF163/*下班时间*/ is not null and SKF190/*请假合计*/=8;\r\n	update SKT6 set SKF165/*下班状态*/=\'异常\' where SKF153=bh and SKF162/*上班时间*/ is not null and SKF163/*下班时间*/ is not null and SKF190/*请假合计*/=8;\r\n	update SKT6 set SKF164/*上班状态*/=\'正常\' where SKF153=bh and SKF190/*请假合计*/=8 and SKF162/*上班时间*/ is null and SKF163/*下班时间*/ is null;\r\n	update SKT6 set SKF165/*下班状态*/=\'正常\' where SKF153=bh and SKF190/*请假合计*/=8 and SKF162/*上班时间*/ is null and SKF163/*下班时间*/ is null;\r\n	update SKT6 set SKF172/*年假*/=null where SKF153=bh and SKF172/*年假*/=0;\r\n	update SKT6 set SKF173/*调休*/=null where SKF153=bh and SKF173/*调休*/=0;\r\n	update SKT6 set SKF174/*事假*/=null where SKF153=bh and SKF174/*事假*/=0;\r\n	update SKT6 set SKF175/*病假*/=null where SKF153=bh and SKF175/*病假*/=0;\r\n	update SKT6 set SKF176/*工伤*/=null where SKF153=bh and SKF176/*工伤*/=0;\r\n	update SKT6 set SKF177/*产假*/=null where SKF153=bh and SKF177/*产假*/=0;\r\n	update SKT6 set SKF178/*婚假*/=null where SKF153=bh and SKF178/*婚假*/=0;\r\n	update SKT6 set SKF179/*丧假*/=null where SKF153=bh and SKF179/*丧假*/=0;\r\n	update SKT6 set SKF198/*哺乳假*/=null where SKF153=bh and SKF198/*哺乳假*/=0;\r\n	update SKT6 set SKF199/*陪产假*/=null where SKF153=bh and SKF199/*陪产假*/=0;\r\n	update SKT6 set SKF180/*其他*/=null where SKF153=bh and SKF180/*其他*/=0;\r\n	update SKT6 set SKF181/*外出*/=null where SKF153=bh and SKF181/*外出*/=0;\r\n	update SKT6 set SKF911/*出差*/=null where SKF153=bh and SKF911/*出差*/=0;\r\n\r\n	IF t_error = 1 THEN\r\n			ROLLBACK;\r\n	ELSE\r\n			COMMIT;\r\n	END IF;\r\n\r\nEND;\r\n','',2,'2018-11-28 15:23:52',NULL,0,'1970-01-01 00:00:00',0,0,0,NULL,0,NULL),(60,'SK_PRO_60','34、旷工','CREATE PROCEDURE proc_updateKuangGong(IN bh varchar(255))\r\nBEGIN\r\n\r\n	DECLARE not_found INT DEFAULT 0;\r\n	DECLARE t_error int DEFAULT 0;\r\n	DECLARE CONTINUE HANDLER FOR SQLEXCEPTION SET t_error=1;\r\n	START TRANSACTION;\r\n	-- 更新SKT6/*每日考勤明细表*/\r\n	update SKT6 set SKF164/*上班状态*/=\'旷工\' where SKF163/*下班时间*/ is null and SKF162/*上班时间*/ is null and SKF153/*主表编号*/=bh and SKF171/*是否请假*/!=1;\r\n	update SKT6 set SKF165/*下班状态*/=\'旷工\' where SKF163/*下班时间*/ is null and SKF162/*上班时间*/ is null and SKF153/*主表编号*/=bh and SKF171/*是否请假*/!=1;\r\n\r\n	IF t_error = 1 THEN\r\n			ROLLBACK;\r\n	ELSE\r\n			COMMIT;\r\n	END IF;\r\n\r\nEND;\r\n','',2,'2018-11-28 15:23:52',NULL,0,'1970-01-01 00:00:00',0,0,0,NULL,0,NULL),(61,'SK_PRO_61','35、重新计算旷工','CREATE PROCEDURE proc_updateChongXinJiSuanKuangGong(IN bh varchar(255))\r\nBEGIN\r\n\r\n	DECLARE not_found INT DEFAULT 0;\r\n	DECLARE t_error int DEFAULT 0;\r\n	DECLARE CONTINUE HANDLER FOR SQLEXCEPTION SET t_error=1;\r\n	START TRANSACTION;\r\n\r\n	-- 更新SKT6/*每日考勤明细表*/\r\n	update SKT6 set SKF192/*上班小时*/=TIMESTAMPDIFF(MINUTE,SKF162/*上班时间*/,SKF163/*下班时间*/)/60 where SKF153/*主表编号*/=bh ;\r\n	update SKT6 set SKF192/*上班小时*/=0 where SKF153/*主表编号*/=bh and SKF192/*上班小时*/ is null;\r\n	update SKT6 set SKF190/*请假合计*/=0 where SKF153/*主表编号*/=bh and SKF190/*请假合计*/ is null;\r\n	update SKT6 set SKF193/*上班请假合计*/=SKF192/*上班小时*/+SKF190/*请假合计*/ where SKF153/*主表编号*/=bh;\r\n	update SKT6 set SKF164/*上班状态*/=\'正常\' where SKF153/*主表编号*/=bh and SKF193/*上班请假合计*/>=8 and SKF190/*请假合计*/>0;\r\n	update SKT6 set SKF165/*下班状态*/=\'正常\' where SKF153/*主表编号*/=bh and SKF193/*上班请假合计*/>=8 and SKF190/*请假合计*/>0;\r\n\r\n	IF t_error = 1 THEN\r\n			ROLLBACK;\r\n	ELSE\r\n			COMMIT;\r\n	END IF;\r\n\r\nEND;\r\n','',2,'2018-11-28 15:23:52',NULL,0,'1970-01-01 00:00:00',0,0,0,NULL,0,NULL),(62,'SK_PRO_62','36、上班补打','CREATE PROCEDURE proc_updateShangBanBuDa(IN KaoQin_id varchar(255), IN dt date)\r\nBEGIN\r\n	DECLARE xh INT ; \r\n	DECLARE sl INT ; \r\n	DECLARE wc INT ;\r\n	DECLARE wcsl INT ; \r\n	DECLARE kh  varchar(255) ; \r\n	DECLARE gh  varchar(255) ; \r\n	DECLARE xm  varchar(255) ;  \r\n	DECLARE sj DECIMAL(12,3);\r\n	DECLARE sbsj1 datetime;\r\n	DECLARE zwsj datetime;\r\n	DECLARE sbsj2 datetime;\r\n\r\n	DECLARE not_found INT DEFAULT 0;\r\n	DECLARE t_error int DEFAULT 0;\r\n	DECLARE CONTINUE HANDLER FOR SQLEXCEPTION SET t_error=1;\r\n	START TRANSACTION;\r\n\r\n	begin\r\n	DECLARE cur_1 CURSOR FOR SELECT SKF152,-- SKF152\r\n	SKF159-- SKF159\r\n	FROM SKT6-- SKT6\r\n	where SKF153 = KaoQin_id;-- 考勤编号\r\n	DECLARE CONTINUE HANDLER FOR NOT FOUND SET not_found=1;\r\n\r\n	OPEN cur_1;\r\n		WHILE not_found = 0 DO \r\n			FETCH cur_1 INTO xh, gh;\r\n\r\n			select count(SKF132)/*序号*/ into wcsl from SKT4/*补考勤表*/ where SKF136/*工号*/=gh and DATE_FORMAT(SKF137/*补打卡时间*/,\'%Y-%m-%d\')=dt and SKF134/*打卡分类*/=\'上班\';\r\n\r\n			if wcsl>0 then \r\n				update SKT6/*每日考勤明细表*/ set SKF164/*上班状态*/=\'补打\' where SKF152/*序号*/=xh;\r\n			end if;\r\n\r\n		END WHILE;\r\n	CLOSE cur_1;\r\n	end;\r\n\r\n	IF t_error = 1 THEN\r\n			ROLLBACK;\r\n	ELSE\r\n			COMMIT;\r\n	END IF;\r\n\r\nEND;','',2,'2018-11-28 15:23:52',NULL,0,'1970-01-01 00:00:00',0,0,0,NULL,0,NULL),(63,'SK_PRO_63','37、下班补打','CREATE PROCEDURE proc_updateXiaBanBuDa(IN KaoQin_id varchar(255), IN dt date)\r\nBEGIN\r\n	DECLARE xh INT ; \r\n	DECLARE sl INT ; \r\n	DECLARE wc INT ;\r\n	DECLARE wcsl INT ; \r\n	DECLARE kh  varchar(255) ; \r\n	DECLARE gh  varchar(255) ; \r\n	DECLARE xm  varchar(255) ;  \r\n	DECLARE sj DECIMAL(12,3);\r\n	DECLARE sbsj1 datetime;\r\n	DECLARE zwsj datetime;\r\n	DECLARE sbsj2 datetime;\r\n\r\n	DECLARE not_found INT DEFAULT 0;\r\n	DECLARE t_error int DEFAULT 0;\r\n	DECLARE CONTINUE HANDLER FOR SQLEXCEPTION SET t_error=1;\r\n	START TRANSACTION;\r\n\r\n	begin\r\n	DECLARE cur_1 CURSOR FOR SELECT SKF152,-- SKF152\r\n	SKF159-- SKF159\r\n	FROM SKT6-- SKT6\r\n	where SKF153 = KaoQin_id;-- 考勤编号\r\n	DECLARE CONTINUE HANDLER FOR NOT FOUND SET not_found=1;\r\n\r\n	OPEN cur_1;\r\n		WHILE not_found = 0 DO \r\n			FETCH cur_1 INTO xh, gh;\r\n\r\n			select count(SKF132)/*序号*/ into wcsl from SKT4/*补考勤表*/ where SKF136/*工号*/=gh and DATE_FORMAT(SKF137/*补打卡时间*/,\'%Y-%m-%d\')=dt and SKF134/*打卡分类*/=\'下班\';\r\n\r\n			if wcsl>0 then \r\n				update SKT6/*每日考勤明细表*/ set SKF165/*下班状态*/=\'补打\' where SKF152/*序号*/=xh;\r\n			end if;\r\n\r\n		END WHILE;\r\n	CLOSE cur_1;\r\n	end;\r\n\r\n	IF t_error = 1 THEN\r\n			ROLLBACK;\r\n	ELSE\r\n			COMMIT;\r\n	END IF;\r\n\r\nEND;','',2,'2018-11-28 15:23:52',NULL,0,'1970-01-01 00:00:00',0,0,0,NULL,0,NULL),(64,'SK_PRO_64','38、加班重新计算','CREATE PROCEDURE proc_updateJiaBanChongXinJiSuan(IN KaoQin_id varchar(255), IN dt date)\r\nBEGIN\r\n\r\n	DECLARE not_found INT DEFAULT 0;\r\n	DECLARE t_error int DEFAULT 0;\r\n	DECLARE CONTINUE HANDLER FOR SQLEXCEPTION SET t_error=1;\r\n	START TRANSACTION;\r\n\r\n	-- 更新SKT6/*每日考勤明细表*/\r\n	update SKT6 set SKF165/*下班状态*/=\'加班\' where SKF153/*主表编号*/=KaoQin_id and  DAYOFWEEK(dt)=7;-- 星期六\r\n	update SKT6 set SKF164/*上班状态*/=\'加班\' where SKF153/*主表编号*/=KaoQin_id and  DAYOFWEEK(dt)=7;-- 星期六\r\n	update SKT6 set SKF165/*下班状态*/=\'加班\' where SKF153/*主表编号*/=KaoQin_id and  DAYOFWEEK(dt)=1;-- 星期日\r\n	update SKT6 set SKF164/*上班状态*/=\'加班\' where SKF153/*主表编号*/=KaoQin_id and  DAYOFWEEK(dt)=1;-- 星期日\r\n\r\n	IF t_error = 1 THEN\r\n			ROLLBACK;\r\n	ELSE\r\n			COMMIT;\r\n	END IF;\r\n\r\nEND;\r\n','',2,'2018-11-28 15:23:52',NULL,0,'1970-01-01 00:00:00',0,0,0,NULL,0,NULL),(65,'SK_PRO_65','39、删除每日考勤明细','CREATE PROCEDURE proc_deleteMeiRiKaoQinMingXi(IN KaoQin_id varchar(255))\r\nBEGIN\r\n	DECLARE t_error int DEFAULT 0;\r\n	DECLARE CONTINUE HANDLER FOR SQLEXCEPTION SET t_error=1;\r\n	START TRANSACTION;\r\n\r\n	-- 删除每日考勤明细表\r\n	DELETE FROM SKT6 WHERE SKT6.SKF153 = KaoQin_id;-- 考勤编号\r\n\r\n	IF t_error = 1 THEN\r\n			ROLLBACK;\r\n	ELSE\r\n			COMMIT;\r\n	END IF;\r\n\r\nEND;\r\n','',2,'2018-11-28 15:23:52',NULL,0,'1970-01-01 00:00:00',0,0,0,NULL,0,NULL),(70,'SK_PRO_70','40、不需要当天上班时间','CREATE PROCEDURE proc_updateBuXuYaoDangTianShangBanShiJian(IN KaoQin_id varchar(255), IN dt date)\r\nBEGIN\r\n	DECLARE xh INT ; \r\n	DECLARE sl INT ; \r\n	DECLARE wc INT ; \r\n	DECLARE cc INT ; \r\n	DECLARE gh  varchar(255) ; \r\n	DECLARE zwsj  datetime ;  \r\n	DECLARE rq1  datetime ;\r\n	DECLARE rq2  datetime ; \r\n	DECLARE rq3  datetime ; \r\n	DECLARE rq4  datetime ;\r\n	DECLARE xm  varchar(255) ;  \r\n	DECLARE ysbsj  datetime ;\r\n	DECLARE sbsj1  datetime ;\r\n	DECLARE sbsj2  datetime ;\r\n	DECLARE sbsj3  datetime ;\r\n\r\n	DECLARE not_found INT DEFAULT 0;\r\n	DECLARE t_error int DEFAULT 0;\r\n	DECLARE CONTINUE HANDLER FOR SQLEXCEPTION SET t_error=1;\r\n	START TRANSACTION;\r\n\r\n	set zwsj=str_to_date(CONCAT(dt,\' 12:00:00\'), \'%Y-%m-%d %H:%i:%s\');-- 请假、SKF181、出差时间\r\n	set ysbsj=str_to_date(CONCAT(dt,\' 08:00:00\'), \'%Y-%m-%d %H:%i:%s\');-- SKF166\r\n\r\n	begin\r\n	DECLARE cur_1 CURSOR FOR SELECT SKF152,-- SKF152\r\n	SKF159-- SKF159\r\n	FROM SKT6-- SKT6\r\n	where SKF153 = KaoQin_id;-- 考勤编号\r\n	DECLARE CONTINUE HANDLER FOR NOT FOUND SET not_found=1;\r\n\r\n	OPEN cur_1;\r\n		WHILE not_found = 0 DO \r\n			FETCH cur_1 INTO xh, gh;\r\n\r\n			select count(*) into sl from SKT55/*请假单明细表*/ where SKF834/*工号*/=gh and DATE_FORMAT(SKF837/*请假开始时间*/,\'%Y-%m-%d\')=dt and SKF837/*请假开始时间*/<=zwsj and SKF890/*是否确认*/=1;\r\n			select count(*) into wc from SKT56/*外出登记明细表*/ where SKF847/*工号*/=gh and DATE_FORMAT(SKF850/*外出开始时间*/,\'%Y-%m-%d\')=dt and SKF850/*外出开始时间*/<=zwsj and SKF891/*审批状态*/=1;\r\n			select count(*) into cc from SKT58/*出差登记明细表*/ where SKF873/*工号*/=gh and DATE_FORMAT(SKF876/*出差开始时间*/,\'%Y-%m-%d\')=dt and SKF876/*出差开始时间*/<=zwsj and SKF892/*审批状态*/=1;\r\n			select SKF838/*请假结束时间*/ into sbsj1 from SKT55/*请假单明细表*/ where SKF834/*工号*/=gh and DATE_FORMAT(SKF837/*请假开始时间*/,\'%Y-%m-%d\')=dt and SKF837/*请假开始时间*/<=zwsj and SKF890/*是否确认*/=1 order by SKF837/*请假开始时间*/ ASC limit 1;\r\n			select SKF851/*外出结束时间*/ into sbsj2 from SKT56/*外出登记明细表*/ where SKF847/*工号*/=gh and DATE_FORMAT(SKF850/*外出开始时间*/,\'%Y-%m-%d\')=dt and SKF850/*外出开始时间*/<=zwsj and SKF891/*审批状态*/=1 order by SKF850/*外出开始时间*/ ASC limit 1;\r\n			select SKF877/*出差结束时间*/ into sbsj3 from SKT58/*出差登记明细表*/ where SKF873/*工号*/=gh and DATE_FORMAT(SKF876/*出差开始时间*/,\'%Y-%m-%d\')=dt and SKF876/*出差开始时间*/<=zwsj and SKF892/*审批状态*/=1 order by SKF876/*外出开始时间*/ ASC limit 1;\r\n			update SKT6/*每日考勤明细表*/ set SKF184/*请假后应上班时间*/=sbsj1 where SKF152/*序号*/=xh;\r\n			update SKT6/*每日考勤明细表*/ set SKF185/*外出后应上班时间*/=sbsj2 where SKF152/*序号*/=xh;\r\n			update SKT6/*每日考勤明细表*/ set SKF909/*出差后应上班时间*/=sbsj3 where SKF152/*序号*/=xh;\r\n			update SKT6/*每日考勤明细表*/ set SKF182/*当日是否请假*/=sl,SKF183/*当日是否外出*/=wc,SKF912/*当日是否出差*/=cc where SKF152/*序号*/=xh;\r\n			update SKT6/*每日考勤明细表*/ set SKF166/*应上班日期*/=ysbsj where SKF152/*序号*/=xh and SKF184/*请假后应上班时间*/ is null and SKF185/*外出后应上班时间*/ is null;\r\n			update SKT6/*每日考勤明细表*/ set SKF166/*应上班日期*/=SKF184/*请假后应上班时间*/ where SKF152/*序号*/=xh and SKF184/*请假后应上班时间*/ is not null and SKF185/*外出后应上班时间*/ is null and SKF909/*出差后应上班时间*/ is null;\r\n			update SKT6/*每日考勤明细表*/ set SKF166/*应上班日期*/=SKF185/*外出后应上班时间*/ where SKF152/*序号*/=xh and SKF184/*请假后应上班时间*/ is null and SKF185/*外出后应上班时间*/ is not null and SKF909/*出差后应上班时间*/ is null;\r\n			update SKT6/*每日考勤明细表*/ set SKF166/*应上班日期*/=SKF909/*出差后应上班时间*/ where SKF152/*序号*/=xh and SKF184/*请假后应上班时间*/ is null and SKF185/*外出后应上班时间*/ is null and SKF909/*出差后应上班时间*/ is not null;\r\n\r\n			update SKT6/*每日考勤明细表*/ set SKF166/*应上班日期*/=SKF184/*请假后应上班时间*/ where SKF152/*序号*/=xh and SKF184/*请假后应上班时间*/<SKF185/*外出后应上班时间*/ and SKF184/*请假后应上班时间*/ is not null  and SKF185/*外出后应上班时间*/ is not null;\r\n			update SKT6/*每日考勤明细表*/ set SKF166/*应上班日期*/=SKF184/*请假后应上班时间*/ where SKF152/*序号*/=xh and SKF184/*请假后应上班时间*/<SKF909/*出差后应上班时间*/ and SKF184/*请假后应上班时间*/ is not null  and SKF909/*出差后应上班时间*/ is not null;\r\n\r\n			update SKT6/*每日考勤明细表*/ set SKF166/*应上班日期*/=SKF185/*外出后应上班时间*/ where SKF152/*序号*/=xh and SKF185/*外出后应上班时间*/<SKF184/*请假后应上班时间*/ and SKF184/*请假后应上班时间*/ is not null and SKF185/*外出后应上班时间*/ is not null;\r\n			update SKT6/*每日考勤明细表*/ set SKF166/*应上班日期*/=SKF185/*外出后应上班时间*/ where SKF152/*序号*/=xh and SKF185/*外出后应上班时间*/<SKF909/*出差后应上班时间*/ and SKF185/*外出后应上班时间*/ is not null and SKF909/*出差后应上班时间*/ is not null;\r\n\r\n			update SKT6/*每日考勤明细表*/ set SKF166/*应上班日期*/=SKF909/*出差后应上班时间*/ where SKF152/*序号*/=xh and SKF909/*出差后应上班时间*/<SKF184/*请假后应上班时间*/ and SKF184/*请假后应上班时间*/ is not null and SKF909/*出差后应上班时间*/ is not null;\r\n			update SKT6/*每日考勤明细表*/ set SKF166/*应上班日期*/=SKF909/*出差后应上班时间*/ where SKF152/*序号*/=xh and SKF909/*出差后应上班时间*/<SKF185/*外出后应上班时间*/ and SKF185/*外出后应上班时间*/ is not null and SKF909/*出差后应上班时间*/ is not null;\r\n\r\n		END WHILE;\r\n	CLOSE cur_1;\r\n	end;\r\n\r\n	IF t_error = 1 THEN\r\n			ROLLBACK;\r\n	ELSE\r\n			COMMIT;\r\n	END IF;\r\n\r\nEND;\r\n','',2,'2018-11-28 15:23:52',NULL,0,'1970-01-01 00:00:00',0,0,0,NULL,0,NULL),(71,'SK_PRO_71','41、删除工资单及明细','CREATE PROCEDURE proc_deleteGongZiDanJiMingXi(IN GongZi_id varchar(255))\r\nBEGIN\r\n	DECLARE t_error int DEFAULT 0;\r\n	DECLARE CONTINUE HANDLER FOR SQLEXCEPTION SET t_error=1;\r\n	START TRANSACTION;\r\n\r\n	-- 删除工资主表\r\n	DELETE FROM SKT15 WHERE SKF401 = GongZi_id;-- 工资单号\r\n\r\n	-- 删除工资明细表\r\n	DELETE FROM SKT14 WHERE SKF415 = GongZi_id;-- 工资主表单号\r\n\r\n	IF t_error = 1 THEN\r\n			ROLLBACK;\r\n	ELSE\r\n			COMMIT;\r\n	END IF;\r\n\r\nEND;','',2,'2018-11-28 15:23:52',NULL,0,'1970-01-01 00:00:00',0,0,0,NULL,0,NULL),(72,'SK_PRO_72','42、请假天数','CREATE PROCEDURE proc_updateQingJiaTianShu(in date1 datetime,in  date2 datetime,in GongZi_id varchar(255))\r\nBEGIN\r\n	DECLARE gh varchar(255); \r\n	DECLARE xh INT ; \r\n	DECLARE sj DECIMAL(12,3);  \r\n	DECLARE bj DECIMAL(12,3);  \r\n\r\n	DECLARE not_found INT DEFAULT 0;\r\n	DECLARE t_error int DEFAULT 0;\r\n	DECLARE CONTINUE HANDLER FOR SQLEXCEPTION SET t_error=1;\r\n	START TRANSACTION;\r\n\r\n	begin\r\n	DECLARE cur_1 CURSOR FOR SELECT SKF349,-- SKF349\r\n	SKF350-- SKF350\r\n	FROM SKT14-- SKT14\r\n	where SKF415 = GongZi_id;-- SKF415\r\n	DECLARE CONTINUE HANDLER FOR NOT FOUND SET not_found=1;\r\n\r\n	OPEN cur_1;\r\n		WHILE not_found = 0 DO \r\n			FETCH cur_1 INTO xh, gh;\r\n\r\n			select sum(SKF839)/*请假天数*/ into sj from SKT55/*请假单明细表*/ where SKF837/*请假开始时间*/ >= date1 and SKF837/*请假开始时间*/ <= date2 and SKF835/*请假类别*/ = \'事假\' and SKF834/*工号*/ = gh ;\r\n			select sum(SKF839)/*请假天数*/ into bj from SKT55/*请假单明细表*/ where SKF837/*请假开始时间*/ >= date1 and SKF837/*请假开始时间*/ <= date2 and SKF835/*请假类别*/ = \'病假\' and SKF834/*工号*/ = gh ;\r\n			update SKT14/*工资明细表*/ set SKF914/*事假缺勤天数*/ = sj, SKF915/*病假天数*/ = bj where SKF349/*序号*/=xh;\r\n			update SKT14/*工资明细表*/ set SKF914/*事假缺勤天数*/ = 0 WHERE SKF914/*事假缺勤天数*/ is null and SKF349/*序号*/=xh;\r\n			update SKT14/*工资明细表*/ set SKF915/*病假天数*/ = 0 WHERE SKF915/*病假天数*/ is null and SKF349/*序号*/=xh;\r\n\r\n			/*工龄不满 2 年*/\r\n			update SKT14/*工资明细表*/, SKT1/*员工档案表*/ set \r\n			SKT14.SKF924/*工龄系数*/ = 0.4 \r\n			WHERE SKT14.SKF350/*工号*/ = SKT1.SKF1/*工号*/\r\n			and SKT1.SKF22/*工龄*/ < 2\r\n			and SKT14.SKF349/*序号*/=xh;\r\n\r\n			/*工龄满 2 年、不满 4 年*/\r\n			update SKT14/*工资明细表*/, SKT1/*员工档案表*/ set \r\n			SKT14.SKF924/*工龄系数*/ = 0.3 \r\n			WHERE SKT14.SKF350/*工号*/ = SKT1.SKF1/*工号*/\r\n			and SKT1.SKF22/*工龄*/ >= 2\r\n			and SKT1.SKF22/*工龄*/ < 4\r\n			and SKT14.SKF349/*序号*/=xh;\r\n\r\n			/*工龄满 4 年、不满 6 年*/\r\n			update SKT14/*工资明细表*/, SKT1/*员工档案表*/ set \r\n			SKT14.SKF924/*工龄系数*/ = 0.2 \r\n			WHERE SKT14.SKF350/*工号*/ = SKT1.SKF1/*工号*/\r\n			and SKT1.SKF22/*工龄*/ >= 4\r\n			and SKT1.SKF22/*工龄*/ < 6\r\n			and SKT14.SKF349/*序号*/=xh;\r\n\r\n			/*工龄满 6 年、不满 8 年*/\r\n			update SKT14/*工资明细表*/, SKT1/*员工档案表*/ set \r\n			SKT14.SKF924/*工龄系数*/ = 0.1 \r\n			WHERE SKT14.SKF350/*工号*/ = SKT1.SKF1/*工号*/\r\n			and SKT1.SKF22/*工龄*/ >= 6\r\n			and SKT1.SKF22/*工龄*/ < 8\r\n			and SKT14.SKF349/*序号*/=xh;\r\n\r\n			/*工龄满 8 年*/\r\n			update SKT14/*工资明细表*/, SKT1/*员工档案表*/ set \r\n			SKT14.SKF924/*工龄系数*/ = 0 \r\n			WHERE SKT14.SKF350/*工号*/ = SKT1.SKF1/*工号*/\r\n			and SKT1.SKF22/*工龄*/ >= 8\r\n			and SKT14.SKF349/*序号*/=xh;\r\n\r\n		END WHILE;\r\n	CLOSE cur_1;\r\n	end;\r\n\r\n	/*事假病假>4天场合、计算系数*/\r\n	update SKT14/*工资明细表*/ set SKF923/*工资系数*/ = (21.75 - SKF914/*事假缺勤天数*/ - SKF915/*病假天数*/) / 21.75 where (SKF914/*事假缺勤天数*/ + SKF915/*病假天数*/) > 4 and SKF415/*工资主表单号*/ = GongZi_id;\r\n\r\n	IF t_error = 1 THEN\r\n			ROLLBACK;\r\n	ELSE\r\n			COMMIT;\r\n	END IF;\r\n\r\nEND;','',2,'2018-11-28 15:23:52',NULL,0,'1970-01-01 00:00:00',0,0,0,NULL,0,NULL),(73,'SK_PRO_73','43、计算加班工资加班小时','CREATE PROCEDURE proc_updateJiSuanJiaBanGongZiJiaBanXiaoShi(in date1 datetime,in date2 datetime,in GongZi_id varchar(255))\r\nBEGIN\r\n	DECLARE gh varchar(255); \r\n	DECLARE xh INT ; \r\n	DECLARE jb_xs15 DECIMAL(12,3); \r\n	DECLARE jb_xs2 DECIMAL(12,3);  \r\n	DECLARE jb_xs3 DECIMAL(12,3); \r\n\r\n	DECLARE yc_xs15 DECIMAL(12,3); \r\n	DECLARE yc_xs2 DECIMAL(12,3);  \r\n	DECLARE yc_xs3 DECIMAL(12,3); \r\n\r\n	DECLARE not_found INT DEFAULT 0;\r\n	DECLARE t_error int DEFAULT 0;\r\n	DECLARE CONTINUE HANDLER FOR SQLEXCEPTION SET t_error=1;\r\n	START TRANSACTION;\r\n\r\n	begin\r\n	DECLARE cur_1 CURSOR FOR SELECT SKF349,-- SKF349\r\n	SKF350-- SKF350\r\n	FROM SKT14-- SKT14\r\n	where SKF415 = GongZi_id;-- SKF415\r\n	DECLARE CONTINUE HANDLER FOR NOT FOUND SET not_found=1;\r\n\r\n	OPEN cur_1;\r\n		WHILE not_found = 0 DO \r\n			FETCH cur_1 INTO xh, gh;\r\n\r\n			select sum(SKF277)/*加班小时*/ into jb_xs15 from SKT11/*加班申请单表*/ where SKF275/*加班开始时间*/ >= date1 and SKF275/*加班开始时间*/ <= date2 and SKF264/*工号*/ = gh AND SKF273/*加班类别*/ = \'平日\' and SKF272/*结算方式*/ = \'加班费\';\r\n			select sum(SKF277)/*加班小时*/ into jb_xs2 from SKT11/*加班申请单表*/ where SKF275/*加班开始时间*/ >= date1 and SKF275/*加班开始时间*/ <= date2 and SKF264/*工号*/ = gh AND SKF273/*加班类别*/ = \'双休日\' and SKF272/*结算方式*/ = \'加班费\';\r\n			select sum(SKF277)/*加班小时*/ into jb_xs3 from SKT11/*加班申请单表*/ where SKF275/*加班开始时间*/ >= date1 and SKF275/*加班开始时间*/ <= date2 and SKF264/*工号*/ = gh AND SKF273/*加班类别*/ = \'国定日\' and SKF272/*结算方式*/ = \'加班费\';\r\n\r\n			select sum(SKF278)/*用餐休息小时*/ into yc_xs15 from SKT11/*加班申请单表*/ where SKF275/*加班开始时间*/ >= date1 and SKF275/*加班开始时间*/ <= date2 and SKF264/*工号*/ = gh AND SKF273/*加班类别*/ = \'平日\' and SKF272/*结算方式*/ = \'加班费\';\r\n			select sum(SKF278)/*用餐休息小时*/ into yc_xs2 from SKT11/*加班申请单表*/ where SKF275/*加班开始时间*/ >= date1 and SKF275/*加班开始时间*/ <= date2 and SKF264/*工号*/ = gh AND SKF273/*加班类别*/ = \'双休日\' and SKF272/*结算方式*/ = \'加班费\';\r\n			select sum(SKF278)/*用餐休息小时*/ into yc_xs3 from SKT11/*加班申请单表*/ where SKF275/*加班开始时间*/ >= date1 and SKF275/*加班开始时间*/ <= date2 and SKF264/*工号*/ = gh AND SKF273/*加班类别*/ = \'国定日\' and SKF272/*结算方式*/ = \'加班费\';\r\n\r\n			update SKT14/*工资明细表*/ set \r\n			SKF530/*加班小时1点5倍*/ = jb_xs15, \r\n			SKF531/*加班小时2倍*/ = jb_xs2, \r\n			SKF532/*加班小时3倍*/ = jb_xs3, \r\n			SKF919/*用餐小时1点5倍*/ = yc_xs15, \r\n			SKF920/*用餐小时2倍*/ = yc_xs2, \r\n			SKF921/*用餐小时3倍*/ = yc_xs3 \r\n			where SKF349/*序号*/ = xh;\r\n\r\n		END WHILE;\r\n	CLOSE cur_1;\r\n	end;\r\n\r\n	/*加班小时*/\r\n	update SKT14/*工资明细表*/ set SKF530/*加班小时1点5倍*/ = 0 WHERE SKF530/*加班小时1点5倍*/ is null and SKF415/*工资主表单号*/ = GongZi_id;\r\n	update SKT14/*工资明细表*/ set SKF531/*加班小时2倍*/ = 0 WHERE SKF531/*加班小时2倍*/ is null and SKF415/*工资主表单号*/ = GongZi_id;\r\n	update SKT14/*工资明细表*/ set SKF532/*加班小时3倍*/ = 0 WHERE SKF532/*加班小时3倍*/ is null and SKF415/*工资主表单号*/ = GongZi_id;\r\n\r\n	/*用餐小时*/\r\n	update SKT14/*工资明细表*/ set SKF919/*用餐小时1点5倍*/ = 0 WHERE SKF919/*加班小时1点5倍*/ is null and SKF415/*工资主表单号*/ = GongZi_id;\r\n	update SKT14/*工资明细表*/ set SKF920/*用餐小时2倍*/ = 0 WHERE SKF920/*加班小时2倍*/ is null and SKF415/*工资主表单号*/ = GongZi_id;\r\n	update SKT14/*工资明细表*/ set SKF921/*用餐小时3倍*/ = 0 WHERE SKF921/*加班小时3倍*/ is null and SKF415/*工资主表单号*/ = GongZi_id;\r\n\r\n	/*加班小时合计、用餐小时合计*/\r\n	update SKT14/*工资明细表*/ set SKF357/*加班小时合计*/ = SKF530 * 1.5 + SKF531 * 2 + SKF532 * 3 WHERE SKF415/*工资主表单号*/ = GongZi_id;\r\n	update SKT14/*工资明细表*/ set SKF356/*用餐小时合计*/ = SKF919 * 1.5 + SKF920 * 2 + SKF921 * 3 WHERE SKF415/*工资主表单号*/ = GongZi_id;\r\n\r\n	/*加班工数（天）不含用餐时间*/\r\n	update SKT14/*工资明细表*/ set SKF365/*加班工数*/ = SKF357/*加班小时合计*/ / 8 WHERE SKF415/*工资主表单号*/ = GongZi_id;\r\n\r\n	/*用餐休息天*/\r\n	update SKT14/*工资明细表*/ set SKF367/*用餐休息天*/ = SKF356/*用餐休息小时*/ / 8 where SKF415/*工资主表单号*/ = GongZi_id;\r\n\r\n	IF t_error = 1 THEN\r\n			ROLLBACK;\r\n	ELSE\r\n			COMMIT;\r\n	END IF;\r\n\r\nEND;\r\n','',2,'2018-11-28 15:23:52',NULL,0,'1970-01-01 00:00:00',0,0,0,NULL,0,NULL),(74,'SK_PRO_74','44、默认奖金','CREATE PROCEDURE proc_updateMoRenJiangJin(in gzdh varchar(255), in jxdh varchar(255)/*, in jddh varchar(255)*/)\r\nBEGIN\r\n\r\n	DECLARE not_found INT DEFAULT 0;\r\n	DECLARE t_error int DEFAULT 0;\r\n	DECLARE CONTINUE HANDLER FOR SQLEXCEPTION SET t_error=1;\r\n	START TRANSACTION;\r\n/*\r\n	update SKT14 set \r\n	SKT14.SKF375 = 0, -- 技贴\r\n	SKT14.SKF376 = 0, -- 个人安全\r\n	SKT14.SKF377 = 0, -- 团体安全\r\n	SKT14.SKF378 = 0 -- 五S\r\n	where SKT14.SKF415 = gzdh; -- 工资主表单号\r\n*/\r\n	/*保密津贴、伙食贴、月车费、岗贴*/\r\n	update SKT14 set \r\n	SKF371 = SKF371 * SKF923/*工资系数*/, -- 保密津贴\r\n	SKF372 = SKF372 * SKF923/*工资系数*/, -- 伙食贴\r\n	SKF373 = SKF373 * SKF923/*工资系数*/, -- 月车费\r\n	SKF374 = SKF374 * SKF923/*工资系数*/ -- 岗贴\r\n	where SKF415 = gzdh; -- 工资主表单号\r\n\r\n	-- 更新SKT14/*工资明细表*/、SKT17/*绩效奖金子表*/\r\n	update SKT14, SKT17 set \r\n	SKT14.SKF375 = SKT17.SKF436 * SKF923/*工资系数*/, -- 技贴\r\n	SKT14.SKF376 = SKT17.SKF437 * SKF923/*工资系数*/, -- 个人安全\r\n	SKT14.SKF377 = SKT17.SKF438 * SKF923/*工资系数*/, -- 团体安全\r\n	SKT14.SKF378 = SKT17.SKF439 * SKF923/*工资系数*/ -- 五S\r\n	where SKT14.SKF415 = gzdh -- 工资主表单号\r\n	-- and SKT14.奖金发放方式=\'月度发放\' \r\n	and SKT14.SKF783 = SKT17.SKF428 -- 绩效奖金主表单号\r\n	and SKT17.SKF428 = jxdh -- 绩效奖金单号\r\n	and SKT14.SKF350 = SKT17.SKF429; -- 工号\r\n\r\n	-- update SKT14, SKT17 set SKT14.奖金=SKT17.季度奖金 where SKT14.主表单号=gzdh and SKT14.奖金发放方式=\'季度发放\'and SKT14.当月是否发季度奖=1 and SKT17.主表单号=SKT14.季度单号 and SKT17.主表单号=jddh and SKT14.工号=SKT17.工号;\r\n\r\n	-- update SKT14 set 奖金 = 0 where 主表单号 = gzdh and 奖金发放方式 = \'季度发放\' and 当月是否发季度奖 = 0;\r\n\r\n	IF t_error = 1 THEN\r\n			ROLLBACK;\r\n	ELSE\r\n			COMMIT;\r\n	END IF;\r\n\r\nEND;\r\n','',2,'2018-11-28 15:23:52',NULL,0,'1970-01-01 00:00:00',0,0,0,NULL,0,NULL),(76,'SK_PRO_76','45、高温补助','CREATE PROCEDURE proc_updateGaoWenBuZhu(in gzdh varchar(255), in gwbz int)\r\nBEGIN\r\n\r\n	DECLARE not_found INT DEFAULT 0;\r\n	DECLARE t_error int DEFAULT 0;\r\n	DECLARE CONTINUE HANDLER FOR SQLEXCEPTION SET t_error=1;\r\n	START TRANSACTION;\r\n\r\n	if gwbz = 0 then/* 高温补助没有打勾场合，该主表单号的工资单的高温补助全部清零*/\r\n		update SKT14 set /*工资明细表*/\r\n		SKF381 = 0 -- 高温津贴\r\n		where SKF415 = gzdh; -- 工资主表单号\r\n	else\r\n		update SKT14 set /*工资明细表*/\r\n		SKF381 = SKF381 * SKF923/*工资系数*/ -- 高温津贴\r\n		where SKF415 = gzdh; -- 工资主表单号\r\n	end if;\r\n\r\n	IF t_error = 1 THEN\r\n			ROLLBACK;\r\n	ELSE\r\n			COMMIT;\r\n	END IF;\r\n\r\nEND;','',2,'2018-11-28 15:23:52',NULL,0,'1970-01-01 00:00:00',0,0,0,NULL,0,NULL),(77,'SK_PRO_77','46、计算工资','CREATE PROCEDURE proc_updateJiSuanGongZi(in GongZi_id varchar(255),in cqts DECIMAL(12,1), in kssj datetime, in jssj datetime)\r\nBEGIN\r\n	DECLARE gsde DECIMAL(12,2); /*个税定额*/\r\n\r\n	DECLARE not_found INT DEFAULT 0;\r\n	DECLARE t_error int DEFAULT 0;\r\n	DECLARE CONTINUE HANDLER FOR SQLEXCEPTION SET t_error=1;\r\n	START TRANSACTION;\r\n\r\n	/*实际出勤小时*/\r\n	update SKT14/*工资明细表*/ set SKF358/*实际出勤小时*/ = (cqts/*出勤天数*/ - SKF914/*事假缺勤天数*/ - SKF915/*病假天数*/) * 8 where SKF415/*工资主表单号*/ = GongZi_id;\r\n\r\n	/*扣除工数*/\r\n	update SKT14/*工资明细表*/ set SKF369/*扣除工数*/ = SKF914/*事假缺勤天数*/ + SKF915/*病假天数*/ where SKF415/*工资主表单号*/ = GongZi_id;\r\n\r\n	/*更新中夜班次数*/\r\n	update SKT14/*工资明细表*/ set SKT14.SKF959/*中班次数*/ = 0, SKT14.SKF960/*夜班次数*/ = 0 where SKF415/*工资主表单号*/ = GongZi_id;\r\n	update SKT14/*工资明细表*/, (	select SKF572/*工号*/ as gh, sum(SKF578)/*中班次数*/ as zbcs, sum(SKF579)/*夜班次数*/ as ybcs \r\n							from SKT28/*中夜班补贴申请子表*/ \r\n							where kssj <= SKF1028 \r\n							and SKF1028 <= jssj \r\n							and SKF1029 = 1\r\n							group by SKF572/*工号*/ ) as t1 set \r\n	SKT14.SKF959/*中班次数*/ = t1.zbcs/*中班次数*/, \r\n	SKT14.SKF960/*夜班次数*/ = t1.ybcs/*夜班次数*/ \r\n	where SKT14.SKF350/*工号*/ = t1.gh/*工号*/\r\n	and SKT14.SKF415/*工资主表单号*/ = GongZi_id;\r\n\r\n	/*中夜班费*/\r\n	update SKT14/*工资明细表*/, SKT60/*中夜班费表*/ set \r\n	SKT14.SKF363/*中班费*/ = SKT14.SKF959/*中班次数*/ * SKT60.SKF951/*中班费*/,\r\n	SKT14.SKF364/*夜班费*/ = SKT14.SKF960/*夜班次数*/ * SKT60.SKF952/*夜班费*/\r\n	where SKT14.SKF415/*工资主表单号*/ = GongZi_id\r\n	and SKT60.SKF950/*ID*/ = 1;\r\n\r\n	/*月薪资 = 基本工资 + 考评工资 + 中班费 + 夜班费 + 其他补贴 + 保密津贴 + 伙食贴 + 月车费 + 岗贴 + 技贴 + 个人安全 + 团体安全 + 五S + \r\n	生育奖 + 社保补贴 + 高温津贴*/\r\n	update SKT14/*工资明细表*/ set SKF928/*月薪资*/ = \r\n	SKF361/*基本工资*/ + \r\n	SKF362/*考评工资*/ + \r\n	SKF363/*中班费*/ + \r\n	SKF364/*夜班费*/ + \r\n	SKF368/*其他补贴*/ + \r\n	SKF371/*保密津贴*/ + \r\n	SKF372/*伙食贴*/ + \r\n	SKF373/*月车费*/ + \r\n	SKF374/*岗贴*/ + \r\n	SKF375/*技贴*/ + \r\n	SKF376/*个人安全*/ + \r\n	SKF377/*团体安全*/ + \r\n	SKF378/*五S*/ + \r\n	SKF379/*生育奖*/ + \r\n	SKF380/*社保补贴*/ + \r\n	SKF381/*高温津贴*/ \r\n	where SKF415/*工资主表单号*/ = GongZi_id;\r\n\r\n	update SKT14/*工资明细表*/ set SKF929/*病假基本工资*/ = SKF928/*月薪资*/ * SKT14.SKF924/*工龄系数*/ where SKF415/*工资主表单号*/ = GongZi_id;\r\n\r\n	update SKT14/*工资明细表*/ set SKF930/*事假扣除*/ = SKF928/*月薪资*/ / 21.75 * SKF914/*事假缺勤天数*/ where SKF415/*工资主表单号*/ = GongZi_id;\r\n	update SKT14/*工资明细表*/ set SKF931/*病假扣除*/ = SKF929/*病假基本工资*/ / 21.75 * SKF915/*病假天数*/ where SKF415/*工资主表单号*/ = GongZi_id;\r\n	/*扣除工资 = 事假扣除 + 病假扣除*/\r\n	update SKT14/*工资明细表*/ set SKF370/*扣除工资*/ = SKF930/*事假扣除*/ + SKF931/*病假扣除*/ where SKF415/*工资主表单号*/ = GongZi_id;\r\n\r\n	update SKT14/*工资明细表*/ set SKF926/*薪资*/ = SKF928/*月薪资*/ - SKF930/*事假扣除*/ - SKF931/*病假扣除*/ where SKF415/*工资主表单号*/ = GongZi_id;\r\n\r\n	update SKT14/*工资明细表*/ set SKF366/*加班工资*/ = SKF928/*月薪资*/ / 174 * SKF357/*加班小时合计*/ where SKF415/*工资主表单号*/ = GongZi_id;\r\n	update SKT14/*工资明细表*/ set SKF368/*其他补贴*/ = SKF928/*月薪资*/ / 174 * SKF356/*用餐小时合计*/ where SKF415/*工资主表单号*/ = GongZi_id;\r\n\r\n	/* 加班统计用  开始 */\r\n	update SKT14/*工资明细表*/ set SKF932/*平时加班工资*/ = SKF928/*月薪资*/ / 174 * SKF530/*加班小时1点5倍*/ * 1.5 where SKF415/*工资主表单号*/ = GongZi_id;\r\n	update SKT14/*工资明细表*/ set SKF933/*双休加班工资*/ = SKF928/*月薪资*/ / 174 * SKF531/*加班小时2倍*/ * 2 where SKF415/*工资主表单号*/ = GongZi_id;\r\n	update SKT14/*工资明细表*/ set SKF934/*国定假加班工资*/ = SKF928/*月薪资*/ / 174 * SKF532/*加班小时3倍*/ * 3 where SKF415/*工资主表单号*/ = GongZi_id;\r\n	update SKT14/*工资明细表*/ set SKF935/*平时用餐补贴*/ = SKF928/*月薪资*/ / 174 * SKF919/*用餐小时1点5倍*/ * 1.5 where SKF415/*工资主表单号*/ = GongZi_id;\r\n	update SKT14/*工资明细表*/ set SKF937/*双休用餐补贴*/ = SKF928/*月薪资*/ / 174 * SKF920/*用餐小时2倍*/ * 2 where SKF415/*工资主表单号*/ = GongZi_id;\r\n	update SKT14/*工资明细表*/ set SKF938/*国定假用餐补贴*/ = SKF928/*月薪资*/ / 174 * SKF921/*用餐小时3倍*/ * 3 where SKF415/*工资主表单号*/ = GongZi_id;\r\n\r\n	update SKT14/*工资明细表*/ set SKF939/*加班用餐小时合计*/ = SKF357/*加班小时合计*/ + SKF356/*用餐休息小时*/ where SKF415/*工资主表单号*/ = GongZi_id;\r\n	update SKT14/*工资明细表*/ set SKF940/*加班用餐工资合计*/ = \r\n	SKF932/*平时加班工资*/ + SKF933/*双休加班工资*/ + SKF934/*国定假加班工资*/ + SKF935/*平时用餐补贴*/ + SKF937/*双休用餐补贴*/ + SKF938/*国定假用餐补贴*/\r\n	where SKF415/*工资主表单号*/ = GongZi_id;\r\n	/* 加班统计用  结束 */\r\n\r\n	update SKT14/*工资明细表*/ set SKF382/*应发工资*/ = SKF926/*薪资*/ + SKF366/*加班工资*/ + SKF368/*其他补贴*/ where SKF415/*工资主表单号*/ = GongZi_id;\r\n\r\n	/*税前工资 = 应发工资 - 个人缴纳待业保险 - 个人缴纳医疗保险 - 个人缴纳养老金 - 个人缴纳公积金 - 个人缴纳工会费*/\r\n	update SKT14/*工资明细表*/ set SKF936/*税前工资*/ = \r\n	SKF382/*应发工资*/ - \r\n	SKF383/*个人缴纳待业保险*/ - \r\n	SKF384/*个人缴纳医疗保险*/ - \r\n	SKF385/*个人缴纳养老金*/ - \r\n	SKF386/*个人缴纳公积金*/ - \r\n	SKF387/*个人缴纳工会费*/ \r\n	where SKF415/*工资主表单号*/ = GongZi_id;\r\n\r\n	select SKF630/*个税定额*/ into gsde from SKT35/*yw_个税定额表*/ limit 1;/*先取得个税定额*/\r\n	/*个调税*/\r\n	update SKT14/*工资明细表*/ set SKF927/*应计税额*/ = SKF936/*税前工资*/ - gsde/*个税定额*/ where SKF415/*工资主表单号*/ = GongZi_id;\r\n	update SKT14/*工资明细表*/ set SKF927/*应计税额*/ = 0 where SKF927/*应计税额*/ <= 0 and SKF415/*工资主表单号*/ = GongZi_id;\r\n	update SKT14/*工资明细表*/ set SKF388/*个调税*/ = SKF927/*应计税额*/ * 0.03 where SKF927/*应计税额*/ > 0 and SKF927/*应计税额*/ <= 3000 and SKF415/*工资主表单号*/ = GongZi_id;\r\n	update SKT14/*工资明细表*/ set SKF388/*个调税*/ = SKF927/*应计税额*/ * 0.1 - 210 where SKF927/*应计税额*/ > 3000 and SKF927/*应计税额*/ <= 12000 and SKF415/*工资主表单号*/ = GongZi_id;\r\n	update SKT14/*工资明细表*/ set SKF388/*个调税*/ = SKF927/*应计税额*/ * 0.2 - 1410 where SKF927/*应计税额*/ > 12000 and SKF927/*应计税额*/ <= 25000 and SKF415/*工资主表单号*/ = GongZi_id;\r\n	update SKT14/*工资明细表*/ set SKF388/*个调税*/ = SKF927/*应计税额*/ * 0.25 - 2660 where SKF927/*应计税额*/ > 25000 and SKF927/*应计税额*/ <= 35000 and SKF415/*工资主表单号*/ = GongZi_id;\r\n	update SKT14/*工资明细表*/ set SKF388/*个调税*/ = SKF927/*应计税额*/ * 0.3 - 4410 where SKF927/*应计税额*/ > 35000 and SKF927/*应计税额*/ <= 55000 and SKF415/*工资主表单号*/ = GongZi_id;\r\n	update SKT14/*工资明细表*/ set SKF388/*个调税*/ = SKF927/*应计税额*/ * 0.35 - 7160 where SKF927/*应计税额*/ > 55000 and SKF927/*应计税额*/ <= 80000 and SKF415/*工资主表单号*/ = GongZi_id;\r\n	update SKT14/*工资明细表*/ set SKF388/*个调税*/ = SKF927/*应计税额*/ * 0.45 - 15160 where SKF927/*应计税额*/ > 80000 and SKF415/*工资主表单号*/ = GongZi_id;\r\n\r\n	/*实发工资*/\r\n	update SKT14/*工资明细表*/ set SKF389/*实发工资*/ = SKF936/*税前工资*/ - SKF388/*个调税*/ where SKF415/*工资主表单号*/ = GongZi_id;\r\n\r\n	update SKT14/*工资明细表*/ set SKF941/*公司付出合计*/ = \r\n	SKF389/*实发工资*/ + \r\n	SKF390/*公司缴纳公积金*/ + \r\n	SKF391/*公司缴纳养老金*/ + \r\n	SKF392/*公司缴纳医疗保险*/ + \r\n	SKF393/*公司缴纳待业保险*/ + \r\n	SKF394/*公司缴纳生育保险*/ + \r\n	SKF395/*公司缴纳工伤保险*/\r\n	where SKF415/*工资主表单号*/ = GongZi_id;\r\n\r\n	IF t_error = 1 THEN\r\n			ROLLBACK;\r\n	ELSE\r\n			COMMIT;\r\n	END IF;\r\n\r\nEND;','',2,'2018-11-28 15:23:52',NULL,0,'1970-01-01 00:00:00',0,0,0,NULL,0,NULL),(79,'SK_PRO_79','47、工资合计','CREATE PROCEDURE proc_updateGongZiHeJi(in gzdh varchar(255))\r\nBEGIN\r\n	DECLARE gzhj DECIMAL(12,2); \r\n\r\n	DECLARE not_found INT DEFAULT 0;\r\n	DECLARE t_error int DEFAULT 0;\r\n	DECLARE CONTINUE HANDLER FOR SQLEXCEPTION SET t_error=1;\r\n	START TRANSACTION;\r\n\r\n	select sum(SKF389)/*实发工资合计*/ into gzhj from SKT14/*工资明细表*/ where SKF415/*工资主表单号*/=gzdh;\r\n	update SKT15/*工资主表*/ set SKF405/*实发工资合计*/ = gzhj where SKF401/*工资单号*/=gzdh;\r\n\r\n	IF t_error = 1 THEN\r\n			ROLLBACK;\r\n	ELSE\r\n			COMMIT;\r\n	END IF;\r\n\r\nEND;\r\n','',2,'2018-11-28 15:23:52',NULL,0,'1970-01-01 00:00:00',0,0,0,NULL,0,NULL),(80,'SK_PRO_80','48、删除加班统计表（废弃）','CREATE PROCEDURE shanchujiabantongjibiao()\r\nBEGIN\r\n DECLARE t_error INT DEFAULT 0;\r\n DECLARE CONTINUE HANDLER FOR SQLEXCEPTION SET t_error=1;\r\n START TRANSACTION;\r\n\r\n TRUNCATE SKT13;\r\n\r\n IF t_error = 1 THEN  \r\n   ROLLBACK;  \r\n ELSE  \r\n   COMMIT;  \r\n END IF; \r\n \r\nEND;','',2,'2018-11-28 15:23:52',NULL,0,'1970-01-01 00:00:00',0,0,0,NULL,0,NULL),(83,'SK_PRO_83','49、统计加班小时（废弃）','CREATE PROCEDURE tongjijiabanxiaoshi(IN date1 datetime,in date2 datetime)\r\nBEGIN\r\n DECLARE not_found int DEFAULT 0;\r\n DECLARE GH VARCHAR(255); -- 1工号\r\n DECLARE XH INT; -- 2序号\r\n DECLARE PSJBXS DECIMAL(12,3); -- 3平时加班小时\r\n DECLARE ZMJBXS DECIMAL(12,3); -- 4周末加班小时\r\n DECLARE GDRJBXS DECIMAL(12,3); -- 5国定日加班小时\r\n DECLARE PSYCXXXX DECIMAL(12,3); -- 平时用餐休息小时\r\n DECLARE ZMYCXXXX DECIMAL(12,3); -- 周末用餐休息小时\r\n DECLARE GDRYCXXXX DECIMAL(12,3); -- 国定日用餐休息小时\r\n DECLARE t_error INT DEFAULT 0;\r\n DECLARE CONTINUE HANDLER FOR SQLEXCEPTION SET t_error=1;\r\n START TRANSACTION;\r\n\r\n	begin\r\n\r\n	DECLARE cur_1 CURSOR FOR SELECT SKF325,SKF326 FROM SKT13;\r\n	DECLARE CONTINUE HANDLER FOR NOT FOUND SET not_found=1;\r\n		open cur_1;\r\n			WHILE not_found=0 DO\r\n			FETCH cur_1 INTO XH,GH;\r\n			SELECT SUM(skf277) INTO PSJBXS FROM SKT11 where skf274>=date1 and skf274<=date2 and skf264=GH AND SKF273=\'平日\' and skf272=\'加班费\'; -- 统计平时加班小时\r\n			SELECT SUM(skf277) INTO ZMJBXS FROM SKT11 where skf274>=date1 and skf274<=date2 and skf264=GH AND SKF273=\'双休日\' and skf272=\'加班费\'; -- 统计双休日加班小时\r\n			SELECT SUM(skf277) INTO GDRJBXS FROM SKT11 where skf274>=date1 and skf274<=date2 and skf264=GH AND SKF273=\'国定日\' and skf272=\'加班费\'; -- 统计国定日加班小时\r\n			SELECT SUM(skf278) INTO PSYCXXXX FROM SKT11 where skf274>=date1 and skf274<=date2 and skf264=GH AND SKF273=\'平日\' and skf272=\'加班费\'; -- 统计平时用餐休息小时\r\n			SELECT SUM(skf278) INTO ZMYCXXXX FROM SKT11 where skf274>=date1 and skf274<=date2 and skf264=GH AND SKF273=\'双休日\' and skf272=\'加班费\'; -- 统计双休日用餐休息小时\r\n			SELECT SUM(skf278) INTO GDRYCXXXX FROM SKT11 where skf274>=date1 and skf274<=date2 and skf264=GH AND SKF273=\'国定日\' and skf272=\'加班费\'; -- 统计国定日用餐休息小时\r\n			update skt13 set skf329=PSJBXS,skf330=ZMJBXS,skf331=GDRJBXS,skf332=PSYCXXXX,skf333=ZMYCXXXX,skf334=GDRYCXXXX where skf325=XH; -- 更新加班统计表的各个加班小时\r\n			update skt13 set skf329=0 where skf329 is null;\r\n			update skt13 set skf330=0 where skf330 is null;\r\n			update skt13 set skf331=0 where skf331 is null;\r\n			update skt13 set skf332=0 where skf332 is null;\r\n			update skt13 set skf333=0 where skf333 is null;\r\n			update skt13 set skf334=0 where skf334 is null;\r\n			END WHILE;\r\n\r\n		close cur_1;\r\n	end;\r\n\r\n IF t_error = 1 THEN  \r\n   ROLLBACK;  \r\n ELSE  \r\n   COMMIT;  \r\n END IF; \r\n \r\nEND;','',2,'2018-11-28 15:23:52',NULL,0,'1970-01-01 00:00:00',0,0,0,NULL,0,NULL),(85,'SK_PRO_85','50、计算加班工资（废弃）','CREATE PROCEDURE jisuanjibangongzi()\r\nBEGIN\r\n DECLARE t_error INT DEFAULT 0;\r\n DECLARE CONTINUE HANDLER FOR SQLEXCEPTION SET t_error=1;\r\n START TRANSACTION;\r\n\r\n	update skt13 set skf335=skf329*1.5,skf336=skf330*2,skf341=skf331*3; -- 计算加班工资\r\n	update skt13 set skf342=skf332*1.5,skf343=skf333*2,skf344=skf334*3; -- 计算用餐休息工资\r\n	update skt13 set skf345=skf329+skf330+skf331,skf346=skf335+skf336+skf341,skf347=skf332+skf333+skf334，skf348=skf342+skf343+skf344; -- 统计加班工时合计，加班工资合计,用餐工时合计，用餐工资合计\r\n	update skt13 set skf584=skf345+skf347,skf585=skf346+skf348; -- 加班用餐工时，加班用餐工资（2个合计的）\r\n IF t_error = 1 THEN  \r\n   ROLLBACK;  \r\n ELSE  \r\n   COMMIT;  \r\n END IF; \r\n \r\nEND;\r\n','',2,'2018-11-28 15:23:52',NULL,0,'1970-01-01 00:00:00',0,0,0,NULL,0,NULL),(86,'SK_PRO_86','51、删除考勤统计表','CREATE PROCEDURE shanchukaoqintongjibiao()\r\nBEGIN\r\n DECLARE t_error INT DEFAULT 0;\r\n DECLARE CONTINUE HANDLER FOR SQLEXCEPTION SET t_error=1;\r\n START TRANSACTION;\r\n truncate SKT12;\r\n	\r\n IF t_error = 1 THEN  \r\n   ROLLBACK;  \r\n ELSE  \r\n   COMMIT;  \r\n END IF; \r\n \r\nEND;','',2,'2018-11-28 15:23:52',NULL,0,'1970-01-01 00:00:00',0,0,0,NULL,0,NULL),(87,'SK_PRO_87','52、统计考勤统计表','create procedure kaoqintongji(in date1 datetime,in  date2 datetime)\r\n\r\nbegin\r\nDECLARE not_found INT DEFAULT 0;\r\nDECLARE gh varchar(255);  -- 工号\r\nDECLARE KNXTS DECIMAL(12,3); -- 可年休天数\r\nDECLARE cd DECIMAL(12,3); -- 迟到\r\nDECLARE zt DECIMAL(12,3);  -- 早退\r\nDECLARE sj DECIMAL(12,3);  -- 事假\r\nDECLARE bj DECIMAL(12,3); -- 病假\r\nDECLARE gs DECIMAL(12,3);   -- 工伤\r\nDECLARE nx DECIMAL(12,3);   -- 年休\r\nDECLARE qt DECIMAL(12,3); -- 其他\r\nDECLARE hj DECIMAL(12,3);   -- 婚假\r\nDECLARE cj DECIMAL(12,3); -- 产假\r\nDeclare buruj DECIMAL(12,3); -- 哺乳假\r\nDECLARE peicj DECIMAL(12,3); -- 陪产假\r\nDECLARE sangj DECIMAL(12,3);  -- 丧假\r\nDECLARE chuc DECIMAL(12,3); -- 出差\r\nDECLARE queqfkg DECIMAL(12,3); -- 缺勤非旷工\r\nDECLARE kg DECIMAL(12,3); -- 旷工\r\n\r\nDECLARE synxts DECIMAL(12,3); -- 剩余年休天数\r\nDECLARE wc DECIMAL(12,3); -- 外出\r\nDECLARE tx DECIMAL(12,3); -- 调休\r\nDECLARE yynj DECIMAL(12,3); -- 已用年假\r\n DECLARE t_error INT DEFAULT 0;\r\n DECLARE CONTINUE HANDLER FOR SQLEXCEPTION SET t_error=1;\r\n START TRANSACTION;\r\n BEGIN\r\n\r\nDECLARE cur_1 CURSOR FOR SELECT skf285 FROM skt12;\r\nDECLARE CONTINUE HANDLER FOR NOT FOUND SET not_found=1; \r\n	OPEN cur_1;\r\n		WHILE not_found = 0 DO \r\n FETCH cur_1 INTO gh;\r\n\r\n select sum(skf168) into cd from skt6,skt5 where skf166>=date1 and skf166<=date2 and skt6.skf153=skt5.skf145 and skf159=gh; -- 迟到\r\n select sum(skf169) into zt from skt6,skt5 where skf166>=date1 and skf166<=date2 and skt6.skf153=skt5.skf145 and skf159=gh; -- 早退\r\n select sum(skf171) into kg from skt6,skt5 where skf166>=date1 and skf166<=date2 and skf159=gh and (skf164=\'旷工\' or skf165=\'旷工\'); -- 旷工\r\n\r\n select skf17 into synxts from skt1 where skf1=gh; -- 剩余年休天数\r\n\r\n select sum(skf900) into tx from skt59 where skf897>=date1 and skf897<=date2 and skf895=gh and skf908=1; -- 调休\r\n\r\n SELECT SUM(skf839) into sj FROM skt55 WHERE skf837>=date1 AND skf837<=date2 AND skf835=\'事假\'AND skf834=gh AND skf890=1; -- 事假\r\n SELECT SUM(skf839) into bj FROM skt55 WHERE skf837>=date1 AND skf837<=date2 AND skf835=\'病假\'AND skf834=gh AND skf890=1; -- 病假\r\n select sum(skf839) into gs from skt55 where skf837>=date1 and skf837<=date2 and skf835=\'工伤假\'and skf834=gh and skf890=1; -- 工伤\r\n select sum(skf839) into nx from skt55 where skf837>=date1 and skf837<=date2 and skf835=\'年假\'and skf834=gh and skf890=1;  -- 年假\r\n select sum(skf839) into qt from skt55 where skf837>=date1 and skf837<=date2 and skf835=\'其他假\'and skf834=gh and skf890=1; -- 其他\r\n select sum(skf839) into hj from skt55 where skf837>=date1 and skf837<=date2 and skf835=\'婚假\'and skf834=gh and skf890=1; -- 婚假\r\n select sum(skf839) into cj from skt55 where skf837>=date1 and skf837<=date2 and skf835=\'产假\'and skf834=gh and skf890=1; -- 产假\r\n select sum(skf839) into buruj from skt55 where skf837>=date1 and skf837<=date2 and skf835=\'哺乳假\'and skf834=gh and skf890=1; -- 哺\r\n select sum(skf839) into peicj from skt55 where skf837>=date1 and skf837<=date2 and skf835=\'陪产假\'and skf834=gh and skf890=1; -- 陪\r\n select sum(skf839) into sangj from skt55 where skf837>=date1 and skf837<=date2 and skf835=\'丧假\'and skf834=gh and skf890=1; -- 丧假 \r\n  select sum(skf839) into queqfkg from skt55 where skf837>=date1 and skf837<=date2 and (skf835=\'事假\' or\r\n										skf835=\'病假\' or\r\n										skf835=\'工伤假\' or\r\n										skf835=\'年假\' or\r\n										skf835=\'其他假\' or\r\n										skf835=\'婚假\' or\r\n										skf835=\'产假\' or\r\n										skf835=\'哺乳假\' or\r\n										skf835=\'陪产假\' or\r\n										skf835=\'丧假\') and skf834=gh and skf890=1; -- 缺勤非旷工\r\n \r\n\r\n select sum(skf852) into wc from skt56 where skf849>=date1 and skf849<=date2 and skf847=gh and skf891=1; -- 外出天数\r\n select sum(skf878) into chuc from skt58 where skf875>=date1 and skf875<=date2 and skf873=gh and skf892=1; -- 出差天数\r\n\r\n update skt12 set skf290=cd,skf291=sj,skf292=bj,skf293=gs,skf294=nx,skf295=qt,skf296=hj,skf297=cj,skf298=buruj,skf299=peicj,skf300=sangj,skf301=chuc,skf303=kg,skf304=synxts,skf305=tx,skf306=zt,skf320=wc,skf310=queqfkg where skf285=gh;\r\n update skt12 set skf302=skf310+skf303 where skf285=gh;\r\n\r\n\r\n update skt12 set skf309=(21.75-skf302)/21.75 where skf285=gh and skf302>0; -- 出勤率\r\n update skt12 set skf309=1 where skf285=gh and skf302=0 ; -- 出勤率\r\n update skt12 set skf309=0 where skf285=gh and skf302<0;\r\n		END WHILE;\r\n	CLOSE cur_1;   \r\nEND;\r\n\r\n IF t_error = 1 THEN  \r\n   ROLLBACK;  \r\n ELSE  \r\n   COMMIT;  \r\n END IF; \r\n \r\nEND;','',2,'2018-11-28 15:23:52',NULL,0,'1970-01-01 00:00:00',0,0,0,NULL,0,NULL),(88,'SK_PRO_88','53、刷新工龄','CREATE PROCEDURE proc_updateGongLing()\r\nBEGIN\r\n\r\n	DECLARE not_found INT DEFAULT 0;\r\n	DECLARE t_error int DEFAULT 0;\r\n	DECLARE CONTINUE HANDLER FOR SQLEXCEPTION SET t_error=1;\r\n	START TRANSACTION;\r\n\r\n	/*员工档案表*/\r\n	UPDATE SKT1 SET \r\n	SKF22 = TIMESTAMPDIFF(YEAR, SKF21, NOW())/*本司工龄*/\r\n	WHERE SKF29 = \'是\';\r\n\r\n	IF t_error = 1 THEN\r\n			ROLLBACK;\r\n	ELSE\r\n			COMMIT;\r\n	END IF;\r\n\r\nEND;\r\n','',2,'2018-11-28 15:23:52',NULL,3,'1970-01-01 01:00:00',1,0,0,NULL,0,NULL),(92,'SK_PRO_92','54、复制日班制排班','CREATE PROCEDURE proc_updateCopyRiBanZhiPaiBan(in pbdh varchar(255), in ksrq/*开始日期*/ date, in jsrq/*结束日期*/ date, out jlcf/*记录重复标记*/ int)\r\nBEGIN\r\n	DECLARE rq date;\r\n	DECLARE count_record1 int;/*含重复记录数*/\r\n	DECLARE count_record2 int;/*非重复记录数*/\r\n\r\n	DECLARE not_found INT DEFAULT 0;\r\n	DECLARE t_error int DEFAULT 0;\r\n	DECLARE CONTINUE HANDLER FOR SQLEXCEPTION SET t_error=1;\r\n	START TRANSACTION;\r\n\r\n	/*含重复记录数*/\r\n	SELECT COUNT(SKF495) into count_record1 FROM \r\n	(SELECT SKT21.SKF495 FROM SKT21 WHERE SKT21.SKF494 = pbdh/*排班单号*/ AND SKT21.SKF831 = ksrq/*开始日期*/) AS a;\r\n\r\n	/*非重复记录数*/\r\n	SELECT COUNT(SKF495) into count_record2 FROM \r\n	(SELECT DISTINCT SKT21.SKF495 FROM SKT21 WHERE SKT21.SKF494 = pbdh/*排班单号*/ AND SKT21.SKF831 = ksrq/*开始日期*/) AS a;\r\n\r\n	if ( count_record1 != count_record2 ) then\r\n		set jlcf = 1;/*记录重复标记*/\r\n\r\n		-- 删除排班子表\r\n		DELETE FROM SKT21 WHERE SKT21.SKF494 = pbdh;-- 排班编号\r\n	else\r\n		set jlcf = 0;/*记录重复标记*/\r\n\r\n		/*之前已批量insert含考勤开始日的排班明细，本次设定 起始日为 考勤开始日 的第二天*/\r\n		set rq = date_add(ksrq, interval 1 day);\r\n\r\n		WHILE rq <= jsrq DO \r\n			-- 生成排班明细\r\n			INSERT INTO `skt21` (-- SKT21\r\n				--  `SKF493`,-- SKF493\r\n				`SKF494`,-- SKF494\r\n				`SKF495`,-- SKF495\r\n				`SKF496`,-- SKF496\r\n				`SKF497`,-- SKF497\r\n				`SKF498`,-- SKF498\r\n				`SKF499`,-- SKF499\r\n				`SKF501`,-- SKF501\r\n				--  `SF_CREATE_USER`,-- \r\n				--  `SF_LAST_CHANGE_USER`,-- \r\n				--  `SF_CREATE_TIME`,-- \r\n				--  `SF_LAST_CHANGE_TIME`,-- \r\n				--  `MachineCode`,-- \r\n				--  `Sf_Last_Sync_TimeStamp`,-- \r\n				`SKF586`,-- SKF586\r\n				`SKF587`,-- SKF587\r\n				`SKF646`,-- SKF646\r\n				`SKF942`,-- SKF942\r\n				`SKF943`,-- SKF943\r\n				`SKF831`-- SKF831\r\n			) \r\n			( select \r\n				--  `SKF493`,-- SKF493\r\n				`SKF494`,-- SKF494\r\n				`SKF495`,-- SKF495\r\n				`SKF496`,-- SKF496\r\n				`SKF497`,-- SKF497\r\n				`SKF498`,-- SKF498\r\n				`SKF499`,-- SKF499\r\n				`SKF501`,-- SKF501\r\n				--  `SF_CREATE_USER`,-- \r\n				--  `SF_LAST_CHANGE_USER`,-- \r\n				--  `SF_CREATE_TIME`,-- \r\n				--  `SF_LAST_CHANGE_TIME`,-- \r\n				--  `MachineCode`,-- \r\n				--  `Sf_Last_Sync_TimeStamp`,-- \r\n				`SKF586`,-- SKF586\r\n				`SKF587`,-- SKF587\r\n				`SKF646`,-- SKF646\r\n				`SKF942`,-- SKF942\r\n				`SKF943`,-- SKF943\r\n				rq-- SKF831\r\n			from skt21 \r\n			where SKF494 = pbdh \r\n			and SKF831 = ksrq\r\n			);\r\n\r\n			/*出勤日期循环+1*/\r\n			set rq = date_add(rq, interval 1 day);\r\n\r\n		END WHILE;\r\n\r\n--		update SKT21 set\r\n--		skt21.SKF586 = CONCAT( skt21.SKF831, \' \', SKT21.SKF942),-- SKF586 = SKF831 + SKF942\r\n--		skt21.SKF587 = CONCAT( skt21.SKF831, \' \', SKT21.SKF943)-- SKF587 = SKF831 + SKF943\r\n--		where skt21.SKF494 = pbdh;/*排班单号*/\r\n\r\n		/*上班时分 <= SKF943 的场合，就认为是日内班。*/\r\n		update SKT21 set\r\n		skt21.SKF586 = CONCAT( skt21.SKF831, \' \', SKT21.SKF942),-- SKF586 = SKF831 + SKF942\r\n		skt21.SKF587 = CONCAT( skt21.SKF831, \' \', SKT21.SKF943)-- SKF587 = SKF831 + SKF943\r\n		where SKT21.SKF942 <= SKT21.SKF943/*上班时分 <= 下班时分*/\r\n		and skt21.SKF494 = pbdh;/*排班单号*/\r\n\r\n		/*上班时分 > SKF943 的场合，就认为是跨日夜班。*/\r\n		update SKT21 set\r\n		skt21.SKF586 = CONCAT( skt21.SKF831, \' \', SKT21.SKF942),-- SKF586 = SKF831 + SKF942\r\n		skt21.SKF587 = CONCAT( date_add(skt21.SKF831, interval 1 day), \' \', SKT21.SKF943)-- SKF587 = SKF831 + SKF943\r\n		where SKT21.SKF942 > SKT21.SKF943/*上班时分 <= 下班时分*/\r\n		and skt21.SKF494 = pbdh;/*排班单号*/\r\n\r\n	end if;\r\n\r\n	IF t_error = 1 THEN\r\n		ROLLBACK;\r\n	ELSE\r\n		COMMIT;\r\n	END IF;\r\n\r\nEND;','',2,'2018-11-28 15:23:52',NULL,0,'1970-01-01 00:00:00',0,0,0,NULL,0,NULL),(93,'SK_PRO_93','55、拆分外出明细表','CREATE PROCEDURE pro_wcrqchaif(IN WCDH VARCHAR(255),IN GH VARCHAR(255),IN KSRQ DATE,IN AM VARCHAR(255),IN JSRQ DATE,IN PM VARCHAR(255) )\r\nBEGIN\r\nDECLARE RQ DATE;\r\nDECLARE WCTS DECIMAL(12,1);\r\nDECLARE t_error INT DEFAULT 0;\r\nDECLARE CONTINUE HANDLER FOR SQLEXCEPTION SET t_error=1;\r\nSTART TRANSACTION;\r\n\r\n		SELECT KSRQ INTO RQ;\r\n		SELECT CONCAT(\'AM= \',AM);\r\n	IF KSRQ=JSRQ THEN\r\n			IF (AM =\'08:00\'and PM=\'16:00\')  THEN\r\n				INSERT INTO SKT56(SKF846,SKF847,SKF849,SKF850,SKF851,SKF852,SKF886,SKF887)\r\n						VALUES(WCDH,GH,KSRQ,CONCAT(KSRQ,\' \',AM),CONCAT(JSRQ,\' \',PM),1,AM,PM);\r\n\r\n						\r\n			ELSE\r\n					INSERT INTO SKT56(SKF846,SKF847,SKF849,SKF850,SKF851,SKF852,SKF886,SKF887)\r\n						VALUES(WCDH,GH,KSRQ,CONCAT(KSRQ,\' \',AM),CONCAT(JSRQ,\' \',PM),0.5,AM,PM);\r\n			END IF;\r\n						\r\n						\r\n\r\n	\r\n	END IF;\r\n	IF KSRQ<JSRQ THEN\r\n	\r\n			WHILE KSRQ<=JSRQ DO\r\n		INSERT INTO SKT56(SKF846,SKF847,SKF849,SKF850,SKF851,SKF852,SKF886,SKF887)\r\n				VALUES(WCDH,GH,KSRQ,CONCAT(KSRQ,\' \',\'08:00\'),CONCAT(KSRQ,\' \',\'16:00\'),1,\'8:00\',\'16:00\');\r\n			SET KSRQ=DATE_ADD(KSRQ,INTERVAL 1 DAY);\r\n			\r\n			END WHILE;\r\n	\r\n\r\n			 IF PM=\'12:00\' THEN\r\n		UPDATE SKT56 SET SKF852=0.5,SKF851=CONCAT(JSRQ,\' \',PM),SKF887=\'12:00\' WHERE SKF849=JSRQ AND SKF846=WCDH ;\r\n			END IF; \r\n						 IF AM=\'12:00\' THEN\r\n		UPDATE SKT56 SET SKF852=0.5,SKF850=CONCAT(RQ,\' \',\'12:00\') WHERE SKF846=WCDH AND SKF849=RQ;\r\n	\r\n			SELECT \'A1\';\r\n			END IF; \r\n	END IF;\r\n\r\n	-- 更新外出登记表中的外出天数\r\n	SELECT SUM(SKF852) INTO WCTS FROM SKT56 WHERE SKF846=WCDH;\r\n	update skt8 set skf983=WCTS where skf216=WCDH;\r\n\r\n	IF t_error=1 THEN\r\n			ROLLBACK;\r\n	ELSE\r\n			COMMIT;\r\n	END IF;\r\nEND;','',2,'2018-11-28 15:23:52',NULL,0,'1970-01-01 00:00:00',0,0,0,NULL,0,NULL),(94,'SK_PRO_94','56、删除外出明细表','CREATE PROCEDURE proc_shengchanwauchumingxibiao(IN ShenQingDanHao VARCHAR(255))\r\nBEGIN\r\n DECLARE t_error INT DEFAULT 0;\r\n DECLARE CONTINUE HANDLER FOR SQLEXCEPTION SET t_error=1;\r\n START TRANSACTION;\r\n\r\n--  删除外出明细表\r\nDELETE FROM SKT56 WHERE SKF846=ShenQingDanHao;\r\n\r\n IF t_error = 1 THEN  \r\n   ROLLBACK;  \r\n ELSE  \r\n   COMMIT;  \r\n END IF; \r\n \r\nEND;','',2,'2018-11-28 15:23:52',NULL,0,'1970-01-01 00:00:00',0,0,0,NULL,0,NULL),(95,'SK_PRO_95','57、复制综合制排班','CREATE PROCEDURE proc_updateCopyZongHeZhiPaiBan(in pbdh varchar(255), in ksrq/*开始日期*/ date, in jsrq/*结束日期*/ date, out jlcf/*记录重复标记*/ int)\r\nBEGIN\r\n	DECLARE rq date;\r\n	DECLARE count_record1 int;/*含重复记录数*/\r\n	DECLARE count_record2 int;/*非重复记录数*/\r\n\r\n	DECLARE not_found INT DEFAULT 0;\r\n	DECLARE t_error int DEFAULT 0;\r\n	DECLARE CONTINUE HANDLER FOR SQLEXCEPTION SET t_error=1;\r\n	START TRANSACTION;\r\n\r\n	/*含重复记录数*/\r\n	SELECT COUNT(SKF495) into count_record1 FROM \r\n	(SELECT SKT21.SKF495 FROM SKT21 WHERE SKT21.SKF494 = pbdh/*排班单号*/ AND SKT21.SKF831 = ksrq/*开始日期*/) AS a;\r\n\r\n	/*非重复记录数*/\r\n	SELECT COUNT(SKF495) into count_record2 FROM \r\n	(SELECT DISTINCT SKT21.SKF495 FROM SKT21 WHERE SKT21.SKF494 = pbdh/*排班单号*/ AND SKT21.SKF831 = ksrq/*开始日期*/) AS a;\r\n\r\n	if ( count_record1 != count_record2 ) then\r\n\r\n		set jlcf = 1;/*记录重复标记*/\r\n\r\n		-- 删除排班子表\r\n		DELETE FROM SKT21 WHERE SKT21.SKF494 = pbdh;-- 排班编号\r\n	else\r\n\r\n		set jlcf = 0;/*记录重复标记*/\r\n\r\n		/*之前已批量insert含考勤开始日的排班明细，本次设定 起始日为 考勤开始日 的第二天*/\r\n		set rq = date_add(ksrq, interval 1 day);\r\n\r\n		WHILE rq <= jsrq DO \r\n			-- 生成排班明细\r\n			INSERT INTO `skt21` (-- SKT21\r\n				--  `SKF493`,-- SKF493\r\n				`SKF494`,-- SKF494\r\n				`SKF495`,-- SKF495\r\n				`SKF496`,-- SKF496\r\n				`SKF497`,-- SKF497\r\n				`SKF498`,-- SKF498\r\n				`SKF499`,-- SKF499\r\n				`SKF501`,-- SKF501\r\n				--  `SF_CREATE_USER`,-- \r\n				--  `SF_LAST_CHANGE_USER`,-- \r\n				--  `SF_CREATE_TIME`,-- \r\n				--  `SF_LAST_CHANGE_TIME`,-- \r\n				--  `MachineCode`,-- \r\n				--  `Sf_Last_Sync_TimeStamp`,-- \r\n				`SKF586`,-- SKF586\r\n				`SKF587`,-- SKF587\r\n				`SKF646`,-- SKF646\r\n				`SKF807`,-- SKF807\r\n				`SKF808`,-- SKF808\r\n				`SKF809`,-- SKF809\r\n				`SKF810`,-- SKF810\r\n				`SKF811`,-- SKF811\r\n				`SKF812`,-- SKF812\r\n				`SKF942`,-- SKF942\r\n				`SKF943`,-- SKF943\r\n				`SKF831`-- SKF831\r\n			) \r\n			( select \r\n				--  `SKF493`,-- SKF493\r\n				`SKF494`,-- SKF494\r\n				`SKF495`,-- SKF495\r\n				`SKF496`,-- SKF496\r\n				`SKF497`,-- SKF497\r\n				`SKF498`,-- SKF498\r\n				`SKF499`,-- SKF499\r\n				`SKF501`,-- SKF501\r\n				--  `SF_CREATE_USER`,-- \r\n				--  `SF_LAST_CHANGE_USER`,-- \r\n				--  `SF_CREATE_TIME`,-- \r\n				--  `SF_LAST_CHANGE_TIME`,-- \r\n				--  `MachineCode`,-- \r\n				--  `Sf_Last_Sync_TimeStamp`,-- \r\n				`SKF586`,-- SKF586\r\n				`SKF587`,-- SKF587\r\n				`SKF646`,-- SKF646\r\n				`SKF807`,-- SKF807\r\n				`SKF808`,-- SKF808\r\n				`SKF809`,-- SKF809\r\n				`SKF810`,-- SKF810\r\n				`SKF811`,-- SKF811\r\n				`SKF812`,-- SKF812\r\n				`SKF942`,-- SKF942\r\n				`SKF943`,-- SKF943\r\n				rq-- SKF831\r\n			from skt21 \r\n			where SKF494 = pbdh \r\n			and SKF831 = ksrq\r\n			);\r\n\r\n			/*出勤日期循环+1*/\r\n			set rq = date_add(rq, interval 1 day);\r\n\r\n		END WHILE;\r\n\r\n--		update SKT20, skt21 set\r\n--		skt21.SKF586 = CONCAT( skt21.SKF831, \' \', SKT21.SKF942),-- SKF586 = SKF831 + SKF942\r\n--		skt21.SKF587 = CONCAT( skt21.SKF831, \' \', SKT21.SKF943)-- SKF587 = SKF831 + SKF943\r\n--		where skt21.SKF494 = pbdh;/*排班单号*/\r\n\r\n		/*上班时分 <= SKF943 的场合，就认为是日内班。*/\r\n		update SKT21 set\r\n		skt21.SKF586 = CONCAT( skt21.SKF831, \' \', SKT21.SKF942),-- SKF586 = SKF831 + SKF942\r\n		skt21.SKF587 = CONCAT( skt21.SKF831, \' \', SKT21.SKF943)-- SKF587 = SKF831 + SKF943\r\n		where SKT21.SKF942 <= SKT21.SKF943/*上班时分 <= 下班时分*/\r\n		and skt21.SKF494 = pbdh;/*排班单号*/\r\n\r\n		/*上班时分 > SKF943 的场合，就认为是跨日夜班。*/\r\n		update SKT21 set\r\n		skt21.SKF586 = CONCAT( skt21.SKF831, \' \', SKT21.SKF942),-- SKF586 = SKF831 + SKF942\r\n		skt21.SKF587 = CONCAT( date_add(skt21.SKF831, interval 1 day), \' \', SKT21.SKF943)-- SKF587 = SKF831 + SKF943\r\n		where SKT21.SKF942 > SKT21.SKF943/*上班时分 <= 下班时分*/\r\n		and skt21.SKF494 = pbdh;/*排班单号*/\r\n\r\n	end if;\r\n\r\n	IF t_error = 1 THEN\r\n			ROLLBACK;\r\n	ELSE\r\n			COMMIT;\r\n	END IF;\r\n\r\nEND;\r\n','',2,'2018-11-28 15:23:53',NULL,0,'1970-01-01 00:00:00',0,0,0,NULL,0,NULL),(98,'SK_PRO_98','58、拆分出差培训明细','CREATE PROCEDURE pro_chaifenchuchaipeixunmingxi(IN CCDH VARCHAR(255),IN GH VARCHAR(255),IN KSRQ DATE,IN AM VARCHAR(255),IN JSRQ DATE,IN PM VARCHAR(255) )\r\nBEGIN\r\nDECLARE RQ DATE;\r\nDECLARE CCPXTS DECIMAL(12,1);\r\nDECLARE t_error INT DEFAULT 0;\r\nDECLARE CONTINUE HANDLER FOR SQLEXCEPTION SET t_error=1;\r\nSTART TRANSACTION;\r\n\r\n		SELECT KSRQ INTO RQ;\r\n	IF KSRQ=JSRQ THEN\r\n			IF (AM =\'08:00\'and PM=\'16:00\')  THEN\r\n				INSERT INTO SKT58(SKF872,SKF873,SKF875,SKF876,SKF877,SKF878,SKF888,SKF889)\r\n						VALUES(CCDH,GH,KSRQ,CONCAT(KSRQ,\' \',AM),CONCAT(JSRQ,\' \',PM),1,AM,PM);\r\n\r\n						\r\n			ELSE\r\n					INSERT INTO SKT58(SKF872,SKF873,SKF875,SKF876,SKF877,SKF878,SKF888,SKF889)\r\n						VALUES(CCDH,GH,KSRQ,CONCAT(KSRQ,\' \',AM),CONCAT(JSRQ,\' \',PM),0.5,AM,PM);\r\n			END IF;\r\n						\r\n						\r\n\r\n	\r\n	END IF;\r\n	IF KSRQ<JSRQ THEN\r\n	\r\n			WHILE KSRQ<=JSRQ DO\r\n		INSERT INTO SKT58(SKF872,SKF873,SKF875,SKF876,SKF877,SKF878,SKF888,SKF889)\r\n				VALUES(CCDH,GH,KSRQ,CONCAT(KSRQ,\' \',\'08:00\'),CONCAT(KSRQ,\' \',\'16:00\'),1,\'8:00\',\'16:00\');\r\n			SET KSRQ=DATE_ADD(KSRQ,INTERVAL 1 DAY);\r\n			\r\n			END WHILE;\r\n			 IF AM=\'12:00\' THEN\r\n		UPDATE SKT58 SET SKF878=0.5,SKF876=CONCAT(RQ,\' \',\'12:00\') WHERE SKF872=CCDH AND SKF875=RQ;\r\n			END IF; \r\n\r\n			 IF PM=\'12:00\' THEN\r\n		UPDATE SKT58 SET SKF878=0.5,SKF877=CONCAT(JSRQ,\' \',PM),SKF889=\'12:00\' WHERE SKF875=JSRQ AND SKF872=CCDH ;\r\n			END IF; \r\n		\r\n	END IF;\r\n\r\n	-- 更新出差登记表出差天数\r\n	SELECT SUM(SKF878) INTO CCPXTS FROM SKT58 WHERE SKF872=CCDH;\r\n	UPDATE SKT41 SET SKF683=CCPXTS WHERE SKF671=CCDH;\r\n\r\n	IF t_error=1 THEN\r\n			ROLLBACK;\r\n	ELSE\r\n			COMMIT;\r\n	END IF;\r\nEND;\r\n','',2,'2018-11-28 15:23:53',NULL,0,'1970-01-01 00:00:00',0,0,0,NULL,0,NULL),(99,'SK_PRO_99','59、删除出差培训明细','CREATE PROCEDURE pro_shanchuchuchaipeixunmingxibiao(IN CCPXDH VARCHAR(255))\r\nBEGIN\r\nDECLARE t_error INT DEFAULT 0;\r\nDECLARE CONTINUE HANDLER FOR SQLEXCEPTION SET t_error=1;\r\nSTART TRANSACTION;\r\n\r\nDELETE FROM SKT58 WHERE SKF872=CCPXDH;-- 删除出差培训明细表\r\n\r\n\r\n	IF t_error=1 THEN\r\n			ROLLBACK;\r\n	ELSE\r\n			COMMIT;\r\n	END IF;\r\n\r\nEND;','',2,'2018-11-28 15:23:53',NULL,0,'1970-01-01 00:00:00',0,0,0,NULL,0,NULL),(100,'SK_PRO_100','60、拆分办公室加班天数','CREATE PROCEDURE pro_chaifenchuchaipeixunmingxi(IN BGSJBDH VARCHAR(255),IN GH VARCHAR(255),IN KSRQ DATE,IN AM VARCHAR(255),IN JSRQ DATE,IN PM VARCHAR(255) )\r\nBEGIN\r\nDECLARE RQ DATE;\r\nDECLARE BGSJBTS DECIMAL(12,1);\r\nDECLARE t_error INT DEFAULT 0;\r\nDECLARE CONTINUE HANDLER FOR SQLEXCEPTION SET t_error=1;\r\nSTART TRANSACTION;\r\n\r\n		SELECT KSRQ INTO RQ;\r\n	IF KSRQ=JSRQ THEN\r\n			IF (AM =\'08:00\'and PM=\'16:00\')  THEN\r\n				INSERT INTO SKT59(SKF894,SKF895,SKF897,SKF898,SKF899,SKF900,SKF906,SKF907)\r\n						VALUES(BGSJBDH,GH,KSRQ,CONCAT(KSRQ,\' \',AM),CONCAT(JSRQ,\' \',PM),1,AM,PM);\r\n\r\n						\r\n			ELSE\r\n					INSERT INTO SKT59(SKF894,SKF895,SKF897,SKF898,SKF899,SKF900,SKF906,SKF907)\r\n						VALUES(BGSJBDH,GH,KSRQ,CONCAT(KSRQ,\' \',AM),CONCAT(JSRQ,\' \',PM),0.5,AM,PM);\r\n			END IF;\r\n						\r\n						\r\n\r\n	\r\n	END IF;\r\n	IF KSRQ<JSRQ THEN\r\n	\r\n			WHILE KSRQ<=JSRQ DO\r\n		INSERT INTO SKT59(SKF894,SKF895,SKF897,SKF898,SKF899,SKF900,SKF906,SKF907)\r\n				VALUES(BGSJBDH,GH,KSRQ,CONCAT(KSRQ,\' \',\'08:00\'),CONCAT(KSRQ,\' \',\'16:00\'),1,\'8:00\',\'16:00\');\r\n			SET KSRQ=DATE_ADD(KSRQ,INTERVAL 1 DAY);\r\n			\r\n			END WHILE;\r\n			 IF AM=\'12:00\' THEN\r\n		UPDATE SKT59 SET SKF900=0.5,SKF898=CONCAT(RQ,\' \',\'12:00\'),SKF906=\'12:00\' WHERE SKF894=BGSJBDH AND SKF897=RQ;\r\n			END IF; \r\n\r\n			 IF PM=\'12:00\' THEN\r\n		UPDATE SKT59 SET SKF900=0.5,SKF899=CONCAT(JSRQ,\' \',PM),SKF907=\'12:00\' WHERE SKF897=JSRQ AND SKF894=BGSJBDH ;\r\n			END IF; \r\n		\r\n	END IF;\r\n		\r\n		-- 更新办公室加班天数\r\n		SELECT SUM(SKF900) INTO BGSJBTS FROM SKT59 WHERE SKF894=BGSJBDH;\r\n		UPDATE SKT11 SET SKF782=BGSJBTS WHERE SKF263=BGSJBDH;\r\n	IF t_error=1 THEN\r\n			ROLLBACK;\r\n	ELSE\r\n			COMMIT;\r\n	END IF;\r\nEND;','',2,'2018-11-28 15:23:53',NULL,0,'1970-01-01 00:00:00',0,0,0,NULL,0,NULL),(101,'SK_PRO_101','61、删除办公室加班明细天数','CREATE PROCEDURE pro_shanchuchuchaipeixunmingxibiao(IN BGSJBDH VARCHAR(255))\r\nBEGIN\r\nDECLARE t_error INT DEFAULT 0;\r\nDECLARE CONTINUE HANDLER FOR SQLEXCEPTION SET t_error=1;\r\nSTART TRANSACTION;\r\n\r\nDELETE FROM SKT59 WHERE SKF894=BGSJBDH;-- 删除出差培训明细表\r\n\r\n\r\n	IF t_error=1 THEN\r\n			ROLLBACK;\r\n	ELSE\r\n			COMMIT;\r\n	END IF;\r\n\r\nEND;','',2,'2018-11-28 15:23:53',NULL,0,'1970-01-01 00:00:00',0,0,0,NULL,0,NULL),(103,'SK_PRO_103','62、拆分请假单明细表','CREATE PROCEDURE proc_updateCopyQingJiaDanMingXiBiao(in dh varchar(255)\r\n-- , in gh varchar(255), in ksrq/*开始日*/ date, in kssj/*开始时间*/ varchar(255), in jsrq/*结束日*/ date, in jssj varchar(255)/*结束时间*/\r\n)\r\nBEGIN\r\n	DECLARE rq date;/*开始日*/\r\n	DECLARE gh varchar(255);/*工号*/\r\n	DECLARE qjlb varchar(255);/*请假类别*/\r\n	DECLARE ksrq date;/*开始日*/\r\n	DECLARE kssj varchar(255);/*开始时间*/\r\n	DECLARE jsrq date;/*结束日*/\r\n	DECLARE jssj varchar(255);/*结束时间*/\r\n\r\n	DECLARE not_found INT DEFAULT 0;\r\n	DECLARE t_error int DEFAULT 0;\r\n	DECLARE CONTINUE HANDLER FOR SQLEXCEPTION SET t_error=1;\r\n	START TRANSACTION;\r\n\r\n	delete from SKT55/*请假单明细表*/\r\n	where SKF833/*请假单号*/ = dh;\r\n\r\n	/*从 请假单主表 获取待拆分的数据*/\r\n	-- SELECT ksrq INTO rq;\r\n	select \r\n	  SKF206,/*请假开始日*/\r\n--	  `SKF200`,/*请假单号*/\r\n	  SKF201,/*工号*/\r\n--	  `SKF202`,/*姓名*/\r\n--	  `SKF203`,/*部门*/\r\n--	  `SKF204`,/*班组*/\r\n--	  `SKF205`,/*岗位*/\r\n	  SKF209,/*请假类别*/\r\n	  SKF206,/*请假开始日*/\r\n	  SKF961,/*开始时分*/\r\n	  SKF207,/*请假结束日*/\r\n	  SKF962 /*结束时分*/\r\n--	  `SKF208`,/*请假天数*/\r\n--	  `SKF210`,/*请假事由*/\r\n--	  `SKF215`,/*填表日期*/\r\n--	  `SKF784`,/*是否确认*/\r\n	into rq, gh, qjlb, ksrq, kssj, jsrq, jssj\r\n	from skt7\r\n	where SKF200 = dh;\r\n\r\n	/*工伤假、产假、婚假、丧假、哺乳假、陪产假、其他假的场合，休假算自然日（含国定休日和国定假日）。*/\r\n	IF qjlb != \'年假\' and qjlb != \'调休\' and qjlb != \'事假\' and qjlb != \'病假\' then \r\n		/*开始日 = 结束日 的场合*/\r\n		IF ksrq = jsrq THEN\r\n\r\n			/*开始时间 = 结束时间 的场合，分拆一条 1天的请假单明细*/\r\n			IF (kssj = \'08:00\' and jssj = \'16:00\') THEN\r\n\r\n				INSERT INTO SKT55/*请假单明细表*/(\r\n					SKF833/*请假单号*/,\r\n					SKF834/*工号*/,\r\n					SKF835/*请假类别*/,\r\n					SKF836/*请假日期*/,\r\n					SKF837/*请假开始时间*/,\r\n					SKF838/*请假结束时间*/,\r\n					SKF839/*请假天数*/,\r\n					SKF884/*请假开始时分*/,\r\n					SKF885/*请假结束时分*/\r\n					)\r\n				(\r\n					select\r\n					SKF200,/*请假单号*/\r\n					SKF201,/*工号*/\r\n					SKF209,/*请假类别*/\r\n					SKF206,/*请假开始日*/\r\n					concat(SKF206/*请假开始日*/, \' \', SKF961/*开始时分*/),\r\n					concat(SKF207/*请假结束日*/, \' \', SKF962/*结束时分*/),\r\n					1,\r\n					SKF961/*开始时分*/,\r\n					SKF962/*结束时分*/\r\n					from SKT7\r\n					where SKF200 = dh/*请假单号*/\r\n				);\r\n\r\n			ELSE\r\n\r\n				/*否则，分拆一条 0.5天的请假单明细*/\r\n				INSERT INTO SKT55/*请假单明细表*/(\r\n					SKF833/*请假单号*/,\r\n					SKF834/*工号*/,\r\n					SKF835/*请假类别*/,\r\n					SKF836/*请假日期*/,\r\n					SKF837/*请假开始时间*/,\r\n					SKF838/*请假结束时间*/,\r\n					SKF839/*请假天数*/,\r\n					SKF884/*请假开始时分*/,\r\n					SKF885/*请假结束时分*/\r\n					)\r\n				(\r\n					select\r\n					SKF200,/*请假单号*/\r\n					SKF201,/*工号*/\r\n					SKF209,/*请假类别*/\r\n					SKF206,/*请假开始日*/\r\n					concat(SKF206/*请假开始日*/, \' \', SKF961/*开始时分*/),\r\n					concat(SKF207/*请假结束日*/, \' \', SKF962/*结束时分*/),\r\n					0.5,\r\n					SKF961/*开始时分*/,\r\n					SKF962/*结束时分*/\r\n					from SKT7\r\n					where SKF200 = dh/*请假单号*/\r\n				);\r\n\r\n			END IF;\r\n\r\n		END IF;\r\n\r\n		/*开始日 < 结束日 的场合，分拆请假单明细*/\r\n		IF ksrq < jsrq THEN\r\n\r\n			WHILE ksrq <= jsrq DO\r\n\r\n				INSERT INTO SKT55/*请假单明细表*/(\r\n					SKF833/*请假单号*/,\r\n					SKF834/*工号*/,\r\n					SKF835/*请假类别*/,\r\n					SKF836/*请假日期*/,\r\n					SKF837/*请假开始时间*/,\r\n					SKF838/*请假结束时间*/,\r\n					SKF839/*请假天数*/,\r\n					SKF884/*请假开始时分*/,\r\n					SKF885/*请假结束时分*/\r\n					)\r\n				(\r\n					select\r\n					SKF200,/*请假单号*/\r\n					SKF201,/*工号*/\r\n					SKF209,/*请假类别*/\r\n					ksrq,/*请假日期*/\r\n					concat(ksrq/*请假开始日*/, \' \', \'08:00\'/*开始时分*/),\r\n					concat(ksrq/*请假结束日*/, \' \', \'16:00\'/*结束时分*/),\r\n					1,\r\n					\'08:00\'/*开始时分*/,\r\n					\'16:00\'/*结束时分*/\r\n					from SKT7\r\n					where SKF200 = dh/*请假单号*/\r\n				);\r\n\r\n				SET ksrq = DATE_ADD(ksrq, INTERVAL 1 DAY);\r\n\r\n			END WHILE;\r\n\r\n		END IF;\r\n\r\n	ELSE/*年假、调休、事假、病假的场合，休假算工作日（不含国定休日和国定假日）。*/\r\n\r\n		/*开始日 = 结束日 的场合*/\r\n		IF ksrq = jsrq THEN\r\n\r\n			/*开始时间 = 结束时间 的场合，分拆一条 1天的请假单明细*/\r\n			IF (kssj = \'08:00\' and jssj = \'16:00\') THEN\r\n\r\n				INSERT INTO SKT55/*请假单明细表*/(\r\n					SKF833/*请假单号*/,\r\n					SKF834/*工号*/,\r\n					SKF835/*请假类别*/,\r\n					SKF836/*请假日期*/,\r\n					SKF837/*请假开始时间*/,\r\n					SKF838/*请假结束时间*/,\r\n					SKF839/*请假天数*/,\r\n					SKF884/*请假开始时分*/,\r\n					SKF885/*请假结束时分*/\r\n					)\r\n				(\r\n					select\r\n					SKF200,/*请假单号*/\r\n					SKF201,/*工号*/\r\n					SKF209,/*请假类别*/\r\n					SKF206,/*请假开始日*/\r\n					concat(SKF206/*请假开始日*/, \' \', SKF961/*开始时分*/),\r\n					concat(SKF207/*请假结束日*/, \' \', SKF962/*结束时分*/),\r\n					1,\r\n					SKF961/*开始时分*/,\r\n					SKF962/*结束时分*/\r\n					from SKT7\r\n					where SKF200 = dh/*请假单号*/\r\n					AND SKF206 NOT IN (SELECT SKF975 FROM SKT62 WHERE SKF975 = SKF206)/*请假日 不是国定休日、不是国定假日*/\r\n--					(SELECT SKF975 FROM SKT62 WHERE DATE_FORMAT(SKF975, \'%Y\') = NianFen);\r\n				);\r\n\r\n			ELSE\r\n\r\n				/*否则，分拆一条 0.5天的请假单明细*/\r\n				INSERT INTO SKT55/*请假单明细表*/(\r\n					SKF833/*请假单号*/,\r\n					SKF834/*工号*/,\r\n					SKF835/*请假类别*/,\r\n					SKF836/*请假日期*/,\r\n					SKF837/*请假开始时间*/,\r\n					SKF838/*请假结束时间*/,\r\n					SKF839/*请假天数*/,\r\n					SKF884/*请假开始时分*/,\r\n					SKF885/*请假结束时分*/\r\n					)\r\n				(\r\n					select\r\n					SKF200,/*请假单号*/\r\n					SKF201,/*工号*/\r\n					SKF209,/*请假类别*/\r\n					SKF206,/*请假开始日*/\r\n					concat(SKF206/*请假开始日*/, \' \', SKF961/*开始时分*/),\r\n					concat(SKF207/*请假结束日*/, \' \', SKF962/*结束时分*/),\r\n					0.5,\r\n					SKF961/*开始时分*/,\r\n					SKF962/*结束时分*/\r\n					from SKT7\r\n					where SKF200 = dh/*请假单号*/\r\n					AND SKF206 NOT IN (SELECT SKF975 FROM SKT62 WHERE SKF975 = SKF206)/*请假日 不是国定休日、不是国定假日*/\r\n				);\r\n\r\n			END IF;\r\n\r\n		END IF;\r\n\r\n		/*开始日 < 结束日 的场合，分拆请假单明细*/\r\n		IF ksrq < jsrq THEN\r\n\r\n			WHILE ksrq <= jsrq DO\r\n\r\n				INSERT INTO SKT55/*请假单明细表*/(\r\n					SKF833/*请假单号*/,\r\n					SKF834/*工号*/,\r\n					SKF835/*请假类别*/,\r\n					SKF836/*请假日期*/,\r\n					SKF837/*请假开始时间*/,\r\n					SKF838/*请假结束时间*/,\r\n					SKF839/*请假天数*/,\r\n					SKF884/*请假开始时分*/,\r\n					SKF885/*请假结束时分*/\r\n					)\r\n				(\r\n					select\r\n					SKF200,/*请假单号*/\r\n					SKF201,/*工号*/\r\n					SKF209,/*请假类别*/\r\n					ksrq,/*请假日期*/\r\n					concat(ksrq/*请假开始日*/, \' \', \'08:00\'/*开始时分*/),\r\n					concat(ksrq/*请假结束日*/, \' \', \'16:00\'/*结束时分*/),\r\n					1,\r\n					\'08:00\'/*开始时分*/,\r\n					\'16:00\'/*结束时分*/\r\n					from SKT7\r\n					where SKF200 = dh/*请假单号*/\r\n					AND ksrq NOT IN (SELECT SKF975 FROM SKT62 WHERE SKF975 = ksrq)/*请假日 不是国定休日、不是国定假日*/\r\n				);\r\n\r\n				SET ksrq = DATE_ADD(ksrq, INTERVAL 1 DAY);\r\n\r\n			END WHILE;\r\n\r\n		END IF;\r\n\r\n	END IF;\r\n\r\n	/*开始时间 = \'12:00\' 的场合，开始日设为 0.5 天。*/\r\n	IF kssj = \'12:00\' THEN\r\n\r\n		UPDATE SKT55/*请假单明细表*/ SET \r\n		SKF839/*请假天数*/ = 0.5, \r\n		SKF837/*请假开始时间*/ = CONCAT(rq, \' \', kssj), \r\n		SKF884/*请假开始时分*/ = \'12:00\' \r\n		WHERE SKF833/*请假单号*/ = dh \r\n		AND SKF836/*请假日期*/ = rq;\r\n\r\n	END IF; \r\n\r\n	/*结束时间 = \'12:00\' 的场合，结束日设为 1 天。*/\r\n	IF jssj = \'12:00\' THEN\r\n\r\n		UPDATE SKT55/*请假单明细表*/ SET \r\n		SKF839/*请假天数*/ = 0.5, \r\n		SKF838/*请假结束时间*/ = CONCAT(jsrq, \' \', jssj), \r\n		SKF885/*请假结束时分*/ = \'12:00\' \r\n		WHERE SKF833/*请假单号*/ = dh \r\n		AND SKF836/*请假日期*/ = jsrq ;\r\n\r\n	END IF;\r\n\r\n	/*统计该请假单的 请假天数*/\r\n	update SKT7/*请假单表*/ set SKF208/*请假天数*/ = (\r\n		select sum(SKF839/*请假天数*/) from SKT55/*请假单明细表*/\r\n		where SKF833/*请假单号*/ = dh\r\n	)\r\n	where SKF200/*请假单号*/ = dh;\r\n\r\n	IF t_error = 1 THEN\r\n		ROLLBACK;\r\n	ELSE\r\n		COMMIT;\r\n	END IF;\r\n\r\nEND;','',2,'2018-11-28 15:23:53',NULL,0,'1970-01-01 00:00:00',0,0,0,NULL,0,NULL),(104,'SK_PRO_104','63、拆分双休节假日表','CREATE PROCEDURE proc_updateCopyShuangXiuJieJiaRi(in NianFen varchar(255))\r\nBEGIN\r\n	DECLARE rq date;/*开始日*/\r\n	DECLARE ksrq date;/*开始日*/\r\n	DECLARE jsrq date;/*结束日*/\r\n\r\n	DECLARE not_found INT DEFAULT 0;\r\n	DECLARE t_error int DEFAULT 0;\r\n	DECLARE CONTINUE HANDLER FOR SQLEXCEPTION SET t_error=1;\r\n	START TRANSACTION;\r\n\r\n	set ksrq = CONCAT(NianFen, \'-\', \'01-01\');\r\n	set jsrq = CONCAT(NianFen, \'-\', \'12-31\');\r\n\r\nselect concat(\'ksrq->\', ksrq);\r\nselect concat(\'jsrq->\', jsrq);\r\n\r\n	WHILE ksrq <= jsrq DO\r\n\r\n		if DAYOFWEEK(ksrq) = 7 then -- 星期六\r\n\r\n			DELETE \r\n			FROM\r\n			  `skt62` \r\n			WHERE `SKF975` = ksrq ;\r\n\r\n			INSERT INTO `skt62` (\r\n--			  `SKF969`,/*序号*/\r\n			  `SKF970`,/*双休节假日名称*/\r\n			  `SKF975`/*双休节假日*/\r\n			) \r\n			VALUES\r\n			  (\r\n--			    \'SKF969\',/*序号*/\r\n			    \'星期六\',/*双休节假日名称*/\r\n			    ksrq/*双休节假日*/\r\n			  ) ;\r\n\r\n		end if;\r\n\r\n		if DAYOFWEEK(ksrq) = 1 then -- 星期日\r\n\r\n			DELETE \r\n			FROM\r\n			  `skt62` \r\n			WHERE `SKF975` = ksrq ;\r\n\r\n			INSERT INTO `skt62` (\r\n--			  `SKF969`,/*序号*/\r\n			  `SKF970`,/*双休节假日名称*/\r\n			  `SKF975`/*双休节假日*/\r\n			) \r\n			VALUES\r\n			  (\r\n--			    \'SKF969\',/*序号*/\r\n			    \'星期日\',/*双休节假日名称*/\r\n			    ksrq/*双休节假日*/\r\n			  ) ;\r\n\r\n		end if;\r\n\r\n		SET ksrq = DATE_ADD(ksrq, INTERVAL 1 DAY);\r\n\r\n	END WHILE;\r\n\r\n	IF t_error = 1 THEN\r\n		ROLLBACK;\r\n	ELSE\r\n		COMMIT;\r\n	END IF;\r\n\r\nEND;\r\n','',2,'2018-11-28 15:23:53',NULL,0,'1970-01-01 00:00:00',0,0,0,NULL,0,NULL),(107,'SK_PRO_107','64、删除在职员工','CREATE PROCEDURE pro_shanchuzaizhiyuangong(IN GH VARCHAR(255))\r\nBEGIN\r\n	DECLARE t_error int DEFAULT 0;\r\n	DECLARE CONTINUE HANDLER FOR SQLEXCEPTION SET t_error=1;\r\n	START TRANSACTION;\r\n\r\n	DELETE FROM SKT1 WHERE SKF1 = GH; -- 删除员工\r\n\r\n	IF t_error = 1 THEN\r\n		ROLLBACK;\r\n	ELSE\r\n		COMMIT;\r\n	END IF;\r\n\r\nEND;\r\n','',2,'2018-11-28 15:23:53',NULL,0,'1970-01-01 00:00:00',0,0,0,NULL,0,NULL),(108,'SK_PRO_108','65、删除离职员工','CREATE PROCEDURE pro_shanchulizhiyuangong(IN GH VARCHAR(255))\r\nBEGIN\r\n	DECLARE t_error int DEFAULT 0;\r\n	DECLARE CONTINUE HANDLER FOR SQLEXCEPTION SET t_error=1;\r\n	START TRANSACTION;\r\n\r\n	DELETE FROM SKT3 WHERE SKF113=GH; -- 删除离职员工\r\n\r\n	IF t_error = 1 THEN\r\n		ROLLBACK;\r\n	ELSE\r\n		COMMIT;\r\n	END IF;\r\nEND;\r\n','',2,'2018-11-28 15:23:53',NULL,0,'1970-01-01 00:00:00',0,0,0,NULL,0,NULL),(112,'SK_PRO_112','66、计算实发年度绩效奖金','CREATE PROCEDURE proc_shifaniandujixiaojiangjin(in NDJXZBDH varchar(255))\r\nBEGIN\r\n	DECLARE gsde DECIMAL(12,2); /*个税定额*/\r\n\r\n	DECLARE t_error int DEFAULT 0;\r\n	DECLARE CONTINUE HANDLER FOR SQLEXCEPTION SET t_error=1;\r\n	START TRANSACTION;\r\n	\r\n\r\n	SELECT SKF630 INTO gsde FROM skt35; -- 取得个税定额\r\n	\r\n	UPDATE SKT66 SET skf1027=skf1020 - gsde WHERE skf1004=NDJXZBDH; -- 应计税额\r\n	\r\n	UPDATE SKT66 SET SKF1027=0,SKF1021=0,SKF1022=SKF1020 WHERE SKF1027<=0 AND SKF1004=NDJXZBDH; -- 应计税额小于0，值为零\r\n	\r\n	UPDATE SKT66 SET SKF1021=SKF1027 * 0.03 WHERE SKF1027>0 AND SKF1027<=3000 AND SKF1004=NDJXZBDH; -- 税额划分\r\n	\r\n	UPDATE SKT66 SET SKF1021=SKF1027 * 0.1 - 210  WHERE SKF1027>3000 AND SKF1027<=12000 AND SKF1004=NDJXZBDH; -- 税额划分\r\n	\r\n	UPDATE SKT66 SET SKF1021=SKF1027 * 0.2 - 1040  WHERE SKF1027>12000 AND SKF1027<=25000 AND SKF1004=NDJXZBDH; -- 税额划分\r\n	\r\n	UPDATE SKT66 SET SKF1021=SKF1027 * 0.25 - 2660  WHERE SKF1027>25000 AND SKF1027<=35000 AND SKF1004=NDJXZBDH; -- 税额划分\r\n	\r\n	UPDATE SKT66 SET SKF1021=SKF1027 * 0.3 - 4410  WHERE SKF1027>35000 AND SKF1027<=55000 AND SKF1004=NDJXZBDH; -- 税额划分\r\n	\r\n	UPDATE SKT66 SET SKF1021=SKF1027 * 0.35 - 7160  WHERE SKF1027>55000 AND SKF1027<=85000 AND SKF1004=NDJXZBDH; -- 税额划分\r\n	\r\n	UPDATE SKT66 SET SKF1021=SKF1027 * 0.45 - 15160  WHERE SKF1027>85000 AND SKF1004=NDJXZBDH; -- 税额划分\r\n	\r\n	UPDATE SKT66 SET SKF1022=SKF1020 - SKF1021 WHERE SKF1004=NDJXZBDH; -- 实发绩效奖金\r\n	\r\n\r\n		IF t_error = 1 THEN\r\n			ROLLBACK;\r\n	ELSE\r\n			COMMIT;\r\n	END IF;\r\n\r\nEND;','',2,'2018-11-28 15:23:53',NULL,0,'1970-01-01 00:00:00',0,0,0,NULL,0,NULL),(114,'SK_PRO_114','67、删除年度绩效奖金及其子表','CREATE PROCEDURE proc_shanchuniandujixiaojiangjinjizibiao(in NDJXZBDH varchar(255))\r\nBEGIN\r\n\r\n	DECLARE t_error int DEFAULT 0;\r\n	DECLARE CONTINUE HANDLER FOR SQLEXCEPTION SET t_error=1;\r\n	START TRANSACTION;\r\n	\r\n	DELETE FROM SKT65 WHERE SKF994=NDJXZBDH; -- 删除年度绩效奖金主表\r\n\r\n	DELETE FROM SKT66 WHERE SKF1004=NDJXZBDH; -- 删除年度绩效奖金子表\r\n\r\n	\r\n		IF t_error = 1 THEN\r\n			ROLLBACK;\r\n	ELSE\r\n			COMMIT;\r\n	END IF;\r\n\r\nEND;','',2,'2018-11-28 15:23:53',NULL,0,'1970-01-01 00:00:00',0,0,0,NULL,0,NULL),(115,'SK_PRO_115','68、计算工资主表的开始日期和结束日期','CREATE PROCEDURE proc_JiSuanGongZiZhuBiaoDeKaiShiRiQiHeJieShuRiQi(in dh varchar(255))\r\nBEGIN\r\n	DECLARE t_error int DEFAULT 0;\r\n	DECLARE CONTINUE HANDLER FOR SQLEXCEPTION SET t_error=1;\r\n	START TRANSACTION;\r\n\r\n	UPDATE SKT15/*工资主表*/ SET \r\n	SKF407/*开始时间*/ = CONCAT(SKF402, \'-1 \', \'00:00:00\'), \r\n	SKF408/*结束时间*/ =CONCAT( DATE_ADD(DATE_ADD(CONCAT(SKF402,\'-1\'),INTERVAL 1 MONTH),INTERVAL -1 DAY) ,\' \',\'23:59:59\')\r\n	WHERE SKF401/*单号*/ = dh;\r\n\r\n	IF t_error = 1 THEN\r\n		ROLLBACK;\r\n	ELSE\r\n		COMMIT;\r\n	END IF;\r\n\r\nEND;','',2,'2018-11-28 15:23:53',NULL,0,'1970-01-01 00:00:00',0,0,0,NULL,0,NULL),(118,'SK_PRO_118','69、计算社保和公积金比例金额','CREATE PROCEDURE proc_JiSuanSheBaoHeGongJiJinBiLiJinE()\r\nBEGIN\r\n	DECLARE t_error int DEFAULT 0;\r\n	DECLARE CONTINUE HANDLER FOR SQLEXCEPTION SET t_error=1;\r\n	START TRANSACTION;\r\n\r\n	UPDATE SKT1/*员工档案表*/ SET\r\n	SKF76/*社保缴费基数*/ = 4279\r\n	WHERE SKF76 <= 4279\r\n	and SKF29 = \'是\';\r\n\r\n	UPDATE SKT1/*员工档案表*/ SET\r\n	SKF76/*社保缴费基数*/ = 21396\r\n	WHERE SKF76 >= 21396\r\n	and SKF29 = \'是\';\r\n\r\n	UPDATE SKT1/*员工档案表*/ SET\r\n	SKF83/*公积金缴费基数*/ = 2300\r\n	WHERE SKF83 <= 2300\r\n	and SKF29 = \'是\';\r\n\r\n	UPDATE SKT1/*员工档案表*/ SET\r\n	SKF83/*公积金缴费基数*/ = 21396\r\n	WHERE SKF83 >= 21396\r\n	and SKF29 = \'是\';\r\n\r\n	/*计算单位养老、医疗、失业、生育、工伤*/\r\n	UPDATE SKT1/*员工档案表*/ SET\r\n	SKF86/*公司缴纳养老金*/ = CEILING(SKF76/*社保缴费基数*/ * 10 * 0.2) / 10,\r\n	SKF87/*公司缴纳医疗保险*/ = CEILING(SKF76 * 10 * 0.095) / 10,\r\n	SKF88/*公司缴纳待业保险*/ = CEILING(SKF76 * 10 * 0.005) / 10,\r\n	SKF89/*公司缴纳生育保险*/ = CEILING(SKF76 * 10 * 0.01) / 10,\r\n	SKF90/*公司缴纳工伤*/ = CEILING(SKF76 * 10 * 0.0045) / 10\r\n	WHERE SKF29 = \'是\';\r\n\r\n	/*计算个人养老、医疗、失业*/\r\n	UPDATE SKT1/*员工档案表*/ SET\r\n	SKF81/*个人缴纳养老金*/ = CEILING(SKF76 * 10 * 0.08) / 10,\r\n	SKF80/*个人缴纳医疗保险*/ = CEILING(SKF76 * 10 * 0.02) / 10,\r\n	SKF79/*个人缴纳待业保险*/ = CEILING(SKF76 * 10 * 0.005) / 10\r\n	WHERE SKF29 = \'是\';\r\n\r\n	/*计算单位公积金*/\r\n	UPDATE SKT1/*员工档案表*/ SET\r\n	SKF85/*公司缴纳公积金*/ = CEILING(SKF83/*公积金缴费基数*/ * 0.07)\r\n	WHERE SKF29 = \'是\';\r\n\r\n	/*计算个人公积金*/\r\n	UPDATE SKT1/*员工档案表*/ SET\r\n	SKF84/*个人缴纳公积金*/ = CEILING(SKF83 * 0.07)\r\n	WHERE SKF29 = \'是\';\r\n\r\n	IF t_error = 1 THEN\r\n		ROLLBACK;\r\n	ELSE\r\n		COMMIT;\r\n	END IF;\r\n\r\nEND;\r\n','',2,'2018-11-28 15:23:53',NULL,0,'1970-01-01 00:00:00',0,0,0,NULL,0,NULL),(119,'SK_PRO_119','70、批量导入时新增员工接口表，部门变更、员工离职更新接口表','create procedure PiLiangDaoRuYuanGong()\r\n\r\nBEGIN\r\n\r\n DECLARE not_found INT DEFAULT 0;\r\n DECLARE WGM VARCHAR(255);\r\n DECLARE GSZ VARCHAR(255);\r\n DECLARE GH VARCHAR(255);\r\n DECLARE SFYY INT; -- 是否已有员工\r\n DECLARE ZWM VARCHAR(255); -- 中文名\r\n DECLARE YWM VARCHAR(255); -- 英文名\r\n DECLARE RZRQ DATE; -- 入职日期\r\n DECLARE CBZX VARCHAR(255); -- 原成本中心\r\n DECLARE XCBZX VARCHAR(255); -- 新成本中心\r\n DECLARE YGLX VARCHAR(255); -- 员工类型\r\n DECLARE t_error INT DEFAULT 0;\r\n DECLARE CONTINUE HANDLER FOR SQLEXCEPTION SET t_error=1;\r\n START TRANSACTION;\r\n BEGIN\r\n	DECLARE cur_1 CURSOR FOR SELECT SKF2293/*工号*/ FROM SKT82/*员工导入临时表*/;\r\n	DECLARE CONTINUE HANDLER FOR NOT FOUND SET not_found=1; \r\n	OPEN cur_1;\r\n		WHILE not_found = 0 DO \r\n			FETCH cur_1 INTO GH;\r\n			SELECT COUNT(*) INTO SFYY FROM SKT1 WHERE SKF1=GH;/*根据工号查看是否已有人员*/\r\n			\r\n			IF SFYY=0 THEN /*如果没有这个工号就新增员工档案*/\r\n\r\n			INSERT INTO SKT1 SELECT * FROM SKT82 WHERE SKF2293=GH;\r\n			SELECT SKF2393,SKF2395 INTO GSZ,WGM FROM SKT82 WHERE SKF2293=GH;\r\n			UPDATE SKT1 SET SKF813=WGM,SKF715=GSZ WHERE SKF1=GH;\r\n			\r\n			 SELECT SKF2295/*中文名*/,SKF2395/*英文名*/,SKF2313/*入职日期*/,SKF2294/*成本中心*/,SKF2299 INTO ZWM/*中文名*/,YWM/*英文名*/,RZRQ/*入职日期*/,CBZX/*成本中心*/,YGLX FROM SKT82 WHERE SKF2293=GH;\r\n			 \r\n			-- 新增员工接口表\r\n				INSERT INTO skt86 (\r\n				--  `SKF734`,-- id\r\n				  SKF2443,-- 工号\r\n				  SKF2444,-- 姓名\r\n				  SKF2445,-- 入职日期\r\n				--  `SKF738`,-- 离职日期\r\n				  SKF2447,-- 部门变更日期\r\n				  SKF2448,-- BU成本中心\r\n				--  `SF_CREATE_USER`,-- \r\n				--  `SF_LAST_CHANGE_USER`,-- \r\n				--  `SF_CREATE_TIME`,-- \r\n				--  `SF_LAST_CHANGE_TIME`,-- \r\n				--  `MachineCode`,-- \r\n				--  `Sf_Last_Sync_TimeStamp`,-- \r\n				  SKF2449, -- 是否已变更\r\n				  SKF2450, -- 入职日期文字\r\n				  SKF2452, -- 部门变更日期文字\r\n				  SKF2451,\r\n				  SKF2457\r\n\r\n				) \r\n				VALUES\r\n				  (\r\n				    GH,-- 工号\r\n				    concat(ZWM, \'-\', YWM),-- 姓名\r\n				    RZRQ,-- 入职日期\r\n				--    \'SKF738\',-- 离职日期\r\n				    RZRQ,-- 部门变更日期\r\n				    CBZX,-- BU成本中心\r\n				    0, -- 是否已变更\r\n				    DATE_FORMAT(RZRQ,\'%Y%m%d\'),\r\n				     DATE_FORMAT(RZRQ,\'%Y%m%d\'),\r\n				     0,\r\n				     YGLX\r\n				  ) ;\r\n			\r\n			\r\n			ELSE /*已有员工就更新他的员工档案*/\r\n\r\n			SELECT SKF2294 INTO XCBZX FROM SKT82 WHERE SKF2293=GH;/*查询到员工导入临时表中的BU*/\r\n			 SELECT SKF2295/*中文名*/,SKF2395/*英文名*/,SKF2313/*入职日期*/,SKF2294/*成本中心*/,SKF2299 INTO ZWM/*中文名*/,YWM/*英文名*/,RZRQ/*入职日期*/,CBZX/*成本中心*/,YGLX FROM SKT82 WHERE SKF2293=GH;\r\n\r\n				\r\n				IF XCBZX != CBZX THEN\r\n				\r\n				-- 更新员工接口表\r\n				update \r\n				  skt86\r\n				set\r\n				  SKF2449 = 1 -- 是否已变更\r\n				where SKF2443 = GH ;-- 工号\r\n		\r\n			-- 新增员工接口表\r\n				INSERT INTO skt86 (\r\n				--  `SKF734`,-- id\r\n				  SKF2443,-- 工号\r\n				  SKF2444,-- 姓名\r\n				  SKF2445,-- 入职日期\r\n				--  `SKF738`,-- 离职日期\r\n				  SKF2447,-- 部门变更日期\r\n				  SKF2448,-- BU成本中心\r\n				--  `SF_CREATE_USER`,-- \r\n				--  `SF_LAST_CHANGE_USER`,-- \r\n				--  `SF_CREATE_TIME`,-- \r\n				--  `SF_LAST_CHANGE_TIME`,-- \r\n				--  `MachineCode`,-- \r\n				--  `Sf_Last_Sync_TimeStamp`,-- \r\n				  SKF2449, -- 是否已变更\r\n				  SKF2450, -- 入职日期文字\r\n				  SKF2452, -- 部门变更日期文字\r\n				  SKF2451,\r\n				  SKF2457\r\n\r\n				) \r\n				VALUES\r\n				  (\r\n				    GH,-- 工号\r\n				    concat(ZWM, \'-\', YWM),-- 姓名\r\n				    RZRQ,-- 入职日期\r\n				--    \'SKF738\',-- 离职日期\r\n				    CURDATE(),-- 部门变更日期\r\n				    CBZX,-- BU成本中心\r\n				    0, -- 是否已变更\r\n				    DATE_FORMAT(RZRQ,\'%Y%m%d\'),\r\n				     DATE_FORMAT(CURDATE(),\'%Y%m%d\'),\r\n				     0,\r\n				     YGLX\r\n				  ) ;\r\n			\r\n\r\n				END IF;\r\n			DELETE FROM SKT1 WHERE SKF1=GH; /*删掉之前记录*/\r\n			INSERT INTO SKT1 SELECT * FROM SKT82 WHERE SKF2293=GH;/*新增一条记录*/\r\n			SELECT SKF2393,SKF2395 INTO GSZ,WGM FROM SKT82 WHERE SKF2293=GH;\r\n			UPDATE SKT1 SET SKF813=WGM,SKF715=GSZ WHERE SKF1=GH;\r\n			\r\n			END IF;\r\n\r\n		END WHILE;\r\n	CLOSE cur_1;\r\n		\r\n			\r\n\r\n		 TRUNCATE SKT82;/*删除掉员工档案临时表*/\r\n	\r\n END;  \r\n	 IF t_error = 1 THEN  \r\n		 ROLLBACK;  \r\n	 ELSE  \r\n		  COMMIT;  \r\n	 END IF; \r\n \r\nEND;\r\n\r\n\r\n-- 78、删除员工接口表历史数据\r\nCREATE PROCEDURE ShanChuYuanGongJieKouBiaoLiShiJiLu()\r\nBEGIN\r\nDECLARE t_error int DEFAULT 0 ;\r\nDECLARE CONTINUE HANDLER FOR SQLEXCEPTION SET t_error=1;\r\nSTART TRANSACTION;\r\n\r\ntruncate skt46;\r\n\r\n	IF t_error=1 THEN\r\n		ROLLBACK;\r\n	ELSE\r\n		COMMIT;\r\n	END IF;\r\n\r\nEND;\r\n','',2,'2018-11-28 15:23:53','2018-11-30 19:37:23',0,'1970-01-01 00:00:00',0,0,0,'1970-01-01 08:00:00',0,NULL),(122,'SK_PRO_122','71、自动生成每日考勤接口表和导出表','CREATE PROCEDURE proc_insertyuangongjiekoubiao()\r\nBEGIN\r\nDECLARE not_found INT DEFAULT 0;\r\nDECLARE SKF159_GongHao VARCHAR(255);\r\nDECLARE SKF170_DaKaRiQi DATETIME;-- 打卡日期\r\nDECLARE ShangBanDaKa DATETIME;-- 上班打卡\r\nDECLARE XiaBanDaKa DATETIME;-- 下班打卡\r\nDECLARE SKF166_YingShangBanRiQi DATETIME;-- SKF166\r\nDECLARE SKF167_YingXiaBanRiQi DATETIME;-- SKF167\r\n\r\n\r\nDECLARE SKF787GH INT(255); -- dc工号 \r\n	DECLARE SKF788DKRQ DATE; -- dc打卡日期\r\n	DECLARE SKF789EU VARCHAR(32);-- dcEU打卡\r\n	DECLARE SKF790DKYSSJ DATETIME; -- dc上下班打卡原始时间\r\n	DECLARE SKF791SXBDK TIME; -- dc上下班打卡时间\r\n	DECLARE SKF790GZSJ INT; -- dc工作时间\r\n	DECLARE SKF793BCLX VARCHAR(64); -- dc班次类型\r\n\r\nDECLARE t_error INT DEFAULT 0;\r\nDECLARE CONTINUE HANDLER FOR SQLEXCEPTION SET t_error=1;\r\nSTART TRANSACTION;\r\n\r\n\r\nBEGIN\r\n\r\nDECLARE cur_1 CURSOR FOR SELECT SKF159,-- SKF159\r\n                SKF170,-- 打卡日期\r\n                SKF162,-- SKF162\r\n                SKF163,-- SKF163\r\n                SKF166,-- SKF166\r\n                skf167-- SKF167\r\n     FROM SKT6 \r\nWHERE SKF170  = DATE_SUB(CURDATE(),INTERVAL 1 DAY);\r\n\r\nDECLARE cur CURSOR FOR SELECT SKF746, -- dc工号\r\n						SKF747, -- dc打卡日期\r\n						SKF748, -- dcEU上下班打卡\r\n						SKF749, -- dc上下班打卡原始时间\r\n						SKF750, -- dc上下班打卡时间\r\n						SKF751, --  dc工作时间\r\n						SKF752 --  dc班次类型\r\n					from SKT47\r\n					where SKF2396 >DATE_SUB(CURDATE(),INTERVAL 50 DAY);\r\n\r\nDECLARE CONTINUE HANDLER FOR NOT FOUND SET not_found=1;\r\n\r\n     OPEN cur_1;\r\n\r\n            \r\n            WHILE not_found=0 DO\r\n                FETCH cur_1 INTO SKF159_GongHao,SKF170_DaKaRiQi,ShangBanDaKa,XiaBanDaKa,SKF166_YingShangBanRiQi,SKF167_YingXiaBanRiQi;\r\n                   IF not_found=0 THEN        \r\n              \r\n                                \r\n              -- 生成考勤接口原始表\r\n          \r\n                  INSERT INTO SKT47(SKF746,-- SKF746\r\n                                    SKF747,-- SKF747\r\n                                    SKF748,-- 上班卡E\r\n                                    SKF749,-- 上班打卡原始时间\r\n                                    SKF750, -- 上班打卡时间\r\n                                    SKF751,-- SKF751\r\n                                    SKF752,\r\n				    SKF2396) \r\n                                    \r\n                               VALUES(SKF159_GongHao,-- SKF746\r\n                                      SKF170_DaKaRiQi,-- SKF747\r\n                                     \'E\',-- 上班卡E\r\n                                      ShangBanDaKa,-- 上班打卡\r\n                                       date_format(ShangBanDaKa,\'%H:%i\'),\r\n                                      0,-- SKF751\r\n                                      \'ORD\',-- SKF752\r\n					 date_format(ShangBanDaKa,\'%Y-%m-%d\')\r\n                                       );\r\n                  -- 更新正常上班打卡时间\r\n                              IF ShangBanDaKa<SKF166_YingShangBanRiQi THEN -- 上班打卡时间早于应上班打卡时间\r\n                            UPDATE SKT47 SET SKF750=DATE_FORMAT(SKF166_YingShangBanRiQi ,\'%H:%i\')\r\n                            WHERE SKF746=SKF159_GongHao AND-- SKF746\r\n                                    SKF747=SKF170_DaKaRiQi AND\r\n                                    SKF748=\'E\' ;\r\n				    select \'test1\';\r\n\r\n                             END IF;             \r\n                                   \r\n         \r\n                  INSERT INTO SKT47(SKF746,-- SKF746\r\n                                    SKF747,-- SKF747\r\n                                    SKF748,-- 下班卡U\r\n                                    SKF749, -- 下班打卡原始时间\r\n                                    SKF750,  -- 下班打卡的时间\r\n                                    SKF751,-- SKF751\r\n                                    SKF752,\r\n				    SKF2396) -- SKF752\r\n                                    VALUES(SKF159_GongHao,-- SKF746\r\n                                           SKF170_DaKaRiQi,-- SKF747\r\n                                           \'U\',-- 下班卡U\r\n                                           XiaBanDaKa,-- 下班打卡\r\n                                           date_format(XiaBanDaKa,\'%H:%i\'),\r\n                                           0,-- SKF751\r\n                                           \'ORD\',-- 工作类型\r\n					date_format(ShangBanDaKa,\'%Y-%m-%d\')\r\n                                           );\r\n                        -- 更新正常下班打卡时间\r\n                         IF XiaBanDaKa>SKF167_YingXiaBanRiQi THEN-- 下班打卡时间晚于应下班打卡时间\r\n                       UPDATE SKT47 SET SKF750=date_format(SKF167_YingXiaBanRiQi ,\'%H:%i\')\r\n                       WHERE SKF746=SKF159_GongHao AND\r\n                             SKF747=SKF170_DaKaRiQi AND\r\n                             SKF748=\'U\';\r\n			     select \'test2\';\r\n                         END IF;\r\n            \r\n                   END IF; \r\n              \r\n            END WHILE;       \r\n     CLOSE cur_1;\r\n     set not_found=0;\r\n     open cur;\r\n			truncate skt52;\r\n			\r\n			WHILE not_found=0 DO\r\n				FETCH cur into SKF787GH,SKF788DKRQ,SKF789EU,SKF790DKYSSJ,SKF791SXBDK,SKF790GZSJ,SKF793BCLX;\r\n					-- TRUNCATE SKT52;\r\n				 IF  not_found=0 THEN  \r\n\r\n				-- 生成考勤导出表\r\n					insert into SKT52(SKF787, -- DC工号\r\n							  SKF788, -- dc打卡日期\r\n							  SKF789, -- EU上下打卡\r\n							  SKF790, -- dc打卡原始时间\r\n							  SKF791, -- dc上下班打卡时间\r\n							  SKF792, -- dc工作时间\r\n							  SKF793,  -- dc班次类型\r\n							  SKF829,-- dc打卡日期txt\r\n							  SKF830  -- dc打卡时间txt\r\n							)\r\n						VALUES(SKF787GH,  -- DC工号\r\n							SKF788DKRQ, -- dc打卡日期\r\n							SKF789EU,  -- EU上下打卡\r\n							SKF790DKYSSJ, -- dc打卡原始时间\r\n							SKF791SXBDK, -- dc上下班打卡时间\r\n							SKF790GZSJ,-- dc工作时间\r\n							SKF793BCLX, -- dc班次类型\r\n							CONCAT(SUBSTRING(SKF788DKRQ,1,4),SUBSTRING(SKF788DKRQ,6,2), SUBSTRING(SKF788DKRQ,9,2)), -- dc打卡日期txt\r\n							CONCAT(SUBSTRING(SKF791SXBDK,1,2),SUBSTRING(SKF791SXBDK,4,2))   -- dc打卡时间txt\r\n							);\r\n				  END IF;\r\n			\r\n			 END WHILE;\r\n		CLOSE cur;\r\n\r\n\r\nEND;	\r\n\r\n	IF t_error = 1 THEN\r\n			ROLLBACK;\r\n	ELSE\r\n			COMMIT;\r\n	END IF;\r\n    END;\r\n','',2,'2018-11-28 15:23:53','2018-12-01 14:52:43',3,'1970-01-01 12:00:00',1,0,0,'1970-01-01 08:00:00',0,NULL),(132,'SK_PRO_132','72、刷新区间','CREATE PROCEDURE ShuaXinQuJian(in ksrq/*开始日*/ date, in jsrq/*结束日*/ date)\r\nBEGIN\r\n	DECLARE SKF145_KaoQinBianHao varchar(255);-- SKF145\r\n	DECLARE SKF146_RiQi date;-- SKF146\r\n	DECLARE rq date;\r\n\r\n	DECLARE not_found INT DEFAULT 0;\r\n	DECLARE t_error int DEFAULT 0;\r\n	DECLARE CONTINUE HANDLER FOR SQLEXCEPTION SET t_error=1;\r\n	START TRANSACTION;\r\n\r\n	begin\r\n	DECLARE cur_1 CURSOR FOR SELECT SKF145,-- SKF145\r\n	SKF146-- SKF146\r\n	FROM SKT5-- SKT5\r\n	where ksrq/*开始日*/ <= SKF146\r\n	and SKF146 <= jsrq/*结束日*/;\r\n	DECLARE CONTINUE HANDLER FOR NOT FOUND SET not_found=1;\r\n\r\n	OPEN cur_1;\r\n		WHILE not_found = 0 DO \r\n			FETCH cur_1 INTO SKF145_KaoQinBianHao, SKF146_RiQi;\r\n-- 123\r\n			-- 03、当天默认上下班时间\r\n			call SK_PRO_8(SKF145_KaoQinBianHao);\r\n			-- 15、当日是否请假\r\n			call SK_PRO_26(SKF145_KaoQinBianHao, SKF146_RiQi);\r\n			-- 16、重新计算上班时间1_请假\r\n			call SK_PRO_27(SKF145_KaoQinBianHao, SKF146_RiQi);\r\n			-- 25、重新计算上班时间2_外出\r\n			call SK_PRO_51(SKF145_KaoQinBianHao, SKF146_RiQi);\r\n			-- 26、重新计算上班时间3_出差\r\n			call SK_PRO_52(SKF145_KaoQinBianHao, SKF146_RiQi);\r\n			-- 27、重新计算下班时间1_请假\r\n			call SK_PRO_53(SKF145_KaoQinBianHao, SKF146_RiQi);\r\n			-- 28、重新计算下班时间2_外出\r\n			call SK_PRO_54(SKF145_KaoQinBianHao, SKF146_RiQi);\r\n			-- 29、重新计算下班时间3_出差\r\n			call SK_PRO_55(SKF145_KaoQinBianHao, SKF146_RiQi);\r\n			-- 30、再次计算上下班时间\r\n			call SK_PRO_56(SKF145_KaoQinBianHao);\r\n			-- 31、当日考勤1\r\n			call SK_PRO_57(SKF145_KaoQinBianHao, SKF146_RiQi);\r\n			-- 32、当日考勤统计\r\n			call SK_PRO_58(SKF145_KaoQinBianHao, SKF146_RiQi);\r\n			-- 33、当日请假合计\r\n			call SK_PRO_59(SKF145_KaoQinBianHao);\r\n			-- 34、旷工\r\n			call SK_PRO_60(SKF145_KaoQinBianHao);\r\n			-- 35、重新计算旷工\r\n			call SK_PRO_61(SKF145_KaoQinBianHao);\r\n			-- 36、上班补打\r\n			call SK_PRO_62(SKF145_KaoQinBianHao, SKF146_RiQi);\r\n			-- 37、下班补打\r\n			call SK_PRO_63(SKF145_KaoQinBianHao, SKF146_RiQi);\r\n			-- 38、加班重新计算\r\n			call SK_PRO_64(SKF145_KaoQinBianHao, SKF146_RiQi);\r\n\r\n		END WHILE;\r\n	CLOSE cur_1;\r\n	end;\r\n\r\n	IF t_error = 1 THEN\r\n		ROLLBACK;\r\n	ELSE\r\n		COMMIT;\r\n	END IF;\r\n\r\nEND;','',2,'2018-11-28 15:23:53',NULL,0,'1970-01-01 00:00:00',0,0,0,NULL,0,NULL),(133,'SK_PRO_133','73、自动生成每日考勤','CREATE PROCEDURE proc_ZiDongShengChengMeiRiKaoQin()\r\nBEGIN\r\n\r\n	DECLARE sl INT;\r\n	DECLARE dh varchar(255);\r\n\r\n	DECLARE t_error int DEFAULT 0;\r\n	DECLARE CONTINUE HANDLER FOR SQLEXCEPTION SET t_error=1;\r\n	START TRANSACTION;\r\n\r\n	select count(SKF145)/*考勤编号*/ into sl from SKT5/*每日考勤主表*/ where SKF146/*日期*/ = curdate();\r\n\r\n	if sl = 0 then\r\n\r\n		set dh = DATE_FORMAT(curdate(), \'%Y%m%d\');\r\n		insert into SKT5/*每日考勤主表*/(SKF145/*考勤编号*/, SKF146/*日期*/) values(dh, curdate());\r\n\r\n		insert into SKT6/*每日考勤明细表*/(\r\n		SKF153/*主表编号*/, \r\n		SKF170/*考勤日期*/, \r\n		SKF154/*考勤机人员编号*/, \r\n		SKF159/*工号*/, \r\n		SKF155/*姓名*/, \r\n		SKF160/*部门*/, \r\n		SKF161/*班组*/) \r\n		select \r\n		dh/*主表编号*/, \r\n		curdate()/*考勤日期*/, \r\n		SKF27/*考勤机人员编号*/, \r\n		SKF1/*工号*/, \r\n		SKF3/*姓名*/, \r\n		SKF31/*部门*/, \r\n		SKF32/*班组*/\r\n		from SKT1/*员工档案表*/\r\n		where SKF27/*考勤机人员编号*/ > 0\r\n		and SKF29/*是否在职*/ = \'是\';\r\n\r\n	end if;\r\n\r\n	IF t_error = 1 THEN\r\n		ROLLBACK;\r\n	ELSE\r\n		COMMIT;\r\n	END IF;\r\n\r\nEND;\r\n','',2,'2018-11-28 15:23:53','2018-12-03 10:02:12',3,'1970-01-01 00:01:00',1,0,0,'2018-12-03 10:02:04',0,NULL),(134,'SK_PRO_134','74、删除加班统计表','CREATE PROCEDURE JiaBanTongJiBiao()\r\nBEGIN\r\nDECLARE t_error int DEFAULT 0 ;\r\nDECLARE CONTINUE HANDLER FOR SQLEXCEPTION SET t_error=1;\r\nSTART TRANSACTION;\r\n\r\nTRUNCATE SKT13;\r\n\r\n	IF t_error=1 THEN\r\n		ROLLBACK;\r\n	ELSE\r\n		COMMIT;\r\n	END IF;\r\n\r\nEND;','',2,'2018-11-28 15:23:53',NULL,0,'1970-01-01 00:00:00',0,0,0,NULL,0,NULL),(135,'SK_PRO_135','75、加班申请计算加班小时','CREATE PROCEDURE JiSuanJianBanXiaoShi(in date1 datetime,in date2 datetime)\r\nBEGIN\r\n	DECLARE not_found int DEFAULT 0;\r\n	DECLARE GH VARCHAR(255);\r\n	DECLARE XH INT;\r\n-- 加班小时\r\nDECLARE JBXH15 DECIMAL(12,3); \r\nDECLARE JBXH2 DECIMAL(12,3);  \r\nDECLARE JBXH3 DECIMAL(12,3); \r\n\r\n\r\n-- 用餐小时\r\nDECLARE YCXH15 DECIMAL(12,3); \r\nDECLARE YCXH2 DECIMAL(12,3);  \r\nDECLARE YCXH3 DECIMAL(12,3);\r\n\r\n\r\n\r\n\r\n	DECLARE t_error int DEFAULT 0;\r\n	DECLARE CONTINUE HANDLER FOR SQLEXCEPTION SET t_error=1;\r\n	START TRANSACTION;\r\n	\r\n	BEGIN\r\n\r\n	DECLARE cur_1 CURSOR FOR SELECT SKF325,SKF326 FROM SKT13;\r\n	DECLARE CONTINUE HANDLER FOR NOT FOUND SET not_found=1;\r\n\r\n	OPEN cur_1;\r\n		WHILE not_found = 0 DO\r\n\r\n		FETCH cur_1 INTO XH,GH;\r\n		-- 加班小时\r\n		SELECT SUM(SKF277) INTO JBXH15 FROM SKT11 WHERE SKF274>=date1 AND SKF274<=date2 AND SKF264=GH AND SKF273=\'平日\' AND SKF272=\'加班费\' AND SKF705 LIKE \'%终审通过%\';\r\n		SELECT SUM(SKF277) INTO JBXH2 FROM SKT11 WHERE SKF274>=date1 AND SKF274<=date2 AND SKF264=GH AND SKF273=\'双休日\' AND SKF272=\'加班费\' AND SKF705 LIKE \'%终审通过%\';\r\n		SELECT SUM(SKF277) INTO JBXH3 FROM SKT11 WHERE SKF274>=date1 AND SKF274<=date2 AND SKF264=GH AND SKF273=\'国定日\' AND SKF272=\'加班费\' AND SKF705 LIKE \'%终审通过%\';\r\n		\r\n\r\n		-- 用餐小时\r\n		SELECT SUM(SKF278) INTO YCXH15 FROM SKT11 WHERE SKF274>=date1 AND SKF274<=date2 AND SKF264=GH AND SKF273=\'平日\' AND SKF272=\'加班费\' AND SKF705 LIKE \'%终审通过%\';\r\n		SELECT SUM(SKF278) INTO YCXH2 FROM SKT11 WHERE SKF274>=date1 AND SKF274<=date2 AND SKF264=GH AND SKF273=\'双休日\' AND SKF272=\'加班费\' AND SKF705 LIKE \'%终审通过%\';\r\n		SELECT SUM(SKF278) INTO YCXH3 FROM SKT11 WHERE SKF274>=date1 AND SKF274<=date2 AND SKF264=GH AND SKF273=\'国定日\' AND SKF272=\'加班费\' AND SKF705 LIKE \'%终审通过%\';\r\n		\r\n\r\n\r\n         		UPDATE SKT13 SET SKF329=JBXH15,\r\n         				SKF330=JBXH2,\r\n					SKF331=JBXH3,\r\n					SKF332=YCXH15,\r\n					SKF333=YCXH2,\r\n				SKF334=YCXH3 WHERE SKF325=XH;\r\n\r\n		\r\n		UPDATE SKT13 SET SKF329=0 WHERE SKF329 IS NULL;\r\n		UPDATE SKT13 SET SKF330=0 WHERE SKF330 IS NULL;\r\n		UPDATE SKT13 SET SKF331=0 WHERE SKF331 IS NULL;\r\n		UPDATE SKT13 SET SKF332=0 WHERE SKF332 IS NULL;\r\n		UPDATE SKT13 SET SKF333=0 WHERE SKF333 IS NULL;\r\n		UPDATE SKT13 SET SKF334=0 WHERE SKF334 IS NULL;	\r\n		\r\n		END WHILE;\r\n\r\n\r\n	CLOSE cur_1;\r\n\r\n	END;\r\n	\r\n\r\n	IF t_error = 1 THEN\r\n			ROLLBACK;\r\n	ELSE\r\n			COMMIT;\r\n	END IF;\r\n\r\nEND;\r\n','',2,'2018-11-28 15:23:53','2018-11-29 21:32:37',0,'1970-01-01 00:00:00',0,0,0,'1970-01-01 08:00:00',0,NULL),(137,'SK_PRO_137','76、计算加班工资','CREATE PROCEDURE JiSuanJianBanGongZi()\r\nBEGIN\r\nDECLARE t_error int DEFAULT 0 ;\r\nDECLARE CONTINUE HANDLER FOR SQLEXCEPTION SET t_error=1;\r\nSTART TRANSACTION;\r\n\r\n-- 计算加班工资\r\nUPDATE SKT13 SET SKF335=(SKF328/21.75/8)*1.5*SKF329, -- 平日加班工资\r\n		SKF336=(SKF328/21.75/8)*2*SKF330, -- 双休日加班工资\r\n		SKF341=(SKF328/21.75/8)*2*SKF331,\r\n		 -- 国定日日加班工资\r\n		SKF342=(SKF328/21.75/8)*2*SKF332, -- 平日用餐工资\r\n		SKF343=(SKF328/21.75/8)*2*SKF333, -- 双休日用餐工资\r\n		SKF344=(SKF328/21.75/8)*2*SKF334; -- 国定日用餐工资\r\n\r\n-- 计算加班合计\r\nUPDATE SKT13 SET SKF345=SKF329+SKF330+SKF331, -- 加班小时合计\r\n		SKF346=SKF335+SKF336+SKF341, -- 加班工资合计\r\n		SKF347=SKF332+SKF333+SKF334, -- 用餐工时合计\r\n		SKF348=SKF342+SKF343+SKF344, -- 用餐工资合计\r\n		SKF584=SKF329+SKF330+SKF331+SKF332+SKF333+SKF334, -- 加班用餐工时合计\r\n		SKF585=SKF335+SKF336+SKF341+SKF342+SKF343+SKF344; -- 加班用餐工资合计\r\n\r\n\r\n	IF t_error=1 THEN\r\n		ROLLBACK;\r\n	ELSE\r\n		COMMIT;\r\n	END IF;\r\n\r\nEND;','',2,'2018-11-28 15:23:53',NULL,0,'1970-01-01 00:00:00',0,0,0,NULL,0,NULL),(138,'SK_PRO_138','77、计算综合工时加班小时','CREATE PROCEDURE JiSuanJianBanXiaoShi(in date1 datetime,in date2 datetime)\r\nBEGIN\r\n	DECLARE not_found int DEFAULT 0;\r\n	DECLARE GH VARCHAR(255);\r\n	DECLARE XH INT;\r\n\r\n-- 综合工时加班小时\r\nDECLARE ZHGSXH15 DECIMAL(12,3); \r\nDECLARE ZHGSXH2 DECIMAL(12,3); \r\nDECLARE ZHGSXH3 DECIMAL(12,3); \r\n\r\n-- 综合工时用餐小时\r\nDECLARE ZHGSYC15 DECIMAL(12,3);\r\nDECLARE ZHGSYC2 DECIMAL(12,3);\r\nDECLARE ZHGSYC3 DECIMAL(12,3);\r\n\r\n\r\n\r\n\r\n\r\n	DECLARE t_error int DEFAULT 0;\r\n	DECLARE CONTINUE HANDLER FOR SQLEXCEPTION SET t_error=1;\r\n	START TRANSACTION;\r\n	\r\n	BEGIN\r\n\r\n	DECLARE cur_1 CURSOR FOR SELECT SKF325,SKF326 FROM SKT13;\r\n	DECLARE CONTINUE HANDLER FOR NOT FOUND SET not_found=1;\r\n\r\n	OPEN cur_1;\r\n		WHILE not_found = 0 DO\r\n\r\n		FETCH cur_1 INTO XH,GH;\r\n		\r\n		-- 综合工时加班小时\r\n		SELECT SUM(SKF807) INTO ZHGSXH15 FROM SKT21 WHERE SKF831>=date1 AND SKF831<=date2 AND SKF495=GH AND SKF646=\'综合工时\';\r\n		SELECT SUM(SKF809) INTO ZHGSXH2 FROM SKT21 WHERE SKF831>=date1 AND SKF831<=date2 AND SKF495=GH AND SKF646=\'综合工时\';\r\n		SELECT SUM(SKF811) INTO ZHGSXH3 FROM SKT21 WHERE SKF831>=date1 AND SKF831<=date2 AND SKF495=GH AND SKF646=\'综合工时\';\r\n\r\n\r\n		-- 综合工时用餐小时\r\n		SELECT SUM(SKF808) INTO ZHGSYC15 FROM SKT21 WHERE SKF831>=date1 AND SKF831<=date2 AND SKF495=GH AND SKF646=\'综合工时\';\r\n		SELECT SUM(SKF810) INTO ZHGSYC2 FROM SKT21 WHERE SKF831>=date1 AND SKF831<=date2 AND SKF495=GH AND SKF646=\'综合工时\';\r\n		SELECT SUM(SKF812) INTO ZHGSYC3 FROM SKT21 WHERE SKF831>=date1 AND SKF831<=date2 AND SKF495=GH AND SKF646=\'综合工时\';\r\n\r\n		\r\n\r\n		UPDATE SKT13 SET SKF329=(SKF329+ZHGSXH15),\r\n				SKF330=(SKF330+ZHGSXH2),\r\n				SKF331=(SKF331+ZHGSXH3),\r\n				SKF332=(SKF332+ZHGSYC15),\r\n				SKF333=(SKF333+ZHGSYC2),\r\n				SKF334=(SKF334+ZHGSYC3) WHERE SKF325=XH;\r\n		\r\n		UPDATE SKT13 SET SKF329=0 WHERE SKF329 IS NULL;\r\n		UPDATE SKT13 SET SKF330=0 WHERE SKF330 IS NULL;\r\n		UPDATE SKT13 SET SKF331=0 WHERE SKF331 IS NULL;\r\n		UPDATE SKT13 SET SKF332=0 WHERE SKF332 IS NULL;\r\n		UPDATE SKT13 SET SKF333=0 WHERE SKF333 IS NULL;\r\n		UPDATE SKT13 SET SKF334=0 WHERE SKF334 IS NULL;	\r\n		\r\n		END WHILE;\r\n\r\n\r\n	CLOSE cur_1;\r\n\r\n	END;\r\n	\r\n\r\n	IF t_error = 1 THEN\r\n			ROLLBACK;\r\n	ELSE\r\n			COMMIT;\r\n	END IF;\r\n\r\nEND;\r\n','',2,'2018-11-29 13:07:02','2018-11-29 21:22:25',0,'1970-01-01 00:00:00',0,0,0,'1970-01-01 08:00:00',0,NULL),(139,'SK_PRO_139','78、删除员工接口表历史数据','CREATE PROCEDURE ShanChuYuanGongJieKouBiaoLiShiJiLu()\r\nBEGIN\r\nDECLARE t_error int DEFAULT 0 ;\r\nDECLARE CONTINUE HANDLER FOR SQLEXCEPTION SET t_error=1;\r\nSTART TRANSACTION;\r\n\r\ntruncate skt46;\r\n\r\n	IF t_error=1 THEN\r\n		ROLLBACK;\r\n	ELSE\r\n		COMMIT;\r\n	END IF;\r\n\r\nEND;','',2,'2018-11-30 15:58:18',NULL,0,'1970-01-01 00:00:00',0,0,0,NULL,0,NULL);

